(1, 1, 'Sun in London on Saturday 25th November', 'sun-london-saturday-25th-november', '<p align="justify">Sun in London is rare and according to Accuweather, <strong>Saturday 25<sup>th</sup> November 2017</strong> is supposed to feature periods of cloud <strong>and sun</strong>&hellip; Common knowledge and scientists at Nasa&nbsp;agree that nothing is more&nbsp;<strong>important</strong>&nbsp;to us on Earth than the&nbsp;<strong>Sun</strong>. Without its h eat and light, warming our seas and brightening our atmosphere, Earth would be rather gloomy&hellip; and, well,&nbsp; lifeless. The bundle of gases is incredibly important, but also rather rare on our tiny island in the Atlantic.</p>\r\n<p align="justify">However, the appearance of Sun in London is not the only thing special about that date. It is also the date of <span style="text-decoration: underline;"><em><strong>our very last IELTS exam of 2017</strong></em></span>!</p>\r\n<p align="justify"><span style="text-decoration: underline;"><strong>Timing</strong></span></p>\r\n<p align="justify">Medics registering from now until the end of next week will have over 5 weeks between now and then to prepare. We advise that &ndash; on average &ndash; it takes approx. &nbsp;5 weeks of instruction to improve 0.5 bands in IELTS Reading and IELTS Writing. The best thing about preparation is that, just like GP Ruta advised, it&rsquo;s always best to avoid cramming before an important exam. <strong>Success follows hard work</strong> and if you can take the time to equip yourself, your success is inevitable.</p>\r\n<p align="justify"><span style="text-decoration: underline;"><strong>What is an IELTS Medical exam like?</strong></span></p>\r\n<p align="justify">Taking a closed examination at IELTS Medical is supposed to give you the best possible chance at the 7.0-7.5. Your Listening, Reading and Writing papers are all in a state of the art lecture theatre. Then &ndash; after a delicious lunch (provided) &ndash; your Speaking exam takes place at the centre where you&rsquo;ve done your preparation.&nbsp;That&rsquo;s not all! There is also a <strong>MAXIMUM of 20</strong> spaces in our exam making it an altogether more pleasant experience for any of us who have taken the examination before with hundreds of other candidates.</p>\r\n<p align="justify">In conclusion, on <strong>Saturday 25th November 2017</strong>, we&rsquo;ll endeavor to bring great exam conditions <strong>and</strong> <strong>sun</strong>. So long as <strong>you</strong> bring your <strong>best self</strong>, it should be a <strong>successful day</strong>.</p>\r\n<p align="justify"><em><strong>Catch some sun with us&hellip; Call 02036376722!</strong></em></p>', '', '190916114840.webp', 1, '2019-09-16 11:48:40'),
(2, 1, 'NMC OSCE Course – Getting ready for OSCE success in London', 'nmc-osce-course-in-london', '<ul>\r\n<li><span style="font-size: 18px;"><strong>By Anna</strong></span></li>\r\n</ul>\r\n<p align="justify"><span style="font-size: 18px;">The final stage of registration for overseas qualified nurses is the OSCE. The role of this test is to measure the candidates against the current UK pre-registration standards. Nursing in the UK is made up of separate fields of practice, each requiring three years of pre-registration undergraduate education.</span></p>\r\n<p align="justify"><span style="font-size: 18px;">The OSCE will test our nurses on their communication and clinical skills, as well as decision making and handling difficult situations. It is made up of six stations, each lasting 15 minutes. Four of the stations will be scenario based and relate to:</span></p>\r\n<p><span style="font-size: 18px;">1) assessment- holistic patient centred,</span></p>\r\n<p><span style="font-size: 18px;">2) planning,</span></p>\r\n<p><span style="font-size: 18px;">3) implementation,</span></p>\r\n<p><span style="font-size: 18px;">4) evaluation.</span></p>\r\n<p align="justify"><span style="font-size: 18px;">All of which are stages of nursing and midwifery care, where you will be expected to apply your theoretical nursing knowledge to a real-life situation. Two stations will be testing practical clinical skills. You have to keep in mind that in order to pass the exam, you will have to have done many of the nursing/midwifery scenarios before.</span></p>\r\n<p align="justify"><span style="font-size: 18px;">At IELTS Medical we offer OSCE preparation courses for nurses. Our OSCE trainers&nbsp;are experienced, registered nurses who train for Central London NHS trusts. Together&nbsp;our goal is to assist overseas qualified nurses to gain employment within UK hospitals (both NHS and private healthcare).</span></p>\r\n<p align="justify"><span style="font-size: 18px;">We have OSCE training at least once a month in <strong>North and Central London</strong>. To find out when our next OSCE coaching will take place, visit our&nbsp; dedicated <a href="http://www.oscenurses.com" target="_blank" rel="noopener noreferrer">NMC OSCE website for OSCE Nurses</a> or <a href="https://www.eventbrite.co.uk/o/oet-and-nmc-osce-and-nmc-cbt-by-ielts-medical-02036376722-12783634397" target="_blank" rel="noopener noreferrer">Our Eventbrite page</a>.</span></p>\r\n<p align="justify"><span style="font-size: 18px;">Working in small groups, our nurses will receive coaching and guidance to help&nbsp;you pass the OSCE first time. We simulate a clinical environment, presenting you with scenarios that you will likely encounter as a Registered Nurse. At the end of the course you will be invited to sit a mock examination that is assessed.</span></p>\r\n<p align="justify"><span style="font-size: 18px;">Rhiannon&nbsp;leads our professional OSCE training team who have high standards and maintain a high (98% in 2017; 98% in 2018 and 98% 1st time &amp; 100% 2nd time in 2019) pass rate. All of our trainers&nbsp;are&nbsp;registered NHS nurses and enjoy guiding our nurses to OSCE success.</span></p>\r\n<p><span style="font-size: 18px;"><em><strong>Pass your NMC OSCE with us&hellip; Call 02036376722!</strong></em></span></p>', '', '190916114716.webp', 1, '2019-09-16 11:47:16'),
(3, 1, 'Have you received your OSCE decision letter?', 'received-osce-decision-letter', '<ul>\r\n<li><strong>By Ben&nbsp;</strong></li>\r\n</ul>\r\n<blockquote>\r\n<p><em>Having assessed your application I am satisfied that you meet the minimum requirements to progress to part two of the test of competence; as a result you can now book your Objective Structured Clinical Examination (OSCE).</em></p>\r\n</blockquote>\r\n<p>Following (up to) 40 days of waiting for the NMC to reply to your application &ndash; an application that likely includes a 7.0 Score / B grade at IELTS or OET level <strong>and</strong> a CBT pass &ndash; the above words are welcomed news for our overseas qualified nurses.</p>\r\n<p align="justify">The NMC OSCE assesses our nurses&rsquo; clinical knowledge. It takes place at one of very few approved university test centres. The OSCE simulates a clinical environment and patient scenarious to test how our nurses and midwives assess, plan, implement and evaluate the care they provide. The test is split into stations and our nurses must complete these stations within the given time frames, whilst being assessed. As the final stage before NMC registration, it&rsquo;s incredibly important that you choose the right provider to see you through the exam. IELTS Medical is that provider&hellip;</p>\r\n<p>Our current <strong>pass rate</strong> is <strong>outstandingly high</strong> for several reasons, including:</p>\r\n<ol>\r\n<li>We simulate the hospital environment at either The Whittington Hospital or University College London Hospital that you&rsquo;ll have on the big day, so that when it&rsquo;s your time to take the exam, you&rsquo;re ready.</li>\r\n<li>Our dedicated OSCE trainers &ndash; themselves Registered&nbsp;Nurses who are clinically trained &ndash;&nbsp;give you lots of guidance on what the OSCE assessors expect.</li>\r\n<li>We have<strong> dedicated training rooms</strong> in London so that you can practice until you&rsquo;re ready.</li>\r\n</ol>\r\n<p align="justify">You&rsquo;ve invested a lot of money, time and effort to get to the stage where your NMC OSCE decision letter is in your hands&hellip; You deserve a provide who you can trust to match that investment and guide you to OSCE success&hellip;</p>\r\n<p><em><strong>Pass your NMC OSCE with us&hellip; Call 02036376722.</strong></em></p>', '', '190916114431.webp', 1, '2019-09-16 11:44:31'),
(4, 1, 'How effective is online IELTS training?', 'effective-online-ielts-training', '<ul>\r\n<li><strong>By Derek</strong></li>\r\n</ul>\r\n<p align="justify">A lot of overseas medics&nbsp;reach out to us for training from their home country. Through our work with IELTS and English language experts, we aim to deliver the best training to meet our medics&rsquo; goals. We&rsquo;re based in London and have see many medics through the the IELTS and OET exam in person at our centres, closer to&nbsp;<em>their</em> homes when we&rsquo;re on location (eg. September in Slough) and online.</p>\r\n<p align="justify"><span style="text-decoration: underline;"><strong>Pre-recorded Online Courses</strong></span></p>\r\n<p align="justify">We believe that when medics wonder about the effectiveness of online courses, they are thinking of&nbsp;pre-recorded courses. Most of such courses are aimed at a general learner and usually consist of one or more videos explaining a general topic or series of topics. We have those too, but we admit that our pre-recorded online IELTS courses were designed with advanced learners in mind. They feature videos by special guest stars and activities that our IELTS examiners will assess and provided feedback.</p>\r\n<p align="justify"><span style="text-decoration: underline;"><strong>Online Live courses</strong></span></p>\r\n<p align="justify">With our Online Live courses, however, we arrange a class or series of classes at a time that suits you. It&rsquo;s one to one with our Examiner or Tutor, so we can get to know you; your strengths and weaknesses too. Most of our online learners connect to the centre twice or three times a week. What&rsquo;s more, we have availability Monday to Sunday from 10am &ndash; 9:15pm &ndash; so there&rsquo;s likely to be a time slot that will suit your schedule. At our centres, we have wired, fibre broadband connection, delivering our tutors to your homes using the fastest internet speed available &ndash; so fast, that you&rsquo;ll feel like our tutors are right next to you!</p>\r\n<p align="justify">Here at IELTS Medical, we&rsquo;ve had a lot of success training medics online. Most of our medics train twice or three times each week and submit homework for marking in the meantime.</p>\r\n<p align="justify"><strong>Take distance courses with us&hellip; Call 02036376722!</strong></p>', '', '190916114313.webp', 1, '2019-09-16 11:43:13'),
(5, 1, 'How to prepare for your IELTS Exam', 'how-to-prepare-ielts-exam', '<ul>\r\n<li><strong>By Cristina</strong></li>\r\n</ul>\r\n<p align="justify">IELTS evaluates your English level in four ways: it assesses your speaking, listening, writing and reading and determines your ability to communicate with employers, professors, any individuals or professionals in an English speaking country such as United Kingdom.</p>\r\n<p align="justify">By following the three steps below you will be better prepared for your IELTS test and you will be able to receive the results that you desire.</p>\r\n<p align="justify"><strong>The first step is to improve your English</strong></p>\r\n<p align="justify">It takes a lot of energy and time to learn a language and the best way to can enhance your learning is to take an English language course. Having a tutor that can guide you and help you with the different sections of the IELTS (writing, reading, listening and speaking) is essential. A teacher can provide you with the feedback that you need in order to perform better on a particular assignment. You will need to use all the resources available to improve your English. Reading books, watching movies or YouTube IELTS tutorials, practising tests, doing grammar exercises, listening to radio podcasts or songs or similar activities are proven to contribute greatly to your high IELTS score.</p>\r\n<p><strong>The second step is to familiarise yourself with the rules and the test format</strong></p>\r\n<p align="justify">Remember there are two versions of the IELTS test: IELTS Academic used for people who want to study at higher education level or work in professional organisations in an English speaking country and General Training designed for individuals who want to study at below degree level, work in an English speaking country or emigrate to countries part of the Commonwealth. Please keep in mind that the Reading and the Writing parts are different for both exams but the Listening and Speaking sections are the same. Check the British Council website for any useful information. Be aware of the IELTS test band scores and do not believe all the rumours about the test, instead get the facts.</p>\r\n<p align="justify"><strong>The third step is to practise IELTS tests </strong>that are available for you to use after you pay for the exam. Apart from that you can find various IELTS materials on the British Council website or from numerous publishers.</p>\r\n<p align="justify">Alternatively you may consider taking our&nbsp;IELTS preparation course. A preparation course can be very useful in many ways such as improving your band score by practising the tasks that are required for the test.</p>\r\n<p><em><strong>Get IELTS with us&hellip; Call 02036376722.</strong></em></p>', '', '190916114136.webp', 1, '2019-09-16 11:41:36'),
(6, 1, 'OET The Complete Guide – Refresh 2.0 for Nursing and Medicine', 'oet-complete-guide-refresh-2-0-nursing-medicine', '<ul>\r\n<li><strong>By Peter</strong></li>\r\n</ul>\r\n<p align="justify"><strong>The OET Complete Guide &ndash; Refresh 2.0</strong> is a set&nbsp;of textbooks aimed at overseas qualified international nurses and medics who need to pass the Occupational English Test (OET) in order to practice their profession in the UK. The two main books, OET (Nursing) Complete Guide and OET (Medicine) for Doctors, are up-to-date versions created to allow readers to pass the OET exam version 2.0. Each book contains segments on the four key OET stages; reading, writing, listening and speaking, and includes mock exam questions, marking criteria, model answers, hints, advice and key revision material that ensures both nurses and medics can past the OET exam as efficiently as possible.</p>\r\n<p>&ldquo;Everything in these books has been collated to help nurses and medics reach grade B and beyond in OET version 2.0&rdquo;</p>\r\n<p>If you are looking to hone&nbsp;your skills in one particular subset of skill, we provide further Listening, Reading, Speaking and Writing Guide&nbsp;books compatible with the OET version 2.0 exam.</p>\r\n<p><strong>About the Author and Editors</strong></p>\r\n<p align="justify">Dr. Munachi Nze is a UK trained and London based medical doctor and experienced OET Tutor. His previous works include OET (Medicine) Writing Guide where he was editor. The strength of these books lies largely in Dr. Nze&rsquo;s professional background, which offers a unique combination of skill and experience in both the field of medicine, and OET tutoring.</p>\r\n<p align="justify">Mr. Peter Makin is a London based academic and aspiring journalist.</p>\r\n<p>This book would fit perfectly in either an English Foreign Language Non-fiction section, or in a non-fiction medical section of a bookstore.</p>\r\n<p>We&rsquo;re incredibly happy with&nbsp;the range and all editions are available in paperback only and our retail price for OET (Nursing) The Complete Guide Refresh 2.0 and OET (Medicine) for Doctors &ndash; The Complete Guide Refresh 2.0 is &pound;44.97. The retail price for our OET (Nursing) Speaking Guide and OET (Medicine) Speaking Guide, and Writing Guide books is &pound;29.97.</p>', '', '190916114013.webp', 1, '2019-09-16 11:40:13'),
(7, 1, 'OET The Complete Guide – Refresh 2.0 for Nursing', 'oet-complete-guide-refresh-2-0-nursing-oet-materials', '<ul>\r\n<li><strong>By Peter</strong></li>\r\n</ul>\r\n<p align="justify"><strong>As a comprehensive set of OET Nursing Materials, the OET Complete Guide &ndash; Refresh 2.0</strong> is a set&nbsp;of OET textbooks for nurses preparing for their OET exam. Overseas qualified nurses need to know not just what the OET is looking for, but how to consistently provide high quality answers that demonstrate their English language proficiency. The main text OET (Nursing) The Complete Guide contains five practice tests for each OET subtest (Listening; Reading; Speaking and Writing), as well as marking criteria, model answers and hints and tips for the OET. The set also includes an individual guide to each skill for example, the OET Listening Guide contains five full OET Listening tests (Parts A, B and C) as well as hints for the OET Listening subtest. The OET Reading Guide contains ten full OET Reading tests (Parts A, B and C) as well as top tips for OET Reading.&nbsp;The OET Speaking Guide contains ten roleplay examples to accompany the ten video examples. Finally, the OET Writing Guide contains ten case notes to aid your OET Writing revision.</p>\r\n<p>&ldquo;Everything in these books has been collated to help nurses and medics reach grade B and beyond in OET version 2.0&rdquo;</p>\r\n<p><strong>About the Author and Editors</strong></p>\r\n<p align="justify">Dr. Munachi Nze is a UK trained and London based medical doctor and experienced OET Tutor. His previous works include OET (Medicine) Writing Guide where he was editor. The strength of these books lies largely in Dr. Nze&rsquo;s professional background, which offers a unique combination of skill and experience in both the field of medicine, and OET tutoring.</p>\r\n<p align="justify">Mr. Peter Makin is a London based academic and aspiring journalist.</p>\r\n<p>This book would fit perfectly in either an English Foreign Language Non-fiction section, or in a non-fiction medical section of a bookstore.</p>\r\n<p>We&rsquo;re incredibly happy with&nbsp;the range and all editions are available in paperback only and our retail price for OET (Nursing) The Complete Guide Refresh 2.0 and OET (Medicine) for Doctors &ndash; The Complete Guide Refresh 2.0 is &pound;44.97. The retail price for our OET (Nursing) Speaking Guide and OET (Medicine) Speaking Guide, and Writing Guide books is &pound;29.97.</p>', '', '190916113914.webp', 1, '2019-09-16 11:39:14'),
(8, 1, 'How to pass the OET', 'how-to-pass-the-oet', '<p align="justify">Is OET a difficult test? How does it compare to the IELTS? Is it an easier option for the nurses? Are there any tips as to how to pass it first time round? These are the questions that you often ask about the Occupational English Test, OET for short. In this article I will tell you a little bit more about the exam itself and give you some tips to pass it quicker.</p>\r\n<p align="justify">The Occupational English Test was first designed in the late 1980s by Professor Tim McNamara, under the guidance of the Australian National Office for Overseas Skills Recognition (NOOSR). The test has been researched and developed since then multiple times, mostly by the University of Melbourne, but now also by Cambridge English Language Assessment.</p>\r\n<p align="justify">OET is widely recognised in Australia, New Zealand, Singapore, Canada, Malaysia and the Philippines. From 1<sup>st</sup> of November 2017, the Nursery and Midwifery Council in the UK started accepting OET as one of the tests you could provide as an English proficiency requirement when you are an overseas qualified nurse.</p>\r\n<p align="justify">It is believed that the OET exam may be easier than the IETLS, mainly because of the fact that everything in this test is healthcare based, while the IELTS can be&nbsp;quite random. &nbsp;If you&rsquo;re a new test taker, I would advise you first of all to familiarise yourself with the format of the exam, so you have more or less an idea what it looks like.</p>\r\n<p align="justify">Another tip I would give you is to remember that OET is still an ENGLISH test, even though it is healthcare-themed. It will not test your medical knowledge and even though it may be a bit easier for you to understand the tasks as a healthcare professional, the test will still mark your English skills. Please do not think that if you take the OET exam, you do not have to prepare that much, because it is not true. You still have to put in much work and effort in order to get that grade B.</p>\r\n<p align="justify">Invest in your preparation. Preparing by yourself for such exam can only be effective if you are already a fluent English speaker and have an <strong>academic</strong> knowledge of the language. Otherwise, you may need to ask for help of an experienced tutor to guide you. At IELTS Medical we offer OET preparation courses for our nurses, so they can be 100% ready once the exam day comes. We offer classes during the week in the evenings as well as during the weekends, so we can accommodate their busy schedules. Remember that even the natives struggle passing the exam with a satisfactory score! That is why getting the right guidance is essential.</p>\r\n<p align="justify"><em><strong>Pass the OET with us&hellip; Call 02036376722!</strong></em></p>', '', '190916113743.webp', 1, '2019-09-16 11:37:43'),
(9, 1, '100% CBT (NMC) pass rate', '100-cbt-nmc-pass-rate', '<p align="justify">The journey to NMC registration for overseas qualified nurses can be rather lengthy. If&nbsp;you are an EU nurse, your journey to registration consists of proof of English language proficiency. For overseas nurses, it is a longer process with a additional requirement in the form of the CBT and the OSCE. Since the English language requirement change in November 2017, however, the IELTS/OET exam is no longer a pre-requisite to&nbsp;registering for the CBT.</p>\r\n<p align="justify">The CBT stands for Computer Based Test. Likened to the UK driving theory test, it is multiple choice and available at the applicants&rsquo; nearest available Pearson VUE test centre. The test is of core nursing skills and includes scenarios that test for communication, reasoning and decision making skills that the nurse would need to apply within a clinic setting. There are 4 domains that the NMC test: Professional values; Communication and Interpersonal skills; Nursing Practice and Decision Making and Leadership Management and Team working. These are subsets of the area of practice &ndash; Adult (general); Children; Learning Disability; Mental Health and Midwifery.</p>\r\n<p align="justify">Since its inception in autumn 2014, over thirteen thousand CBT tests have been successfully registered with an overall pass rate of 76%. Of the 24% that fail to achieve the desired scores, the issues cited include a lack of timing, failure to interpret the questions correctly, or inability to complete calculations required of them.</p>\r\n<p>Here at IELTS Medical, we deliver a comprehensive CBT course <strong>for nurses by nurses</strong>. Completed within 3-5 working days, we go through each&nbsp;domain and question type you&rsquo;ll meet on the big day. Our trainer assesses the individual nurse&rsquo;s abilities against the NMC&rsquo;s standard, before tailoring a course to meet their needs. The overall pass rate for the NMC may be 76%, but here at IELTS Medical, <strong>our CBT pass rate is 100%</strong> and we intend to keep it that way.</p>\r\n<p align="justify"><strong>Pass your CBT first time with us&hellip; Call 02036376722!</strong></p>', '', '190916113533.webp', 1, '2019-09-16 11:35:33'),
(10, 1, 'Nurse E needed IELTS 7.0, but preferred the 8.0', 'nurse-e-needed-ielts-7-0-but-preferred-8-0', '<p align="justify">One of our most hardworking and determined&nbsp;nurses, has now passed the IELTS exam with a phenomenal score of 8.0. Nurse E&nbsp;<span style="text-decoration: underline;"><strong>only spent 3 weeks with us</strong></span>&nbsp;here at IELTS Medical; where she <strong>dominated i10 Advanced writing</strong>.</p>\r\n<p align="justify">Nurse&nbsp;E first came to IELTS Medical, with the intention to go 0.5 up a band as she had a score of 6.5 in writing. As we all know &ndash; to register with the Nursing and Midwifery Council (NMC), a nurse&nbsp;needs an overall score of 7.0. Nurse E put a lot of time and effort in and made sure she was available for all of the Skype classes we scheduled for her, as a way of gaining all the knowledge and skills in prep for her exam. She had completed her training through online via Skype as she was based in Norwich (118 Miles away from London!) This just shows how effective our materials and tutors are.</p>\r\n<p align="justify">By week 3, Nurse E had completed lengthy multiple pieces of homework given by our tutors, she had written many essays and was sent a lot&nbsp;of materials to help her complete it. In the end, we found that she surpassed her target with great perseverance and with the help of our best and experienced tutors (whom she had 1 to 1 tuition with). She obtained the amazing score of 8.0 overall.</p>\r\n<p align="justify">Here at IELTS Medical, we would like to praise her for her hard work, resilience and consistency. We wish Nurse E the best of luck with her career and we hope that this motivates all of you, our awe-inspiring, future UK healthcare professionals.</p>\r\n<p align="justify"><em><strong>Get your career started with us&hellip; Call 02036376722!</strong></em></p>', '', '190916113400.webp', 1, '2019-09-16 11:34:00'),
(11, 1, '“Now you have a choice” – Dr. D’s IELTS to OET journey', 'now-choice-dr-ds-ielts-oet-journey', '<p align="justify">The first contact we had from Dr. D was a tentative phone call over a year ago:</p>\r\n<p align="justify">&ldquo;I&rsquo;m just wondering if you can help me with my IELTS exam?&rdquo; He inquired.</p>\r\n<p align="justify">We could &ndash; after all, our tutor team&nbsp;includes British Council certified IELTS examiners. However, Dr. D was <em>so close</em> to achieving 7.5 overall that he decided to study on his own. We wished him well and asked him to keep in touch.</p>\r\n<p align="justify">Two months ago I received a call from Dr. D:</p>\r\n<p align="justify">&ldquo;Do you know much about the OET?&rdquo; He wondered.</p>\r\n<p align="justify">We did &ndash; we had just started our journey to OET Premium Provider status. It turned out that since we&rsquo;d last spoken, Dr. D had attempted the IELTS exam <em>eight times</em>. Each time, his Listening; Reading and Speaking skills were judged at C2 level, but his IELTS Writing score was consistently 6.5. He mused:</p>\r\n<p align="justify">&ldquo;I think the OET is a great opportunity that the GMC&nbsp;is giving to the overseas doctors&hellip;The IELTS exam is so unrealistic, random and not really linked to the healthcare professionals.&rdquo;</p>\r\n<p>Little did we know that this conversation would be the start of Dr. D&rsquo;s OET journey.&nbsp; We continued talking about the OET and how it is changing healthcare professionals&rsquo; lives and I invited him to the office for a chat.</p>\r\n<p align="justify">&ldquo;Now you have a choice,&rdquo; I said and his eyes began to water. Dr. D suddenly&nbsp;realised that his life was about to change for good. He decided to enrol for the i10 OET 4&times;4 course in Archway&nbsp;and he proved to be an excellent student. I remember assisting our Tutor Gian with the speaking mini mock examination and when Dr. D. started, I was totally shocked &ndash; he was the best student I had ever seen. His confidence and his language skills were outstanding&nbsp;and at that stage I already knew that he would ace the exam for sure!</p>\r\n<p align="justify">A couple of weeks ago I received a called, it was Dr. D!&nbsp; In a&nbsp;calm and firm tone, he called to inform us that he passed the OET exam <strong>on the very first attempt</strong>! He was so happy that he decided to come into our&nbsp;office in order to meet us with chocolates and a Thank You card in tow!&nbsp;He was beaming. He shared that his IELTS experience had made him want to return overseas and give up his UK aspirations, but that the OET had changed this.</p>\r\n<p align="justify">What a difference a phone call can make&hellip;</p>\r\n<p align="justify"><em><strong>Go from IELTS to OET with us&hellip; Call 02036376722!</strong></em></p>', '', '190916113250.webp', 1, '2019-09-16 11:32:50'),
(12, 1, 'NMC CBT Mock Test', 'nmc-cbt-mock-test', '<p align="justify"><span style="text-decoration: underline; font-size: 18px;">The NMC CBT exam</span></p>\r\n<p align="justify"><span style="font-size: 18px;">The NMC CBT is the second stage of NMC Registration for nurses who have qualified outside the European Union. It is a computer based test that consists of 120 Multiple Choice Questions. Nurses have up to 4 hours (or 240 minutes) to complete the test. There are a number of NMC CBT exam dates throughout 2019, but despite an increased availability of test dates, there seems to be no change to the number of nurses passing the test. Last year the pass rate for the NMC CBT remained between 65-71% worldwide. Earlier this month, the NMC&nbsp;sought to prevent attrition at this stage. Prior to April, 2019, not only did nurses need to pass all critical questions and 90% of all drug calculation questions, but you also needed to ensure a 68% pass overall. Since this month, however, there is no longer a requirement to pass all critical questions, and even though the pass rate remains the same, that should make things slightly easier. Another change this month, is that the exam now costs &pound;90 and nurses are allow two attempts automatically. A third attempt is now potentially possible, if the nurse is granted authorisation by the NMC. Exam results remain valid for two years.</span></p>\r\n<p align="justify"><span style="text-decoration: underline; font-size: 18px;">The Problem</span></p>\r\n<p align="justify"><span style="font-size: 18px;">A lot of the time, nurses come to us not knowing <em>what to study for the NMC CBT</em>. Some have been out of practice for some time eg. due to childcare responsibilities, some have also &ndash; rather worryingly &ndash; been stuck at the language stage for so long&nbsp;(did I mention that we do IELTS and OET here), that they&rsquo;re a little rusty.</span></p>\r\n<p align="justify"><span style="text-decoration: underline; font-size: 18px;">Our Solution</span></p>\r\n<p align="justify"><span style="font-size: 18px;">Ultimately, the CBT is an exam and like any other exam, you need to prepare. Not knowing exactly what to prepare and how to do so efficiently, has meant that some nurses have been overwhelmed at this stage, which is why we&rsquo;re here to help. Here at IELTS Medical, we have a comprehensive and efficient 4-day course that guides you to first time CBT success. We are delighted to have a 100% pass rate on our course, because not only do we bring to the topics you will be test on to the forefront of your mind, but our Senior Registered Nurse Educator Ines, works to ensure that you are confident with all of aspects of the CBT before you make your attempt. Our 4-day course includes:</span></p>\r\n<ul>\r\n<li><span style="font-size: 18px;">Blood Transfusions</span></li>\r\n<li><span style="font-size: 18px;">Capacity to Consent</span></li>\r\n<li><span style="font-size: 18px;">Diagnostic Tests</span></li>\r\n<li><span style="font-size: 18px;">Drug Calculations</span></li>\r\n<li><span style="font-size: 18px;">Infection Prevention and Control</span></li>\r\n<li><span style="font-size: 18px;">Law and Ethics in the UK</span></li>\r\n<li><span style="font-size: 18px;">Leadership, Management and Team Working</span></li>\r\n<li><span style="font-size: 18px;">Medication Management</span></li>\r\n<li><span style="font-size: 18px;">Nursing Practice and Decision Making</span></li>\r\n<li><span style="font-size: 18px;">Nutrition</span></li>\r\n<li><span style="font-size: 18px;">Patient assessment</span></li>\r\n<li><span style="font-size: 18px;">Pre and Post Op Care</span></li>\r\n<li><span style="font-size: 18px;">Vulnerable Patients</span></li>\r\n</ul>\r\n<p align="justify"><span style="font-size: 18px;">Then &ndash; crucially &ndash; on the morning of Day 4, you will be given the opportunity to take a mock CBT examination under examination conditions. Our software mimics the real exam, with one key difference. At the end of the mock exam, you will be given <strong>individual scores</strong> that separate your results into domains. This means that not only will you receive a result, but you will see any areas you need to work on&hellip; LIVE&hellip; before your big day.</span></p>\r\n<p align="justify"><span style="font-size: 18px;">Previous attendees&nbsp;have enjoyed the course and reported an increased confidence for the real exam&hellip;. So, what are you waiting for?</span></p>\r\n<p><span style="font-size: 18px;"><em><strong>Get NMC CBT ready with us&hellip; Call 02036376722!</strong></em></span></p>', '', '190916112939.webp', 1, '2019-09-16 11:29:39'),
(13, 1, 'On location this September… in sunny Slough', 'location-september-sunny-slough', '<ul>\r\n<li><strong>By Lidia</strong></li>\r\n</ul>\r\n<p align="justify">Located 20 miles west of Central London, in the area of Berkshire, Slough is one of the most ethnically diverse towns in the UK &ndash; with 150 languages spoken. Its rapid economic development is attributed to its high immigration rates.</p>\r\n<p align="justify">We are excited to be going&nbsp;on location to&nbsp;Slough this September. By this, we aim to reach out to and help a small group of medics&nbsp;to get ready and succeed in the Academic IELTS exam.</p>\r\n<p align="justify"><strong>Tell me more about your initiative &hellip;</strong></p>\r\n<p align="justify">Our Slough classes will take place for a month, starting in the first week of September.</p>\r\n<p align="justify">Classes will start at 10.00 am and finish at 4.45 pm. They will be delivered by our specialist IELTS tutors and examiners.</p>\r\n<p align="justify">During the first week of September, classes will take place on Wednesday and Friday.</p>\r\n<p align="justify">During the second week, classes will take place on Monday and Wednesday.</p>\r\n<p align="justify">The schedule for the penultimate and final week of September follows a similar structure to the first weeks. For the third week, classes will take place on Tuesday, Wednesday and Friday. For the last week of the month, classes are scheduled for Monday and Wednesday.</p>\r\n<p align="justify">Our medics will learn different techniques&nbsp;they need to apply whilst taking the IELTS exam. Subsequently, theory will be consolidated by past-papers practice. Any additional training will be done by Skype.</p>\r\n<p><strong>Looking forward to it</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Our tutors&nbsp;enjoy travelling and teaching&hellip; When we&rsquo;re on location, our tutors&nbsp;get the chance to explore and our medics get in-person tuition. It&rsquo;s a win:win.</p>\r\n<p><em><strong>Come and meet us&hellip; Call 02036376722!</strong></em></p>', '', '190916112106.webp', 1, '2019-09-16 11:21:06'),
(14, 1, 'The importance of feedback from tutors', 'importance-of-feedback-from-tutors', '<ul>\r\n<li><strong>By Cristina</strong></li>\r\n</ul>\r\n<p align="justify">Feedback is an essential part of effective learning. It helps learners understand the subject being studied and provides them with clear guidance on how to enhance their learning. According to researchers, academic feedback is more strongly linked to achievement than any other teaching behaviour. This relationship is consistent regardless of socio-economic status, ethnicity, or school setting. Feedback can improve a student&rsquo;s confidence, self-awareness and enthusiasm for learning. Providing students engage with feedback, it should enhance assessment performance and improve learning.</p>\r\n<p align="justify">Everyone can benefit from feedback. Feedback can be used to make better, more informed decisions. Feedback also allows students to build and maintain communication with their tutors.</p>\r\n<p align="justify">Effective feedback, both positive and negative, is very useful. Efficient feedback can benefit the student greatly. Here are a few more reasons why feedback is important:</p>\r\n<p align="justify">1. Feedback improves efficiency. When a student is provided with feedback they are less likely to make the same mistakes in future assignments. It is also likely that the performance of students will improve.</p>\r\n<p align="justify">2. Feedback can motivate and can re-assure the student is moving in the right direction. It has strong links with student satisfaction and productivity.</p>\r\n<p align="justify">Feedback from a tutor can motivate the student to perform better and to become more confident.</p>\r\n<p align="justify">3. Feedback is a tool for continued learning. Persistent feedback can enhance the relationship between the tutor and the student; it can create different strategies for learning and developing more skills.</p>\r\n<p align="justify">Here our medics receive daily and consistent feedback from our experienced IELTS tutors and examiners. It means that you learn how to navigate the IELTS exam with ease and that you can incorporate the feedback you have been given so that you can perform better in the exam. Our medics also receive feedback during their mock exams, where they rehearse the big day.</p>\r\n<p><em><strong>Get feedback with us&hellip; Call 0203 637 6722.</strong></em></p>', '', '190916112020.jpeg', 1, '2019-09-16 11:20:20'),
(15, 1, 'How to beat stress', 'how-to-beat-stress', '<ul>\r\n<li><strong>By Ruta</strong></li>\r\n</ul>\r\n<p align="justify">In our modern society, stress is a big part of our daily journeys. Many of us who have taken tests are familiar with the terrible feeling just before the big day when our hearts start to beat uncontrollably, our hands tremble and all the knowledge that was so diligently gained through revision, appears to be gone. We have to agree that a reasonable level of stress is a normal physiological body response. However, it is crucial to learn how to control our emotions and <em>benefit</em> from the stress. If we are unable to do this we are likely to lose the opportunity to do our best. In regards to the problem, here are some main tips on how to manage stress before and during exams:</p>\r\n<ol>\r\n<li>\r\n<p align="justify"><strong>Be prepared for the test:</strong> It may sound idealistic, but homework needs to be done and revision needs to be thorough. Cramming just before the exam will not make a big difference to the result. On the contrary, it can cause extra stress.</p>\r\n</li>\r\n<li>\r\n<p align="justify"><strong>Rest before the big day:</strong> Do not make the mistake of trying to catch bits of knowledge during the very last hours. 8 hours of sleep before a test can ensure your brain is functioning efficiently.</p>\r\n</li>\r\n<li>\r\n<p align="justify"><strong>Feed your brain:</strong> Despite the fact that many people feel nausea and complain of other gastrointestinal symptoms in the face of the intense stress, nutritious food and water is necessary before any mental activity. Furthermore, <em>do not</em> avoid carbs as it is the main energy supplier for the brain.</p>\r\n</li>\r\n<li>\r\n<p align="justify"><strong>Be positive:</strong> Sometimes it is easier to say it than to do it. However one way to do this is to create your own mantra. For example, &lsquo;I am prepared, I know all the answers, I am happy to take the test.&rsquo; and repeat it to yourself confidently. Meditation and breathing exercises can also help rid you of the negative thoughts and stress.</p>\r\n</li>\r\n</ol>\r\n<p><em><strong>Relax with us&hellip; Call 02036376722!</strong></em></p>', '', '190916111826.webp', 1, '2019-09-16 11:18:26'),
(16, 1, 'The importance of revising the content you have learned', 'the-importance-of-revising-the-content-you-have-learned', '<ul>\r\n<li><strong>By Martina</strong></li>\r\n</ul>\r\n<p align="justify">Exams, coursework and interviews are all important steps in a person&rsquo;s career. These assessments mark out stages in a person&rsquo;s life and can lead to a more rewarding profession. In order to achieve good results in these assessments,&nbsp;revising for the exam is extremely important.</p>\r\n<p align="justify">At first, ideas might be confused, topics might not be clear and information might be written down in a disorganised way. If text or speeches are left un-revised and thoughts are not clear, the outcome in assessments may not be favourable.</p>\r\n<p><span style="text-decoration: underline;"><strong>So what is revising and why is it important?</strong></span></p>\r\n<p align="justify">It&rsquo;s the act of improving and adapting something over a measured period of time to make it more suitable for a particular purpose i.e. performing well in an exam. Revision should not be confused with cramming, which occurs when a student goes over topics hurriedly right before an assessment. Revising&nbsp;is vital. If a&nbsp;learner crams the night before an exam they are far less likely to be able to recall things they have studied in the long term as they have not processed all the information properly. While cramming isn&rsquo;t a totally ineffective tool for passing an exam,&nbsp;medics are more likely to forget the material they have studied which may prove disastrous if they need that information as foundation for a subsequent exam that is coming up in the near future. As a violin player would practice his accords over time before a concert, a&nbsp;learner needs to elaborate and reformulate the content of the subject they have studied.</p>\r\n<p><span style="text-decoration: underline;"><strong>The best advice&nbsp;I can give you about revising is as follows:</strong></span></p>\r\n<p align="justify">1. Make a revision plan: By doing this your revision will be more organised and succinct, meaning you are less likely to be copying out of a textbook verbatim and your revision will be more efficient.</p>\r\n<p align="justify">2.&nbsp;Revise regularly: IELTS topics that have not been studied or essays that have not been written recently need more time to be revised since thoughts are not fresh and material is not new. By constantly reviewing your work and revising the work you have been taught in class, you will need to do less work closer to your assessments.</p>\r\n<p align="justify">3. Make&nbsp;revising interesting: Studies have shown we are more likely to remember topics we have revised with fun acronyms, limericks, rhymes, colourful diagrams and notes with different colour pens (to name a handful of methods). We aren&rsquo;t advising you to take a huge amount of time trying to turn the information you are trying to revise into a rap rhymes eligible for a Grammy or diagrams that could rival Picasso&rsquo;s finest work! However, the more interesting you make your revision, the more likely you are to remember it for an assessment.</p>\r\n<p><em><strong>Get revising&nbsp;with us&hellip; Call 02036376722.</strong></em></p>', '', '190916111412.webp', 1, '2019-09-16 11:14:12'),
(17, 1, 'Last IELTS Simon Workshop of 2017 – Sunday 12th November', 'last-ielts-simon-workshop-2017-sunday-12th-november', '<p align="justify">A lot of our medics follow <a href="http://ielts-simon.com" target="_blank" rel="noopener noreferrer"><strong>IELTS Simon</strong></a>, who produces daily IELTS lessons on his<a href="http://ielts-simon.com" target="_blank" rel="noopener noreferrer"> website</a>. For over a decade, IELTS Simon has been a trusted advisor on everything you need to know about the IELTS exam in a way that&rsquo;s easy to understand and, most importantly, remember.</p>\r\n<p align="justify">Past attendees have been able to improve their Reading and Writing scores by a band, through implementing IELTS Simon&rsquo;s Workshop tips and strategies to improve your IELTS skills.</p>\r\n<div class="fb-video fb_iframe_widget fb_iframe_widget_fluid_desktop" style="width: 100%;" data-allowfullscreen="true" data-href="https://www.facebook.com/IELTSMedicalLondon/videos/857370397739183/">&nbsp;</div>\r\n<p align="justify">Here at IELTS Medical, we<em><strong> always</strong></em> enjoy&nbsp;IELTS Simon&rsquo;s London visits and his last visit of 2017 will be on <a href="https://live.vcita.com/site/ajq542z3f5uhxnhi/online-scheduling?event=ondekeca2d6mkte7" target="_blank" rel="noopener noreferrer"><strong>Sunday 12th November</strong></a>. Delivering his world famous IELTS Academic Writing Workshop in the first half and an IELTS Academic Reading workshop in the second, we&rsquo;re hoping to see a healthy turnout <strong><em>especially</em></strong> from Medics taking their exam with us on Saturday 25th November. As always, lunch will be served and the event is open to all professionals at approx. 6.0-6.5 level, who are taking the IELTS Academic examination soon. Only 9/14 spaces remain and tickets are&nbsp;<a href="https://live.vcita.com/site/ajq542z3f5uhxnhi/online-scheduling?event=ondekeca2d6mkte7" target="_blank" rel="noopener noreferrer">available now</a>.</p>\r\n<form action="https://www.paypal.com/cgi-bin/webscr" method="post" target="_top"><br />\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>IELTS Simon&rsquo;s Writing and Reading Workshop</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</form>\r\n<p><br /> <input alt="PayPal &ndash; The safer, easier way to pay online!" name="submit" src="https://www.paypalobjects.com/en_US/GB/i/btn/btn_buynowCC_LG.gif" type="image" /><br /> <br /> <em><strong>Meet IELTS Simon in person, in London&hellip; Call 02036376722 !</strong></em></p>', '', '190916111316.webp', 1, '2019-09-16 11:13:16'),
(18, 1, 'Getting back on the horse', 'getting-back-on-the-horse', '<ul>\r\n<li><strong>By Emma</strong></li>\r\n</ul>\r\n<p align="justify">Some of our medics have taken the IELTS exam several times and want to give up. &nbsp;Or they&rsquo;ve&nbsp;felt as though&nbsp;they could have done better in the exam.</p>\r\n<p align="justify">As the expression goes, we must &lsquo;<em><strong>get back on the horse</strong>.&rsquo; </em>By this expression, it means to keep going and to never give up no matter how difficult it is. This is just a &nbsp;step you must follow in order to strive for success; a barrier to overcome. We&rsquo;ve met medics who have come to us having taken the exam <span style="text-decoration: underline;"><strong>over ten times</strong></span>, but try again because the test is important and for their future. Whilst blindly enrolling for the exam is not advisable, our successful <em>horse riders</em> have been keen on learning from their mistakes. They make notes of what they found difficult in that particular exam for future reference and most importantly, they find different solutions on how to better themselves. These include:</p>\r\n<ul>\r\n<li>Revising more than usual.</li>\r\n<li>Going through numerous past papers.</li>\r\n<li>Attending additional classes.</li>\r\n</ul>\r\n<p align="justify">It&rsquo;s really all about the <strong>time and effort you put into studying</strong>. If you&rsquo;re not taking revision seriously, expect to not do very well. Exams can throw any question at you and you may not have revised for that precise question, it will confuse you and cause frustration; so putting in enough time and effort is strongly advised.</p>\r\n<p align="justify">Also, many people will agree that exams are quite nerve-racking due to the pressure, the time limit and the atmosphere. But, with enough time, preparation and revision there is no reason to fail at all. You should be able to achieve the best grades possible.</p>\r\n<p align="justify">Think about how proud and content you will be, knowing you&rsquo;ve done the best you could, knowing you wouldn&rsquo;t have to re-sit again&hellip;</p>\r\n<p><em><strong>Get back on the horse with us&hellip; Call 02036376722.</strong></em></p>', '', '190916111219.jpeg', 1, '2019-09-16 11:12:19'),
(19, 1, 'TedMed – What if mental illness could be treated with electrical engineering?', 'tedmed-mental-illness-treated-electrical-engineering', '<p>Watch the results of studies by psychiatrist Kafui Dzirasa, who studies&nbsp;the brain&rsquo;s electrical rhythms and their connections to mental illness. This talk discusses&nbsp;how he&rsquo;s working to reduce the stigma of psychiatric illness by engineering approaches to retune our electrical brain.</p>', '', '190916111117.webp', 1, '2019-09-16 11:11:18');
INSERT INTO `blog` (`id`, `author_user_id`, `title`, `slug`, `description`, `meta_description`, `photo_image`, `user_status`, `created_date`) VALUES
(20, 1, 'How to be an organised learner', 'how-to-be-an-organised-learner', '<ul>\r\n<li><strong>By Anna</strong></li>\r\n</ul>\r\n<p align="justify">At IELTS Medical we understand how difficult it may be to juggle between preparation to the IELTS exam and other commitments at home or work. This article will give a few simple tips how to organise your work better.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>ORGANISE YOUR MATERIAL AFTER EACH CLASS </strong></p>\r\n<p align="justify">Yes, yes, we know &ndash; when you get home after a long English class, probably the last thing you want to do is to look at the material again. However it is very important that you have at least a quick glance at what you have done that particular day. Gather information that was important during that lesson and underline it with a colourful pen or mark it with a fun ribbon if that helps.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>DO NOT PUT OFF DOING YOUR HOMEWORK FOR THE LAST MINUTE</strong></p>\r\n<p align="justify">Being up-to-date with your homework is crucial to make progress in getting ready for your IELTS exam. We do understand that sometimes it gets a bit tricky to actually remember about your homework when you have other responsibilities like taking care of your family or going to work. You have to remember that doing homework and getting feedback from your tutor allows you to correct your mistakes and learn quicker.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>USE A PLANNER</strong></p>\r\n<p align="justify">It could be in paper version, it could be an app on your phone &ndash; trust me, having a planner with you is a life-saver. You can use it to remember about your classes and homework you need to do before next class.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>REVISE, REVISE, REVISE</strong></p>\r\n<p align="justify">That is the magic word you have probably already heard a billion times. It is a key to a successful score at your next IELTS test. Remember to always revise before your next class. It helps you remember all that you have already learnt and in the meantime you may also come up with questions to ask your tutor regarding the material.</p>\r\n<p>&nbsp;</p>\r\n<p align="justify">I hope these tips will help you stay organised doing your course with IELTS Medical. However remember that even though these tips will definitely help you along the way, the most important thing is to stay enthusiastic and motivated to learn!</p>\r\n<p align="justify"><em><strong>Get organised with us&hellip; Call 02036376722!</strong></em></p>', '', '190916111035.webp', 1, '2019-09-16 11:10:35'),
(21, 1, '2-Day OET (Listening; Reading; Speaking and Writing) Workshop for Nurses led by with Author and Director Gurleen Khaira.', '2-day-oet-workshop-by-gurleen-khaira', '<p align="justify"><strong>We&rsquo;re excited to announce a 2-Day OET Workshop for Nurses led by with Author and Director Gurleen Khaira.</strong></p>\r\n<p align="justify">As seen on NBC, Ms. Khaira is an internationally acclaimed OET trainer, entrepreneur, and career counsellor. She has a post-graduate qualification in TESOL and has received four National awards for her work in the education sector and has been featured in national publications on numerous occasions. Her company, Khaira Education, is listed on the official OET Website as a&nbsp;Premium training provider. She has been involved with soft-skills and English language training since 2013 following her return to India from Australia, where she attended the University of Melbourne. She is currently working on her second book, which will be devoted to Reading and Listening Modules of the OET.</p>\r\n<p align="justify">Ms. Khaira will be here at our Archway branch to deliver a 2-day workshop on the 9th and 10th January 2018. The workshop will bring to life the OET Listening; Reading; Speaking and Writing skills and will be especially helpful for nurses taking the exam at the beginning of 2018. Previous attendees at Ms. Khaira&rsquo;s workshops have achieved A or B grades at the OET and we hope to help our nurses do the same&hellip; <strong>First time</strong>.</p>\r\n<p align="justify"><em><strong>To book, contact the IELTS Medical team on 02036376722.</strong></em></p>', '', '190916110922.webp', 1, '2019-09-16 11:09:22'),
(22, 1, 'MAKE USE OF THE GLOOMY, AUTUMNAL WEATHER', 'make-use-gloomy-autumnal-weather', '<ul>\r\n<li><strong>By Anna</strong></li>\r\n</ul>\r\n<p>Our next IELTS exam is getting closer and closer (<strong>25<sup>th</sup> of November, 2017</strong>), so it is a good time to start revising what you have already learnt.</p>\r\n<p align="justify">I do realise this time of year is not really that motivating when it comes to sitting down and opening your IELTS textbook. However, with a right mind-set, even the rainy, windy evening can become a perfect opportunity to have a date with your English notes.</p>\r\n<p align="justify">Google a cosy caf&eacute; nearby and bring your notes with you there. It has actually been proven that some caf&eacute; background noise helps you focus. If you do not feel like leaving your house,<a href="https://www.noisli.com/" target="_blank" rel="noopener noreferrer"> this is a website </a>which allows you to actually turn on different kinds of background noise to help you study.</p>\r\n<p align="justify">If staring at your notes bores you to death, we have a solution for that too. What better way to train your listening skills than listen to an interesting podcast whilst you, e.g. have a relaxing bath? Check out <a href="http://www.bbc.co.uk/podcasts" target="_blank" rel="noopener noreferrer">the BBC podcasts</a> website to get some ideas.</p>\r\n<p align="justify">Are you free on Sunday 12<sup>th</sup> of November? Well, guess what &ndash; we have a perfect opportunity for you! IELTS Simon is coming to visit us to give a Reading and Writing skills workshop. If you are level 6.0-6.5, you should definitely book your ticket now. The workshop will take approximately 6 hours and it has a cosy, friendly atmosphere and lunch included.</p>\r\n<p><em><strong>Get cosy with us&hellip; call on 0203 637 6722.</strong></em></p>', '', '190916110813.webp', 1, '2019-09-16 11:08:13'),
(23, 1, 'OET Class – every week', 'oet', '<p style="text-align: justify;">By Anna</p>\r\n<p style="text-align: justify;">The Occupational English (or OET) is an alternative to the IELTS exam for nurses wishing to register for NMC Registration. It assesses nurses'' listening, reading, writing and speaking skills across the exam. Unlike other English language examinations, this examination is entirely healthcare focussed. This unique fact makes it an ideal choice for nurses who have work experience working as a nurse. Your experience - regardless of where in the world that you have gained it - will mean that a lot of the concepts you''ll come across in the OET will be familiar to you. Concepts like expressing empathy for your patient; something that is assessed as part of the OET Speaking exam.&nbsp;</p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline;"><strong>OET Class - Every Week&nbsp;</strong></span></p>\r\n<p style="text-align: justify;">Here are IELTS Medical, we hold weekly OET sessions to assist nurses with the exam. Whether in person at our centres in London or online at <a href="http://www.oetonline.net" target="_blank" rel="noopener noreferrer">oetonline.net</a>&nbsp;we ensure that nurses are able to access the information, feedback and practice that you''ll need in order to pass this exam as efficiently as possible.&nbsp;</p>\r\n<p style="text-align: justify;"><em><strong>Get OET-efficient with us... Call 02036376722!</strong></em></p>', '', '200105122235.jpg', 1, '2019-09-16 11:07:13'),
(24, 1, 'Winter Wonderland Merry-ness', 'winter-wonderland-merry-ness', '<ul>\r\n<li><strong>By Anna</strong></li>\r\n</ul>\r\n<p align="justify">We are slowly bracing ourselves for the <strong>Christmas season at IELTS Medical</strong>. Soon the festive decorations will go up and Christmas music will fill in the office and we have a quite exciting announcement for our employees and students. This year&rsquo;s Winter Party will take place at Hyde Park&rsquo;s Winter Wonderland!</p>\r\n<p align="justify">Get your festive mood and ice-skating skills ready before the day comes. Hyde Park&rsquo;s Winter Wonderland has been spreading the Christmas joy for over 10 years now, so it has become a landmark event for the Londoners. It offers various shows, rollercoaster rides, circus, festive bars and food stalls &ndash; and it just humbly started as a small, open-air Christmas market. Now you can find there over 100 attractions which is why thousands of visitors return to Winter Wonderland every year.</p>\r\n<p align="justify">One of the most popular attractions is Ice Skating, which is also what we have booked for our Winter Party. Winter Wonderland is home to the largest open-air ice rink in the United Kingdom and this is where we will be practicing our ice skating skills. Surrounded by festive lights, magical atmosphere and live music from a bandstand, the ice rink will be the first stop for us.</p>\r\n<p align="justify">After an hour of skating, we will move to Zippo&rsquo;s Circus for a spectacular show that will take us through an array of the world&rsquo;s finest circus acts. It lasts around 45 minutes so it is also a perfect length for the little ones. It will take place in The Circus Megadome which is the largest tented structure in the UK. It has comfortable theatre-like seating where you can snuggle up and enjoy the show.</p>\r\n<p align="justify">Save the date &ndash; 17<sup>th</sup> of December, starting at 17:00, however we will start gathering around half an hour before. Please feel free to bring your family, because the more, the merrier!</p>\r\n<p><em><strong>Get merry with us&hellip; Call 02036376722!</strong></em></p>', '', '190916110503.webp', 1, '2019-09-16 11:05:03'),
(25, 1, 'Easy ways to expand your vocabulary', 'easy-ways-expand-vocabulary', '<ul>\r\n<li><strong>By Anna</strong></li>\r\n</ul>\r\n<p align="justify">Expanding your vocabulary is crucial while preparing for the IELTS test. It will definitely make it easier as you go through each skill on the exam. Having a broad vocabulary will also help you in your everyday life as words are one of the key predictors of someone&rsquo;s profession, education level or social status.</p>\r\n<p align="justify">The question now is &ndash; how to actually expand your vocabulary? The easiest and fastest way is to <strong>read</strong>. And not only books. If you are reading this at the moment, I would say you are on the right track. Read everything you possibly can: books, newspapers, road signs, and ingredients&rsquo; list on your shampoo bottle.&nbsp; You will not only learn new words, but you can also improve your grammar and after some time, you may find it much easier to form complex sentences.</p>\r\n<p>&nbsp;</p>\r\n<p align="justify">Look the words up. Whenever you see a word you don&rsquo;t understand, look it up. Google and a dictionary are your friends. However, please do yourself a favour and do not search for equivalents of said word in your native language. Instead, look up the English definition of the word and check the examples, how it should be used in a sentence. This way, you have more chance to actually remember the word and use it in the future.</p>\r\n<p>&nbsp;</p>\r\n<p align="justify">Search for synonyms of words you use the most often. It can especially help you while writing a paper. Don&rsquo;t get too crazy, though and remember that sometimes, even though certain words can be synonymous, they cannot be used in the same type of paper. &nbsp;It is all about the register!</p>\r\n<p>&nbsp;</p>\r\n<p align="justify">Play word games. Who said learning new words cannot be fun? If a boring train ride is part of your commute, why not make it more interesting by doing some crosswords? If you prefer staring at the screen of your phone, there are also educational games you could install (e.g. the word game I am playing now is called Word Cookies).</p>\r\n<p align="justify">As you probably already know, the key to learning new words or expressions is always your motivation and persistence. Appreciate the beauty of the language, dive into it, research the etymology of the words you learn &ndash; you will be surprised how interesting it can be.</p>\r\n<p align="justify"><em><strong>Increase your vocab with us&hellip; Call 02036376722!</strong></em></p>', '', '190916110305.webp', 1, '2019-09-16 11:03:05'),
(26, 1, 'How long will it take me to get my score?', 'how-long-will-it-take-me-to-get-my-score', '<ul>\r\n<li><strong>By Anna</strong></li>\r\n</ul>\r\n<p align="justify">As an IELTS Medical Administrator, I have to admit that it is one of the most frequent questions and at the same time &ndash; one of the most difficult ones to answer directly. This is due to the fact that the answer itself depends on many various factors.</p>\r\n<ol>\r\n<li><strong>Your previous IELTS score and the score you are aiming at.</strong></li>\r\n</ol>\r\n<p align="justify">It will more likely take more time for a Nurse A to score 7.0 if her last IELTS score was 5.5 than Nurse B whose last score was 6.5. On average, it takes around 5 weeks (while you attend classes twice a week) to go up 0.5 band. However, we have had medics who scored up higher and much quicker, so it is definitely not a rule.</p>\r\n<ol start="2">\r\n<li><strong>Your determination.</strong></li>\r\n</ol>\r\n<p align="justify">It could be that Nurse A, even though her last score was much lower than Nurse B&rsquo;s, will get 7.0 quicker. Why is that? Because she is motivated to learn and improve, she never misses her classes, she always does her homework and is not afraid to ask questions when she does not understand something. Remember that the tutor will never do all the work for you; they are here to guide you and help you learn. It is up to you to get the 7.0 or 7.5 score.</p>\r\n<ol start="3">\r\n<li><strong>Give yourself time.</strong></li>\r\n</ol>\r\n<p align="justify">Please do not leave preparing for the IELTS exam for the last minute. Learning a foreign language is a process that has to take some time and it won&rsquo;t happen overnight. Additionally, remember that discipline is a key to IELTS. You have to be in touch with the language every day, ideally all the time, in order to significantly improve. Besides attending classes, it would be a good idea to have a British radio in the background, watch British TV and speak to people in English.</p>\r\n<p align="justify">To sum up &ndash; how long will it take you to get your score? The answer is: <strong>it depends on you</strong>. We can guide you in the right direction and assist you along the way, but it will still depend on you how quick you will get there.</p>\r\n<p><em><strong>Get your score with us&hellip; Call 02036376722!</strong></em></p>', '', '190916110152.webp', 1, '2019-09-16 11:01:52'),
(27, 1, 'Doctors’ path to working in the UK', 'doctors-path-working-uk', '<ul>\r\n<li><strong>By Anna</strong></li>\r\n</ul>\r\n<p align="justify">While overseas qualified doctors have to pass the IELTS exam with a minimum score of 7.5, the English proficiency test is not the only stop on their path to working as a practicing doctor in the United Kingdom. After they have passed the IELTS with a sufficient score, they have to go through the PLAB (Professional and Linguistic Assessments Board).</p>\r\n<p align="justify">The PLAB exam consists of two parts. The first part is made of 200 single best answer questions (SBAs). It is a multiple choice exam, also known as &lsquo;best of five&rsquo; or &lsquo;one of five&rsquo;. Each question starts with a short scenario, followed by a question e.g. &lsquo;What is the most likely diagnosis in this scenario?&rsquo;</p>\r\n<p align="justify">This part is designed to test your ability to apply knowledge to the care of patients. The questions relate to current best practice in the UK and you&rsquo;ll need to answer having in mind only published evidence. The exam covers the most common and important conditions.</p>\r\n<p align="justify">The second part is an objective structural clinical examination (OSCE) and comprises 18 different scenarios, each lasting around 8 minutes. You&rsquo;ll be tested in settings such as a mock consultation or an acute ward. In this part, a doctor is marked in three areas: data gathering, technical and assessment skills; clinical management skills and interpersonal skills.</p>\r\n<p align="justify">Did you know that at IELTS Medical we offer <a href="http://www.plablondon.com" target="_blank" rel="noopener noreferrer">preparation courses for PLAB</a>?&nbsp;Except for covering the practical skills, e.g. mannequin teaching or clinical examinations, we also focus on communication and ethics skills. Our tutors are practicing doctors who have significant UK working experience, so their input during the PLAB preparation course is priceless.You can check some of our previous customers&rsquo; testimonials: &ldquo;Firstly, let me thank you and everyone at IELTS medical for their support and guidance. Yes I am applying for PLAB exam now and I am representing India in the IELTS medical world cup.&rdquo;</p>\r\n<p align="justify">&ldquo;Whatever the results I will get, I want to thank you for your help, your professionalism, your fresh personality and your beautiful smile! You have been very supportive, very helpful and creative with the yoga session!!&rdquo;</p>\r\n<p align="justify">For 2018 course dates, visit our <a href="http://www.plablondon.com/" target="_blank" rel="noopener noreferrer">PLAB website</a> for more information.</p>\r\n<p><em><strong>Qualify as a doctor with us&hellip; Call 02036376722!</strong></em></p>', '', '190916105838.webp', 1, '2019-09-16 10:58:38'),
(28, 1, 'His first English textbook', 'first-english-textbook', '<ul>\r\n<li><strong>By Anna </strong></li>\r\n</ul>\r\n<p align="justify">We all know that Christmas time is exciting; not only because of the cheerful atmosphere, music and festive lights all over, but also because of the time you get to spend together with your family. For expats, this time of year could be especially challenging as most of them are away from their families who usually live overseas.</p>\r\n<p align="justify">Nowadays, multicultural families are quite common, therefore the possibility that not everyone will speak the same language at the Christmas dinner is much higher. I mean, there is not that much you can express with hand signs (unless you know the sign language, which is another story).</p>\r\n<p align="justify">This time of year is also when a lot of Christmas ads come on TV, as there is no doubt that the Christmas spirit drives the sales. There is this one particular Christmas ad which will make your hearts melt. It tells a beautiful story of an old, Polish man who gets his first English textbook in order to learn the language before Christmas. You can see him struggling, but also putting a lot of effort into it.</p>\r\n<p align="justify">I believe it will be an amazing motivation for all of you who have relatives who do not speak the same language as you. Family is one of the most important values in our lives, so it is definitely worth the effort to actually sit down, get that language book and practice. Even though at first it seems like a lot of hassle and work; even though that sometimes it may drive you crazy when you cannot understand that one particular grammar rule; even though that you occasionally pronounce some words in a wrong way &ndash; it will all be worth it at the end, when you see the big smile on someone else&rsquo;s face.</p>\r\n<p><em><strong>Spend the holidays with us&hellip; Call 02036376722!</strong></em></p>', '', '190916105722.webp', 1, '2019-09-16 10:57:22'),
(29, 1, 'What to do when you’re stuck', 'what-to-do-when-youre-stuck', '<ul>\r\n<li><strong>By Anna</strong></li>\r\n</ul>\r\n<p align="justify">You have taken the IELTS exam multiple times already and you still cannot get the scores you need. Perhaps you were studying by yourself; perhaps you were attending classes at some English school. It could be that you are getting the score you need from three skills, while in one you still get that disappointing 6.5.</p>\r\n<p align="justify"><em><strong>Sound familiar?&nbsp;</strong></em></p>\r\n<p align="justify">There are actually a few ways to deal with that. We very often come across medics who, for some reason, have issues with scoring 7.0 or 7.5 in writing. This is usually due to lack of proper preparation and not doing enough writing at home. When you are preparing by yourself, it gets a bit tricky when you are doing the writing tasks, because you need someone to check them for you and give you feedback. Sure, your grammar or spelling mistakes can be corrected by <em>any </em><strong>good</strong> English teacher &ndash; however, the format of your essay, what needs to be included in each paragraph &ndash; you can only get that feedback from a qualified IELTS tutor / examiner.</p>\r\n<p align="justify">We had a medic who booked in for a writing course of 10 classes, as she needed to get from 6.5 to 7.0 in writing. She was eager to improve and she attended classes three times a week. Bear in mind, that after each class she would get homework which she had to hand in before the following class, which required a lot of effort from her. She never complained, though, and found time to do the homework religiously and when the exam date came, she got the score without any problems.</p>\r\n<p>For nurses, there is also another way to get unstuck. Some of them decide to switch to the OET exam, where the writing skill seems to be much easier for them. The OET writing exam is much more predictable as it usually is a referral letter or a discharge letter. The whole exam is entirely healthcare oriented, so it seems less difficult for some of our nurses.</p>\r\n<p align="justify">Remember that when you&rsquo;re stuck in one place, it is always worth trying new things or new approaches to studying. There&rsquo;s never just <em>one</em> way to do get ready for IELTS. Various things work differently for various people, so don&rsquo;t be afraid of trying out something new.</p>\r\n<p><em><strong>Get un-stuck with us&hellip; Call 02036376722!</strong></em></p>', '', '190916105617.webp', 1, '2019-09-16 10:56:17'),
(30, 1, 'The benefits of being bilingual', 'the-benefits-of-being-bilingual', '<ul>\r\n<li><strong>By Anna</strong></li>\r\n</ul>\r\n<p align="justify">Speaking two languages instead of just one has obvious benefits in rapidly changing, multicultural, globalised world. It is clear that being bilingual opens a lot of different doors, not only in terms of your professional career, but also in terms of your personal development.</p>\r\n<p align="justify">It turns out that bilingualism can have much more perks that you would think at first. The most obvious benefits would be being able to talk to a wider range of people, easier travelling or being able to watch a film in its original language. However, there appear to be many more, not-so-obvious advantages.</p>\r\n<p align="justify">It has been scientifically proven that being bilingual makes you smarter. Speaking more than one language can have a profound effect on your brain, improving your cognitive skills, and even preventing dementia in old age.</p>\r\n<p align="justify">The image of bilingualism is much different now than what it was a century ago. Back in the day, it was perceived as an obstacle, especially for children and teenagers. Many scientists and educators insisted that being able to speak more than one language could interfere with one&rsquo;s education. Today, that opinion has changed completely. Although, the researchers were never wrong about the fact that bilingualism interferes with a person&rsquo;s education, it is definitely not a burden, but more like a blessing in disguise. There is scientific evidence that when you speak in one language (while being fluent in two or more), all languages that you can speak are active in your brain. This could lead to a situation where one language system obstructs the other. But this interference forces the brain to resolve the conflict and at the same time it gives the mind a valuable workout which strengthens the cognitive muscles in the brain.</p>\r\n<p align="justify">Bilingual people are also usually better at resolving mental puzzles or tasks. The collective evidence from a number of studies implies that bilingualism improves people&rsquo;s solving problem and planning skills as well as remembering complicated directions, for example when driving a car.</p>\r\n<p align="justify">I hope this article motivated you, even if just a little, to learn a foreign language. Keep exercising your mind and gain those bilingual superpowers!</p>\r\n<p><em><strong>Change the world with us&hellip; Call 02036376722!</strong></em></p>', '', '190916105514.webp', 1, '2019-09-16 10:55:14'),
(31, 1, 'Winter opening times', 'winter-opening-times', '<ul>\r\n<li><strong>By Anna</strong></li>\r\n</ul>\r\n<p align="justify">Even though we are an English learning school, we do not necessarily function like a typical school; not in terms of the holidays at least. That means that upcoming Christmas time does not mean no more classes until the New Year. Although we are in fact closed on Christmas Day and New Year&rsquo;s Eve, we are open on other days.<br /> Remember that learning a language is a process and you have to be systematic and thorough in order to improve &ndash; that means that too long breaks from studying could set you back in your progress and it would be a huge shame to let that happen.</p>\r\n<p align="justify">If you want to attend classes during the Christmas week, but for some reason, you cannot leave your house, e.g. because of guests or because of your children being off school, we will still be available on Skype. You could then reserve that 1 hour and 15 minutes for yourself, you can make yourself your favourite tea or grab some Christmas leftovers and connect with our IELTS tutor and examiners. You do not even have to dress up and have a class in your pyjamas.</p>\r\n<p align="justify">Please remember that our Skype lessons are always one to one, which means that you will be alone with our tutor, having all of their attention. It&rsquo;s a good opportunity to raise questions or doubts you may have regarding the exam or anything that you have learnt so far.<br /> Be sure to give us a call as soon as possible as the Winter schedule is filling up quickly!</p>\r\n<p align="justify"><em><strong>Warm up your skills with us&hellip; Call 02036376722!</strong></em></p>', '', '190916105409.webp', 1, '2019-09-16 10:54:09'),
(32, 1, 'Christmas lottery and Winter Party – this Sunday', 'christmas-lottery-winter-party-sunday', '<ul>\r\n<li><strong>By Anna</strong></li>\r\n</ul>\r\n<p align="justify"><span style="color: red;">This time of the year makes people all excited for many different reasons. Some love the Christmas atmosphere in the air, some just prefer when it is winter-ish outside, so they can cosy up in front of a fireplace, and some look forward to Christmas because of&hellip; <strong>THE PRESENTS</strong>.</span></p>\r\n<p align="justify"><span style="color: green;">If you are one of those people who enjoy this time of year because of the great opportunity it makes to give (and receive) gifts, then we have some amazing news for you!</span></p>\r\n<p align="justify"><span style="color: red;">IELTS Medical is holding a <strong>WINTER LOTTER</strong>Y! We were thinking about how to make our Medics&rsquo; lives even better during this magical time and we came up with this exciting idea. And you do not even have to do much &ndash; all you need to do is text <strong>WIN</strong> as well as one of your medic friend&rsquo;s phone number to <strong>07520632722</strong>. This way both of you will be taking part in the lottery and you will both get a chance to win fantastic prizes.</span></p>\r\n<p align="justify"><span style="color: green;">The prizes are pretty universal &ndash; something you will definitely be able to use. <em>They are &pound;50 worth of either Amazon vouchers or just simply cash</em> &ndash; to not overcomplicate things.</span></p>\r\n<p align="justify"><span style="color: red;">We will be also sending out postcards with holiday greetings to all medics in our system, so please make sure to look out for the mailman! The instructions how to enter the lottery will be written on the postcard as well, but if you have any questions whatsoever, you know the number &ndash;<strong> 0203 637 6722</strong>!</span></p>\r\n<p align="justify"><span style="color: green;">Additionally &ndash; this weekend we are having our <strong>Winter Party</strong>. On Sunday, the 17<sup>th</sup> of December, we are going to<a href="http://hydeparkwinterwonderland.com/" target="_blank" rel="noopener noreferrer"> Winter Wonderland </a>to spend some quality time together. It is going to be a perfect opportunity to catch up with your classmates as well as network with other medics! If you are going to come, please give us a heads up so we know to wait for you in case you are running late. See you then!</span></p>\r\n<p><em><strong>Get frosty with us&hellip; Call 02036376722!</strong></em></p>', '', '190916105319.jpeg', 1, '2019-09-16 10:53:19'),
(33, 1, 'New for 2018 ielts 4 x 4', 'new-2018-ielts-4-x-4', '<ul>\r\n<li><strong>By Anna</strong></li>\r\n</ul>\r\n<p align="justify">New Year usually means new beginnings. &nbsp;As the old year comes to an end, it is worth thinking about New Year&rsquo;s resolutions. It is a perfect time to start off fresh, no matter if in your personal or professional life.</p>\r\n<p align="justify">What better way to step into 2018 than to <strong>promise yourself you&rsquo;ll finally get that 7.0 or 7.5 score on the IELTS exam</strong>? If you have been struggling to get the right score, the beginning of new year is a perfect starting point to shake off all of these bad exam memories, pull yourself together and nail it so you could move on and start working in your profession.</p>\r\n<p align="justify">Here, at IELTS Medical we can help you achieve your goal. We enter the new year with our brand new course called i10 IELTS 4&times;4. It is an intensive course of all four skills which lasts a minimum of 3 and maximum of 12 weeks. You will have classes for 4 days a week, 5 hours per day, going through each skill to make sure you get your scores right this LAST time.</p>\r\n<p align="justify">This course is also suitable for medics who haven&rsquo;t taken the IELTS yet and don&rsquo;t really know how to prepare for it. Since it tackles all four skills from the very start, it gives you a fresh idea of how to go through the exam without much hassle.</p>\r\n<p align="justify">Please bear in mind that it is a very intensive course and it will require a lot of work and self-perseverance from you; loads of homework will be coming your way, after every 3 weeks you will be expected to sit a mini mock exam to check if you are making progress and what aspects of the IELTS exam you need to focus on more. But trust me &ndash; in the end it will be all worth it.</p>\r\n<p><em><strong>Get&nbsp;intensive with us&hellip; Call 02036376722!</strong></em></p>', '', '190916105213.webp', 1, '2019-09-16 10:52:13'),
(34, 1, 'Language tech – the best apps for learning a language', 'language-tech', '<ul>\r\n<li><strong>By Anna</strong></li>\r\n</ul>\r\n<p align="justify">When you are learning a foreign language, especially as a busy professional, it can become quite tricky to organise some free time for yourself to sit down with your textbook and study. And when you in fact sit down with your textbook and study, you may find yourself yawning and wishing you were on a sunny island, drinking delicious cocktails.</p>\r\n<p align="justify">It is therefore important to make studying fun, engaging and accessible wherever you are. What is the thing that you always carry with yourself? That&rsquo;s right &ndash; a smartphone. Did you know that you can actually learn from your phone?</p>\r\n<p align="justify">I have prepared a list of the most useful apps you can download to make learning English much more enjoyable.</p>\r\n<ol>\r\n<li><a href="https://www.duolingo.com" target="_blank" rel="noopener noreferrer"><strong>DUOLINGO</strong></a></li>\r\n</ol>\r\n<p align="justify">Duolingo is my favourite one for many reasons. Once you open it, you can create your account to track your progress, but if you do not want that, you can use it without an account. When you are learning English, you can actually do a placement test which will assess your English level so you could start your journey with Duolingo learning new things and not having to go through the very basics. It uses text, pictures and sounds to assist you with studying the language; it will even check your pronunciation, as you will be asked to repeat out loud certain sentences.</p>\r\n<ol start="2">\r\n<li><strong>MEMRISE</strong></li>\r\n</ol>\r\n<p align="justify">Memrise is not as smooth as Duolingo, but just as useful. It is very easy to use and it also supports offline courses, so you do not have to worry if you lose Internet connection in the tube. What is really unique about Memrise, is that it teaches you new vocabulary by putting words into sentences with similar words from your native language so your brain can build the connection. This helps you remember more new phrases.</p>\r\n<ol start="3">\r\n<li><strong>ACCELLA STUDY</strong></li>\r\n</ol>\r\n<p align="justify">It offers a variety of different tasks to help you study English, including quizzes, flash cards, spaced repetition and others. It even has a hands-free mode, so you can use it while driving a car! This app is great for learning vocabulary, as it allows you to create your own vocabulary sets. You can use this feature to practice words which you have problems with.</p>\r\n<ol start="4">\r\n<li><strong>LEAF</strong></li>\r\n</ol>\r\n<p align="justify">Leaf is like a phrasebook for every context and it was designed to make you fluent in every situation you encounter. This app is so intelligent that it will even use your location and phone usage to determine which lessons you may find useful.</p>\r\n<ol start="5">\r\n<li><strong>LY</strong></li>\r\n</ol>\r\n<p>Another amazing app, however this one can help you with the IELTS Reading part. It gathers various texts on different topics, which firstly you have to read, and then work on. The app will go through the vocabulary of the particular text and help you understand and remember it. The algorithms&rsquo; aim is to make you familiar with 90% of the vocabulary you read in the text.</p>\r\n<p><em><strong>Get techy with us&hellip; Call 02036376722!</strong></em></p>', '', '190916105125.webp', 1, '2019-09-16 10:51:25'),
(35, 1, 'How to improve your reading skills', 'improve-reading-skills', '<ul>\r\n<li>By Anna</li>\r\n</ul>\r\n<p align="justify"><a href="../../../increase-reading-speed/" target="_blank" rel="noopener noreferrer">Even if you read 7 books a week</a>, it does not matter, unless you understand fully what you have read. Understanding what is written is called reading comprehension and it is one of the four skills you will come across doing your IELTS or OET exam.</p>\r\n<p align="justify">To lift your spirit a little bit, I can say that very often even native speakers struggle with reading comprehension. It could be that your vocabulary requires work, it could be that the text is <em>just so boring</em> you cannot focus your attention on actually understanding it; it could also be that you are not familiar with certain grammatical forms so it makes it impossible for you to understand a particular sentence.</p>\r\n<p align="justify">There are two main methods to improve your reading skills: intensive reading and extensive reading.</p>\r\n<p align="justify">Read intensively if you want to practice the fundamentals and learn new vocabulary. This method will allow you to focus on the details of what you&rsquo;re reading. When you are reading intensively, first thing you should always do is look for the gist of a text&rsquo;s meaning. Do not worry about words you don&rsquo;t really understand. As long as you get the general idea behind the discourse, you are fine. Later on, read the full text, preferably out loud, putting attention to the rhythm and pronunciation. As you go, underline words you do not understand and come back to them later. Then read the full text again and try to guess the meaning of the words you&rsquo;ve underlined. If you can do that &ndash; awesome. If you can&rsquo;t, then grab the dictionary and keep looking. After that you can make a list of words you want to learn for future reference, so you can remember them next time.<br /> After that &ndash; repeat it with different texts. It is also helpful rereading things you&rsquo;ve already read &ndash; it will build up your confidence and maybe let you notice something you haven&rsquo;t noticed before.</p>\r\n<p align="justify">Reading extensively is helpful if you want to learn how to understand the general meaning of a text quickly. This method focuses on the general picture; it&rsquo;s great for studying a newspaper, a textbook or an assigned book for school. The first helpful practice to do while reading extensively is to take notes as you read: for example you can make bullet points to summarise every time you go to a major idea; underline key terms or dates in the text which you think are important for understanding a particular paragraph; note down questions you ask yourself while you are reading and not understand something. In the end, write a short summary of what you&rsquo;ve read &ndash; this will help you grab the meaning of the text as well as practice writing in the meantime.</p>\r\n<p align="justify">Remember, the key to improving is always practice. No matter the method, the more you read, the better you get.</p>\r\n<p><em><strong>Read intensively or extensively with us&hellip; Call 02036376722!</strong></em></p>', '', '190916105026.jpeg', 1, '2019-09-16 10:50:26'),
(36, 1, 'Learn English through film: a guide', 'learn-english-film-guide', '<ul>\r\n<li><strong>By Anna</strong></li>\r\n</ul>\r\n<p align="justify">What is the most fun way of learning a language? Watching films and TV series! (For some it could also be playing video games, but we&rsquo;re not going to focus on that now&hellip;</p>\r\n<p align="justify">Learning a foreign language is already hard if you think about the grammar and pronunciation, especially if it vastly differs from your native language. Let alone the cultural differences &ndash; some concepts may not even exist in your mother tongue, so sometimes it can be extremely difficult to understand certain ideas.</p>\r\n<p align="justify">That is why watching film and TV series in English is so beneficial. It may not teach how to write an opinion essay, but it will certainly teach you a bunch of other skills.</p>\r\n<p align="justify">First of all, you will learn <em>real</em> English and not textbook English. You will get a grasp of a colloquial language and some less informal phrases you can use in your everyday life. Usually, English spoken in films is more natural and sounds more like what you&rsquo;d hear in the street &ndash; therefore it is a nice way to improve your speaking.</p>\r\n<p align="justify">You will learn English words in context. Normally, when you learn vocabulary, especially at school, you would get a list of words and you would learn what they mean. When you watch films, you can see in which context specific words are used. You could also learn words you would probably never come across. For example, after watching a few seasons of one of my favourite shows &ldquo;Suits&rdquo;, my vocabulary of legal English was much richer.</p>\r\n<p align="justify">Another perk of learning English via watching films is learning the right way to pronounce words. Not only that &ndash; if you are ambitious enough, you can even practice different accents!</p>\r\n<p align="justify">However, please remember that this method will not teach you academic English which you need for passing the IELTS. Although, it is a great way to be in touch with the language at all times without even noticing it &ndash; and this will certainly help you in the long run.</p>\r\n<p><em><strong>Watch movies with us&hellip; Call 02036376722!</strong></em></p>', '', '190916104905.webp', 1, '2019-09-16 10:49:05'),
(37, 1, 'How To Fulfil Your New Year’s Resolutions?', 'fulfil-new-years-resolutions', '<ul>\r\n<li><strong>By Anna</strong></li>\r\n</ul>\r\n<p align="justify">I have some tips for you as for how to make sure you actually stick to the plan. Well, first of all &ndash; <strong>make a plan</strong>. If your resolution is studies-focused, especially when it comes to IELTS, it can&rsquo;t just be &lsquo;This year I will get 7.5 on my exam&rsquo;. That&rsquo;s too general and too much wishful thinking. If you want to succeed, you need to commit. If your starting point is 6.0 in Writing and you need to get to 7.5 in the end, <strong>give yourself time</strong>. Don&rsquo;t commit to getting a 7.5 straight away, because it will discourage you quickly. Instead, plan it out. For example, you can promise yourself you would get from 6.0 to 6.5 in a month. It&rsquo;s perfectly doable and not too extreme.</p>\r\n<p align="justify"><strong>Once you achieve your mini-goal</strong> &ndash; reward yourself. You may think that achieving your milestone is a reward in itself, but it is important that you give yourself that little additional prize and a big one once you get to your main goal. That will keep you extra motivated.</p>\r\n<p align="justify">If you have trouble getting to where you need to be &ndash; <strong>write down the things that usually distract you</strong> from achieving your goal. It could be that for example you&rsquo;d rather procrastinate than do your homework. Try to eliminate those factors by making studying more fun (we&rsquo;ve had some articles on that). If you can&rsquo;t find any motivation to learn, think of<strong> WHY</strong> you want to do it. All of our&nbsp;learners attend the classes in order to pass the IELTS or the OET so they can register and work as doctors or nurses in the UK. If you get lost along the way, not being motivated enough to pass the exam, think of where you&rsquo;ll be once you pass it. You have spent many years in a university, studying your profession with the main thought of helping people and saving lives. If you truly want to do that &ndash; that should be your motivation. If that helps, imagine yourself working in your dream hospital, wearing scrubs, earning much more and feeling accomplished as a professional. And keep working towards that!</p>\r\n<p><strong><em>Keep your resolutions with us&hellip; Call 0203637672.</em></strong></p>', '', '190916104607.jpeg', 1, '2019-09-16 10:46:07'),
(38, 1, 'The Best Time For OSCE Review', 'best-time-osce-review', '<ul>\r\n<li><strong>By Anna</strong></li>\r\n</ul>\r\n<p align="justify">Any exam or test is usually a very stressful event. I, for example, remember my driving exam as the most stressful day in my entire life, even the exams that I had when I studied at the university were nowhere near as stressful as that driving exam was. It got to the point where I didn&rsquo;t know how to control the stress level and eventually failed the test. It was only when I learned how to prepare mentally for the exam when I actually passed it.<br /> I will give you some tips as for how to prepare for your OSCE exam beforehand and on the day to feel more self-confident and comfortable.</p>\r\n<p align="justify&quot;">1. Try not to be nervous and stay calm &ndash; I know it&rsquo;s easier said than done. But you have to believe in yourself and that you are properly prepared. You are a qualified nurse and the exam is for nurses entering registration at an entry level. You got this! You have spent many years studying to be a nurse, you have probably also worked in your profession for some time so you know what you&rsquo;re doing.</p>\r\n<p align="justify&quot;">3. The day before the exam just relax. Don&rsquo;t think about it. Let your mind rest. If you can, take a day off. Make yourself a nice, long bath. Try to get a good night&rsquo;s sleep as well so you are properly rested and fresh the day of the exam.</p>\r\n<p id="" align="justify&quot;">5. Remember that you are presented as you would need to be in practice &ndash; that means no jewellery, if you have long hair &ndash; tie it up, no nail polish, wear flat shoes and short sleeve.</p>\r\n<p align="justify&quot;">7. Give yourself enough time to get to your test centre; keep in mind the traffic or if you&rsquo;ve never been in the area, give yourself extra time to find the way.</p>\r\n<p align="justify&quot;">You definitely got this. You&rsquo;ve been preparing for the exam, you&rsquo;ve been working in your profession in your home country, you&rsquo;ve read everything you can about this test &ndash; passing it is just one of the steps on your way to being a practising nurse in the UK. You&rsquo;ve already passed statistically the most difficult part which is the language proficiency test. OSCE should now be a piece of cake!</p>\r\n<p align="justify&quot;">Get OSCE&nbsp;review&nbsp;with us&hellip; call on 0203 637 6722.</p>', '', '190916104513.jpeg', 1, '2019-09-16 10:45:13'),
(39, 1, 'OSCE REVIEW', 'osce-review', '<ul>\r\n<li><strong>By Anna&nbsp;</strong></li>\r\n</ul>\r\n<p align="justify">When you are a nurse wanting to register with the NMC, the last step, after completing the language requirements and passing the CBT is moving to the OSCE exam which will test your practical nursing skills.</p>\r\n<p align="justify">During the OSCE exam, the nurses and midwives are required to act out certain scenarios which will assess their clinical skills. There are six separate stations using simulated patients in a clinical setting, each lasting between 10-20 minutes; the first four stations will test the candidates&rsquo; knowledge and understanding of the assessment. The last two stations will focus primarily on the practical skills.</p>\r\n<p align="justify">Since OSCE is a very important part of your NMC registration, it is vital that you come <a href="http://www.ieltsnurses.co.uk/osce-training-for-uk-nurses" target="_blank" rel="noopener noreferrer">properly prepared</a> for the actual exam. If you are employed at a hospital as a pre-registered nurse, your trust will most likely provide you with the in-house training; the nurses who work&nbsp;in domiciliary care, care centres, clinics or nursing homes are at a <em>huge</em> disadvantage and that is why we offer a thorough OSCE review in London.</p>\r\n<p align="justify">Additionally, those nurses who have training at their hospitals very often benefit from a private OSCE training with us as well.<br /> Our OSCE training sessions last consecutive days and they usually take place at the Whittington Hospital where the learners can use specially prepared exam rooms with all of the necessary equipment. Our tutors are professional OSCE trainers and registered nurses, who have been delivering the OSCE training for&nbsp;over two years for Central London trusts.</p>\r\n<p align="justify">During our <a href="http://www.ieltsnurses.co.uk/osce-training-for-uk-nurses" target="_blank" rel="noopener noreferrer">OSCE review</a> you will go through each step and as many possible scenarios as possible to make sure you are ready for the exam. Our tutors will give you feedback, tips and guidance throughout the 3 days as well as the time before the training as they have pre-course material and a special WhatsApp group for the students where they share their feedback and experience. In that WhatsApp group you will also be assigned homework which will be checked and marked before the training.</p>\r\n<p>Our <a href="https://www.eventbrite.co.uk/e/nmc-osce-london-hospital-training-by-mynurseslife-3-day-course-tickets-40964676450?aff=erelexpmlt" target="_blank" rel="noopener noreferrer">next OSCE&nbsp;review in London</a>&nbsp; and we have <a href="https://www.eventbrite.co.uk/o/ielts-medical-ltd-12783634397" target="_blank" rel="noopener noreferrer">London OSCE training </a>at least once each month. If you wish to sign up or if you have any questions, feel free to give us a call on 0203 637 6722.<br /> This is how the OSCE training looked last time:</p>', '', '190916104416.webp', 1, '2019-09-16 10:44:16');
INSERT INTO `blog` (`id`, `author_user_id`, `title`, `slug`, `description`, `meta_description`, `photo_image`, `user_status`, `created_date`) VALUES
(40, 1, 'Meet the Examiner Webinar', 'meet-examiner-webinar', '<p>The most frequently feedback we hear from IELTS test takers is that after the exam, all they receive is a sheet of paper with a score on it and no further information about why they have been assessed at the score they have been. We feel your pain and have our own theories as to why the British Council takes this approach. Here at IELTS Medical we have IELTS Speaking and Writing examiners on the team, who are able to give you an insight into the mind of an IELTS examiner. In 2018, we&rsquo;ve pledged to host more webinars and give our medics more access to up-to-date knowledge straight from the source.</p>\r\n<p>Our first webinar is on Friday 26th January, 2019 and <strong>We Want You</strong> to submit your questions for our Writing examiner Michael on this post. He&rsquo;ll be answering your questions during the live 1hr webinar as we prepare for the February exams.</p>', '', '190916104256.webp', 1, '2019-09-16 10:42:56'),
(41, 1, 'Is the Home Office blocking international doctors?', 'is-the-home-office-blocking-international-doctors', '<ul>\r\n<li><strong>By Derek</strong> with <a href="https://inews.co.uk/news/health/nhs-blocked-doctors-home-office-visa-rejections/" target="_blank" rel="noopener noreferrer">credit to inews</a></li>\r\n</ul>\r\n<p align="justify">Recent limits imposed by the Home Office on the number of overseas medics have sparked outrage among foreign doctors. Reports from companies, such as BDI Resourcing, has raised concerns over 54 doctors who have recently accepted jobs in UK hospitals, only to arrive in the UK to be told that their certificate of sponsorship (CoS), a document necessary to work as a doctor, are &ldquo;unavailable&rdquo;. Junior doctors working in areas such as elderly care and surgeons are reported to be most affected.</p>\r\n<p align="justify">Daniel Platts, director and general medicine specialist at BDI Resourcing wrote: &ldquo;Since the annual allocation will not refresh until the end of March [2018] it seems reasonable to assume that by this time the NHS will have more than 100 vacant gaps that could (and should) be filled by these fully qualified and willing doctors. He also went on to say: &ldquo;Perhaps more concerning, is that many of these doctors are now reassessing their whole plans to relocate to the UK, particularly as many face months of uncertainty whilst being out of work unless they sign contract extensions in their home countries.&rdquo;</p>\r\n<p align="justify">It is well known that the NHS relies on a steady stream of international healthcare professionals. To disrupt the stream without adequate compensation will invariably have a detrimental effect on NHS.</p>\r\n<p align="justify">Some may argue that Home Office is in line with the Health Secretary, Jeremy Hunt&rsquo;s statement in 2016 pledging a package of measures aimed at reducing the NHS&rsquo; reliance on foreign-trained medics after the UK leaves the European Union. Mr Hunt stressed that foreign-trained doctors do a &ldquo;fantastic job&rdquo; before adding &ldquo;is it right to import doctors from poorer countries that need them while turning away bright home graduates desperate to study medicine?</p>\r\n<p align="justify">What do you think? Is the Home Office intentionally blocking overseas qualified doctors?</p>\r\n<p align="justify"><strong>Share your opinion with us&hellip; Call 02036376722!</strong></p>', '', '190916104209.webp', 1, '2019-09-16 10:42:09'),
(42, 1, 'IELTS Listening practice', 'ielts-listening-practice', '<ul>\r\n<li><strong>By Derek</strong></li>\r\n</ul>\r\n<p align="justify">In each of our weekly newsletters, we ensure to include a nod to the vast majority of listening materials that will be helpful for the IELTS exam. We recommend podcasts and programs where you can listen to English conversations that are similar to the ones you&rsquo;ll hear during the&nbsp;test. As you&rsquo;re aware during section 1, you listen to a basic conversation between two people that takes place in an regular social situation eg. between a salesperson and a customer. In section 2, you listen to a monologue (one speaker) in a social situation eg. a guide talking to visitors about a tourist attraction. In section 3, you listen to a&nbsp;conversation between up to four people set in an educational or training setting eg. to a tutor and their students discussing transport. Finally, during&nbsp;section 4, you listen to a monologue about an academic topic eg. a university lecture about the extinction of sea&nbsp;mammals.</p>\r\n<p align="justify">Some of our medics struggle with the listening part of the exam because they&rsquo;re unfamiliar with the language and the vocabulary that the speakers are using. They mention that the conversations become faster and more difficult and, as you can see, this is no coincidence. The best weapon against this is to listen to as much English as possible, as often as possible. If you come across a term you don&rsquo;t understand, look it up and try to use it in a sentence. When you are able, listen to academics debating a topic. Working to understand their discourse will give you the preparation you need to need to catch &ndash;<em> at the very least</em> &ndash; the gist of all 4 sections as quickly as possible. In time, you will see your scores rise dramatically &ndash; in fact some of our medics have reached the 9.0 (40/40) on the IELTS Listening exam.</p>\r\n<p align="justify"><strong>Listen with us&hellip; Call 02036376722!</strong></p>', '', '190916103753.webp', 1, '2019-09-16 10:37:53'),
(43, 1, 'Tips to #rock your language exams', 'tips-to-rock-your-language-exams', '<ul>\r\n<li><strong>By Elisa</strong></li>\r\n</ul>\r\n<p>Everyone loves language exams, right? The amazing union of stress and pressure that embrace you&nbsp;when you start a course and doesn`t go away until the result is released. So! Since we all &ldquo;<em>love</em>&rdquo; this feeling, I will give you some tips to rock on your language exam!</p>\r\n<p><strong>1. Prioritize your revision</strong><br /> Unfortunately, every exam is unique, with a certain set of specific skills being tested. Plan ahead, make sure you know exactly what aspects of the language are being tested in the exam itself, and prioritize your revision on improving the weakest parts of your linguistic repertoire.<br /> <strong>2. Make a plan</strong><br /> Start as soon as possible! Look at your schedule and build yourself a bespoke and strict plan that gives you time to focus on all areas of the language. Dedicate between 30-90 minutes a day to your language learning. Just remember &mdash; you are the boss of your own study plan, set yourself daily or weekly goals that you can aim for and make it happen!<br /> <strong>3. Have fun!</strong><br /> Don`t be such a book worm! Try to make some native friends and exercise your language skills with them or if you are a real geek you could start to do some crosswords in your free time. If you have to complete a gap-fill style task, practise gap-fill exercises. If you have to write a short letter find a pen pal, even an imaginary one. If you have an oral exam play taboo with your native friends. Or add random people on skype and try to speak with them, so you could practise most of your language skills.<br /> <strong>4. Vocabulary!</strong><br /> All new word learned is relevant! You can extend your vocabulary in many ways: read books and underline all the words that you don`t understand, watching a film with English subtitles so you could exercise your vocabulary and your spelling at the same time. Using lot of sticky notes to `decorate` your house with words and grammatical structure you always forget. You can even pick your favourite English song and start to study/translate the lyrics.</p>\r\n<p><strong>5. Speaking</strong><br /> Record yourself or look yourself in the mirror meanwhile your exercise your speaking, it is really useful because you could correct your pronunciation when necessary and you could listen and read your notes at the same time.</p>\r\n<p>With hard work and a bit of fun everyone can rock on a language exam!</p>\r\n<p><em><strong>Rock your exams with us&hellip; Call 02036376722!</strong></em></p>', '', '190916103611.webp', 1, '2019-09-16 10:36:11'),
(44, 1, 'OET (Medicine) Writing Guide for Doctors — OUT NOW', 'oet-medicine-writing-guide-doctors-now', '<p style="font-weight: 400;">We&rsquo;ve done it again! In stock and shipping now is the <a href="http://www.oetdoctors.co.uk" target="_blank" rel="noopener noreferrer">OET (Medicine) Writing Guide for Doctors.</a></p>\r\n<p style="font-weight: 400;">In order to succeed in the Writing exam of the OET Medicine, overseas qualified doctors need to be able to write a discharge/referral or transfer letter to a healthcare professional or a letter of advice to a member of the public. This requires knowing letter writing convention and also the best methods for selecting the correct information to put into the letter, so that you score the highest possible grades.</p>\r\n<p style="font-weight: 400;">This book is a complete guide to Writing section of the Occupational English Test.&nbsp;It contains clear instructions, 25 practice questions and 25 model answers to help you pass your OET.</p>\r\n<p style="font-weight: 400;">The&nbsp;<strong><strong>OET (Medicine) Writing Guide for Doctors</strong></strong>&nbsp;is produced by IELTS Medical, a training centre for Medical professionals and part of the OET Premium Providers Program. Our writers and editors are NHS medical and healthcare professionals experienced in preparing overseas qualified doctors for the Occupational English Test (OET). Together we have produced an up-to-date guide on the writing section of OET (Medicine) to assist doctors at the start of their OET preparation. Our guide features:</p>\r\n<ul>\r\n<li style="font-weight: 400;">Key revision material of the essential facts and best practice.</li>\r\n<li style="font-weight: 400;">Advice on how to tackle OET Medicine writing exam.</li>\r\n<li style="font-weight: 400;">25 practice case notes and questions.</li>\r\n<li style="font-weight: 400;">Model answers.</li>\r\n<li style="font-weight: 400;">Examiner marking guides.</li>\r\n<li style="font-weight: 400;">Common errors to avoid and top tips for exam success.</li>\r\n</ul>\r\n<p style="font-weight: 400;">with everything collated to help you reach grade B and beyond in OET (Medicine).</p>\r\n<p style="font-weight: 400;"><em><strong>Get writing with us&hellip; Call 02036376722!</strong></em></p>', '', '190916103325.webp', 1, '2019-09-16 10:33:25'),
(45, 1, 'OET changes in September — can you take your shot now?', 'oet-changes-september-can-take-shot-now', '<ul>\r\n<li><strong>By Elisa</strong></li>\r\n</ul>\r\n<p align="justify">Have you heard the latest OET news? Well, the OET exam is going to be updated in September 2018.</p>\r\n<p align="justify">The Occupational English Test is being updated&nbsp;in Autumn&nbsp;to ensure&nbsp;that it remains relevant by reflecting the types of real communication scenarios the healthcare professional will most likely face at work. The OET wants to meet the new expectations the healthcare&rsquo;s world is demanding today. Indeed, nowadays healthcare professionals and patients are travelling throughout the world to provide or receive care, which causes a melting pot of English accents. Hence, the test will be more focused on patient-centered care. This means that healthcare professionals need to be flawless in gathering information to understand their patients&rsquo; needs and concerns.</p>\r\n<p>In depth, the changes are going to be&nbsp;as followed:</p>\r\n<p><strong><u>Listening (40-45 minutes)</u></strong></p>\r\n<p>The Listening sub-test will be divided into three parts now, but it will be shorter:</p>\r\n<ul>\r\n<li>Part A (15 minutes): Two separate consultations between a healthcare professional and a patient;</li>\r\n<li>Part B (10 minutes): Six short dialogues or monologues in a workplace setting;</li>\r\n<li>Part C (15 minutes): Two long presentations or interviews with health professionals;</li>\r\n</ul>\r\n<p><strong><u>Reading (60 minutes)</u></strong></p>\r\n<p align="justify">The Reading sub-test will be divided into three parts and will include new task types such as matching, short-answer questions, and a new broader range of documents, such as policy or procedure documents:</p>\r\n<ul>\r\n<li>Part A (15 minutes): Expeditious (fast) reading task;</li>\r\n<li>Part B (45 minutes): Six short workplace extracts;</li>\r\n<li>Part C: Two long presentation passages;</li>\r\n</ul>\r\n<p><strong><u>Speaking (20 minutes)</u></strong></p>\r\n<p align="justify">The Speaking sub-test will now also assess clinical communication skills such as:</p>\r\n<ul>\r\n<li>Relationship building;</li>\r\n<li>Understanding the patient&rsquo;s perspective;</li>\r\n<li>Providing structure to the conversation;</li>\r\n<li>Gathering information from the patient;</li>\r\n<li>Establishing what the patient already knows;</li>\r\n</ul>\r\n<p><strong><u>Writing (45 minutes)</u></strong></p>\r\n<p align="justify">There will be no changes to the way writing is assessed by the OET.</p>\r\n<p align="justify">The changes are going to be effective <strong>for the exams from 9 September 2018</strong> (registrations open 21 June).&nbsp;As Preparation Providers, we have a duty to be ready for both exams. However, if you are ready for the OET and can take your shot under the current guidelines, we implore you&nbsp;to get in touch with us today.</p>\r\n<p><em>Pass the<strong> current</strong> OET with us&hellip; Call 02036376722!</em></p>', '', '190916103048.webp', 1, '2019-09-16 10:30:48'),
(46, 1, 'You said our centres were too far…', 'said-centres-far', '<p>We currently have IELTS, OET (Medicine and Nursing) and OSCE courses at our centres in:</p>\r\n<ul>\r\n<li>Archway: 85 Hazellville Road, London, N19 3NB 02036376722</li>\r\n<li>Marylebone: 22-25 Portman Close, London, WC1H 6BS 02036379253</li>\r\n</ul>\r\n<p>From the 4th May, 2018, we will also have these courses at our centre in:</p>\r\n<ul>\r\n<li>Ilford: 1 Cranbrook Road, Ilford, IG1 4DU&nbsp;02036379254</li>\r\n</ul>\r\n<p>Our class times remain the same:</p>\r\n<p><span style="text-decoration: underline;"><strong>Morning</strong></span></p>\r\n<ul>\r\n<li>10:00 &ndash; 11:15</li>\r\n<li>11:30 &ndash; 12:45</li>\r\n</ul>\r\n<p><span style="text-decoration: underline;"><strong>Afternoon</strong></span></p>\r\n<ul>\r\n<li>14:00 &ndash; 15:15</li>\r\n<li>15:30 &ndash; 16:45</li>\r\n<li>17:00 &ndash; 18:15</li>\r\n</ul>\r\n<p><span style="text-decoration: underline;"><strong>Evening&nbsp;</strong></span></p>\r\n<ul>\r\n<li>18:30 &ndash; 19:45</li>\r\n<li>20:00 &ndash; 21:15</li>\r\n</ul>\r\n<p>For each course, a maximum of 4 medics will be admitted to a single class or 6 medics to a double class.</p>\r\n<p>We&rsquo;ll be in touch with all of our Ilford and City medics shortly, and hope to be part of your journey&rsquo;s to registration&hellip;</p>\r\n<p><strong><em>Get (Portman) close to us&hellip; Call 02036376722!</em></strong></p>', '', '190916102950.webp', 1, '2019-09-16 10:29:50'),
(47, 1, 'Get (OET) Writing', 'get-oet-writing', '<p align="justify">Inspired by one of our doctors and created specifically for the OET, comes our OET writing service. For medics taking the leap from IELTS and into OET, we&rsquo;ve streamlined writing practice to enable you to practice responding to OET case notes. For the past three weeks, we&rsquo;ve been accumulating case notes and model answers that give you a taste of what to expect in the exam. What&rsquo;s more, when you choose one of the OET packages below, we&rsquo;ll give you access to our portal that allows you to upload your writing and receive feedback within 48 hours. We believe that the best way to get better at OET writing is to <strong>write</strong> and we give you the opportunity to do just that.</p>\r\n<p align="justify"><span style="text-decoration: underline;"><strong>The packages</strong></span></p>\r\n<ul>\r\n<li>Package A is &pound;65 for 5 case notes, 5 sets of model answers and 5 sets of feedback.</li>\r\n<li>Package B&nbsp;is &pound;111 for 10 case notes,&nbsp;10 sets of model answers and 10 sets of feedback.</li>\r\n<li>Package C&nbsp;is &pound;180 for 20 case notes, 20 sets of model answers and 20 sets of feedback.</li>\r\n</ul>\r\n<p><strong><em>Get writing with us&hellip; Call 02036376722!</em></strong></p>', '', '190916102855.webp', 1, '2019-09-16 10:28:55'),
(48, 1, 'Getting ready for Summer', 'getting-ready-for-summer', '<ul>\r\n<li><strong>By Elisa</strong></li>\r\n</ul>\r\n<p align="justify">The winter is almost gone and IELTS Medical is getting ready&nbsp;for our international&nbsp;medics travelling here from all over the world to join us for the Summer! In association with an experienced team of immigration solicitors, we&rsquo;re inviting the very best doctors and nurses to study either IELTS or OET and either CBT or Plab 1. What&rsquo;s more, in association with our hospital clients, they will have a and a guaranteed interview with an organisation who is ready, willing and able to make them an offer of employment&hellip; ladies and gentlemen, this summer is <strong>THE</strong> summer!</p>\r\n<p align="justify">The course includes three to six weeks of intensive IELTS or OET study (your first step towards the GMC/NMC registration). This is followed by one week spent in a Trust learning about what life is like working in a UK hospital or care organisation. You`ll have a guaranteed interview with at least one hospital or care organisation so that you can return home with the knowledge you need to make an informed decision as to whether working in the UK is right for you. Moreover the fee includes UK VISA support and London accommodation as well! So you don&rsquo;t have to worry about anything but studying and enjoying the city in the most pleasant period of the year.</p>\r\n<p align="justify">Don&rsquo;t forget that the more interaction you have with native folks, the better you will be in developing a wider and stronger passive vocabulary and understanding of the English culture and customs of nowadays.</p>\r\n<p align="justify"><em><strong>Excited yet?</strong></em></p>\r\n<p align="justify">Don&rsquo;t miss the opportunity to have a great learning experience in one of the most beautiful city in the world!</p>\r\n<p align="justify">Join our medics to this outstanding and utterly professional route towards a better and exciting life!</p>\r\n<p align="justify"><em><strong>Transform your life with&nbsp;us&hellip; Call 02036376722!</strong></em></p>', '', '190916102746.webp', 1, '2019-09-16 10:27:46'),
(49, 1, 'Not an ordinary story', 'not-ordinary-story', '<ul>\r\n<li><strong>By Elisa</strong></li>\r\n</ul>\r\n<p align="justify">Going abroad might seem a simple process, but is not &ndash; especially if you are in the healthcare industry and you want to practice your profession as you do in your homeland. That&rsquo;s why I&nbsp;thought that I&rsquo;d mention one of our student&rsquo;s story&nbsp;that <em>really</em> moved me.</p>\r\n<p align="justify">It was a mellow Friday morning in central London and I was in the office waiting&nbsp;for students to arrive for their 10am lesson. The very first one to arrive was doctor A, the man that this story is about.</p>\r\n<p align="justify">He opened the door with a big joyful smile and said, &ldquo;good morning&rdquo; and I replied. The rest of the students were late, so we started to talk about life in general. Since I am a really inquisitive person, I asked doctor&nbsp;A to tell me more about himself. Doctor&nbsp;A told me his story and what he went through during these last few (rather <em>mad &ndash; his words</em>) years. You see doctor A&nbsp;is originally from Palestine, but because of the situation back there at that time, he had to move in Syria. He practiced his profession for decades and then few years ago even Syria went through a &ldquo;crisis&rdquo; as he calls it. So he had to move to France and start again from zero: new language new world, but as hard it&nbsp;sounds to do that &ndash; it&rsquo;s not like living in a war zone and experiencing constant fear of what could happen in the next few <em>minutes</em>.</p>\r\n<p align="justify">After couple of years spent in France he decided to move in England and finally achieve a better life. Doctor A&nbsp;spoke a little English at that time, but he didn&rsquo;t let that stand in his way. He studied and practice before he came across one of our adverts. Since we are one of <strong>the best OET centres in London</strong> (and potentially the UK), he chosen us to be by his side through this part of his journey.</p>\r\n<p align="justify">Doctor A will be taking the OET exam in a couple of months and I&rsquo;m wishing him the very best.</p>\r\n<p align="justify">Fulfil your goals with us&hellip; Call 0203 637 6722!</p>', '', '190916102545.webp', 1, '2019-09-16 10:25:45'),
(50, 1, 'OET Reading Techniques', 'oet-reading-techniques', '<ul>\r\n<li><strong>By Elisa</strong></li>\r\n</ul>\r\n<p align="justify">Today I am going to give you some reading techniques tips which are going to be useful on the &ldquo;big day&rdquo;. Each Reading test is different you could have a reading and comprehension with multiple choices answers or a fill in the gaps, in each of them you need to use different technique. I am going to show you some of them:</p>\r\n<p><strong>Elimination process</strong></p>\r\n<p align="justify">An important multiple choice strategy is to eliminate the incorrect answers before making a selection. This strategy is particularly useful when you are not certain of the right answer and must guess. The elimination process increases your chances of selecting the right answer. After eliminating some choices, you should look at all the remaining possible answers to determine which the most correct answer is.</p>\r\n<p><strong>Notes</strong></p>\r\n<p align="justify">The first step to successful reading comprehension is to carefully read all parts of the material. Begin by reading the title and any background information to enrich your understanding of the text. As you read, take careful notes, underlining repeated words and phrases, quickly marking down questions in the margins, and marking main points and sub points. If you are taking a reading comprehension exam, writing on the text while you read can help keep you more alert and engaged with the material.</p>\r\n<p><strong>Speed Reading</strong></p>\r\n<p align="justify">Try to spend no more than one second on each line and then increase your speed with each subsequent page. You will probably find that you retain very little information at first, but, as you train your brain and you become more comfortable with the technique, your comprehension should improve.</p>\r\n<p><strong>Practice</strong></p>\r\n<p align="justify">In the case of timed tests, such as the Reading A, you should practice reading in a limited time frame. Setting a timer while you read increases your comfort with working in a time constraint and can reduce potential stress on test day. Practicing reading also reveals weaknesses that you can improve ahead of time, such as pace of reading, inference of implied meaning and vocabulary skills.</p>\r\n<p align="justify"><em><strong>Get (#OET) reading with us&hellip; Call 02036376722!</strong></em></p>', '', '190916102422.webp', 1, '2019-09-16 10:24:22'),
(51, 1, 'Have you heard about our game?', 'have-you-heard-about-our-game', '<ul>\r\n<li><strong>By Elisa</strong></li>\r\n</ul>\r\n<p>If you don&rsquo;t have anyone to practice your OET speaking this blog post is for you!</p>\r\n<p align="justify">A few days ago, we met with a few of our medics who attended the OET course and&nbsp;completed the mock OET exam with us. They were sad that they couldn&rsquo;t find anyone willing to practice their OET speaking &ndash; even their <strong>best</strong> friends were getting bored of&nbsp;speaking practice for an exam they&rsquo;d only just heard of a few weeks ago!</p>\r\n<p align="justify"><strong>It gave us a&nbsp;<span style="color: #ff9900;">#lightbulb</span> moment.</strong></p>\r\n<p align="justify">What if there was a speaking card game that made #OET Speaking practice a lot of fun?! You&rsquo;d be able to turn a reluctant &ldquo;best friend&rdquo; into a willing participant.</p>\r\n<p align="justify">We brainstormed about the game for days, but the basic premise flowed naturally&hellip; we just needed a name.</p>\r\n<p align="justify">We reached out to our current OET Cohort I, explained how the game would work and asked them what we should call it.&nbsp;When Doctor A asked, &ldquo;what about Tic Toc Doc?&rdquo; our game was born!</p>\r\n<p align="justify"><strong>How do you play Tic Toc Doc?</strong></p>\r\n<p align="justify">Tic toc doc is a two-player character guessing game. Each player starts with one cue card including an image and patient notes for the &ldquo;patient player&rdquo; and filing cabinet of patients notes for the &ldquo;doctor&rdquo;. The &ldquo;doctor&rdquo; player will have&nbsp; to guess which patient is &ldquo;visiting&rdquo; him/her by asking the other player his/her symptoms. There&rsquo;s a time frame of three minutes and once the buzzer sounds, the &ldquo;doctor&rdquo;&nbsp;has to pick a name from the 30 patients notes s/he has in front of him/her.</p>\r\n<p align="justify">Sound&rsquo;s simple enough?</p>\r\n<p align="justify">Great! Plus, the great news is that you might use this card game for your OET exam and your PLAB exam as well! So you hit two birds with one stone whilst having fun at the same time!</p>\r\n<p align="justify"><em><strong>So prepare yourself for an outstanding educational game for your speaking practice and the whole family!</strong></em></p>\r\n<p align="justify"><strong>Tic Toc doc will be hitting our shelves on Friday 1st June, 2018 RRP &pound;16.99 &ndash; preorder and save 20%</strong></p>\r\n<p align="justify"><em><strong>Play with us&hellip; Call 02036376722!</strong></em></p>', '', '190916102121.webp', 1, '2019-09-16 10:21:21'),
(52, 1, 'Monday to Thursday for OET City Courses', 'monday-thursday-oet-city-courses', '<p align="justify">We&rsquo;ve started&nbsp;OET courses from Monday to Thursday at our Brand New Marylebone Centre in Central London!</p>\r\n<p align="justify">You will all be glad to hear that you can now book yourself onto an Occupational English Test from Monday to Thursday&rsquo;s due to the great demand. So whether you are not available due to any work commitments or due to family arrangement or whatever it may be&hellip; not to fear and no excuses.</p>\r\n<p align="justify">OET courses will be running from Monday to Thursday <span style="text-decoration: underline;"><strong>and</strong></span> Friday to Monday at the Marylebone Centre giving you the power to schedule and juggle your carer progression and personal life with ease, taking away or at least <em>easing</em> the forever stressful balancing act. <strong>No need to thank us, we are glad to be of service</strong>.</p>\r\n<p align="justify">Our new Marylebone Centre is based in Baker Street, Central London giving our Healthcare Professionals from all over London and further afar greater accessibility in to attend and study the OET course. The brand new centre is the perfect environment to begin your path to registering with the GMC or NMC and carer in the UK. The team are friendly, helpful and eager to meet you! Anything you may need or require is <em>no more than a request away</em>.</p>\r\n<p align="justify">I10 OET is a 4&times;4 course covering Reading, Writing, Listening and Speaking skills. Our experienced tutors can help you to pass this essential exam with our short 3 week course or our longer 6 week course for those who need more help with learning and guidance in order to pass the <a href="http://www.oetdoctors.co.uk" target="_blank" rel="noopener noreferrer">OET course</a>.</p>\r\n<p align="justify">Course prices for the OET at our Marylebone Centre is &pound;577.20 for the 3 week course and &pound;1153.10 for the 6 week course. Course length will be dependent on your current English Language Level.</p>\r\n<p align="justify">Places are filling up fast! So whether you are free during the week or over the weekend we have a course intake to suit you. Here&rsquo;s to getting you on your way to be registered with the GMC or NMC.</p>\r\n<p align="justify"><strong><em>Get Monday to Thursday with us&hellip; Call 02036376722!</em></strong></p>', '', '190916101807.webp', 1, '2019-09-16 10:18:07'),
(53, 1, 'IELTS Medical on the GDPR', 'ielts-medical-gdpr', '<ul>\r\n<li><strong>By Gurjit</strong></li>\r\n</ul>\r\n<p align="justify">The General Data Protection Regulation (GDPR) will come into force this Friday&hellip; but what does this mean for you?</p>\r\n<p align="justify">The GDPR will be bringing up to speed all of the personal data laws across Europe in this ever increasing and popular digital era. The new Regulation will be boosting your rights and will give you more control over how your information is taken and handled&hellip;.the power will be in your hands. &nbsp;It will also change and enforce how businesses and organisations such as ourselves hold and use your personal information&hellip; measures will be set and they will be held to account under the GDPR.</p>\r\n<p align="justify">I am sure we have all experienced phone calls from third parties offering us some kind of service or another, or even have seen the boxes to tick or untick at the end of an application or form of some sort asking whether we will allow the company in question to share our information with other companies so we can see what they offer or to be kept updated with their offers and so on&hellip;&nbsp;Or even my personal favourite, the never ending emails that fill your inbox and take forever to delete&hellip;.. well this is what the GDPR is all about and giving us the choice about how we want our personal data used and shared.</p>\r\n<p align="justify">The types of data that fall under the GDPR are information such as your name, your photos, your email address, your social media post, your personal medical information, your bank details etc&hellip;. in other words any data that can be used to determine your identity.</p>\r\n<p align="justify">Well you will be pleased to know that&nbsp;IELTS Medical do not share your data with other organisation or third parties&hellip; so there is no need to worry about that! All of your information is kept in a safe and secure manner, complying with all of the recommended GDPR guidelines.</p>\r\n<p align="justify">So now you know your personal data online will be governed by the newly revamped data protection law, the General Data Protection Regulation, I hope you feel assured and protected with knowing that your personal data is safe with us.</p>\r\n<p align="justify"><em><strong>Keep your data safe with us&hellip; Call 02036376722!</strong></em></p>', '', '190916101657.webp', 1, '2019-09-16 10:16:57'),
(54, 1, 'OET Nursing The #Complete Guide', 'oet-nursing-complete-guide', '<p align="justify">As you already know we produced a <a href="http://www.oetdoctors.co.uk">complete medicine guide</a>&nbsp;two months ago and a <a href="http://www.oetdoctors.co.uk">writing medicine guide</a> just one month ago, because <strong>we love to help our medics to achieve their goals</strong>, and OET is one of the most popular language assessments so far.</p>\r\n<p align="justify">Recently, a high percentage of nurses and midwives have been enquiring for our intensive 4&times;4 OET course, considering that it is a great option if someone is <em>fed up with the IELTS exam</em> and wants to get their registration started. As you know, at IELTS Medical <em>there is never a dull day</em>&nbsp;and by demand, we&rsquo;ve created a bespoke OET practise book for our nurses&hellip;and guess what&hellip; <a href="http://www.oetnurses.co.uk">the OET Complete Guide for Nurses</a> is out now!</p>\r\n<p align="justify">The book is designed to help nurses and midwives&rsquo; achieve a grade B on the Occupational English Test. The book will provide an overview to the exam and will guide students through each of the four skills: Reading, Listening, Writing and Speaking. Each chapter focuses on an individual skill (Reading, Listening, Speaking and Writing) at the level that the OET requires for the candidates, providing and excellent preparation for the OET exam.</p>\r\n<p align="justify">Where can I purchase it?</p>\r\n<p align="justify">The complete nursing guide is now available in <a href="https://www.amazon.co.uk/OET-Nursing-Complete-Guide-Nurses/dp/1999593022/ref=sr_1_2?s=books&amp;ie=UTF8&amp;qid=1527066454&amp;sr=1-2&amp;keywords=oet+nursing+guide">Amazon</a> and<a href="http://www.oetnurses.co.uk"> on our website</a>.</p>\r\n<p align="justify"><em><strong>Get OET Nursing with us&hellip; Call 02036376722!</strong></em></p>', '', '190916101600.webp', 1, '2019-09-16 10:16:00'),
(55, 1, 'Doctors’ handwriting…', 'doctors-handwriting', '<ul>\r\n<li>By Elisa</li>\r\n</ul>\r\n<p>Today I am going to talk about a really serious matter:</p>\r\n<p><em><strong>Our doctors&rsquo; handwriting!</strong></em></p>\r\n<p align="justify">Is the stereotype true? Here at IELTS Medical&nbsp;we support many doctors, who have a brilliant and focused minds. The only weakness that you can find in them is when you collect the homework and you notice their handwriting&hellip; sometimes it&rsquo;s <strong>shocking</strong>.</p>\r\n<p align="justify">Long story short actually&nbsp;illegible handwriting is not the end of the world. Research suggests&nbsp;that it could mean many different things about the person&rsquo;s psychology. Individuals with<em> interesting</em> writing are usually&nbsp;independent thinkers. You will notice that the person who has a&nbsp;unusual handwriting does not always fit in with the expectations of society. &ldquo;<em>Sloppy</em>&rdquo; handwriting often goes with creativity and sometimes it can be a sign of eccentricity too.</p>\r\n<p align="justify">Going back to some of our medics we should analyse a little bit deeper the reasons behind the&nbsp;odd handwriting. Firstly, doctors have to write more than just about any other job, because in the medical field, if it&rsquo;s not documented, it didn&rsquo;t happen! So imagine long working days plus loads of writing! If doctors could spend an hour with every patient, they might be able to slow down and give their hands a rest. But the fact is, most healthcare professionals are rushing around to the next patient. For instance, one patient might have just 10/15 minutes to discuss five medical issues and ask important questions about prescriptions. With so many patients to see in a limited time, doctors&nbsp;may be more concerned with getting the information down, than perfecting their handwriting.</p>\r\n<p align="justify">Not a problem, unless&hellip; You need to take an exam! You see, if the assessor can&rsquo;t read your handwriting, they can&rsquo;t mark it and here at IELTS Medical we wouldn&rsquo;t want you to miss out on valuable marks because the assessor doesn&rsquo;t speak <em><strong>your</strong></em> language!</p>\r\n<p align="justify">Don&rsquo;t get us wrong, we&rsquo;re not trying to ask you to become master calligraphists. Here&rsquo;s an idea &ndash; what if we strike a delicate balance? How about just for the exam, you deliver the best possible handwriting you can. Then you can go back to focusing on the patient&hellip;</p>\r\n<p align="justify">Deal?</p>\r\n<p align="justify"><em><strong>Perfect your handwriting with us&hellip; Call 02036376722.</strong></em></p>', '', '190916101511.webp', 1, '2019-09-16 10:15:11'),
(56, 1, 'OET (Medicine) Speaking Guide – Book and DVD', 'oet-medicine-speaking-guide-book-dvd', '<p align="justify"><strong>OUT NOW</strong></p>\r\n<p align="justify">In order to succeed in the Speaking section of the Occupational English Test (Medicine), overseas qualified doctors need to know what the test involves and how to improve their skills to the level required by the exam. This book is a complete guide to OET Speaking (Medicine) success and it contains clear instructions and practice questions.</p>\r\n<p align="justify">The OET (Medicine) Speaking Guide is produced by IELTS Medical, a training centre for medical professionals. Our writers and editors are NHS medical and healthcare professionals, experienced in preparing overseas qualified doctors for the Occupational English Test (OET). Together we have produced an up-to-date guide on OET Speaking (Medicine) to assist doctors at the start of their OET prepartion. Our guide features:</p>\r\n<ul>\r\n<li>Key revision material on the essential facts and best practice</li>\r\n<li>Advice on how to tackle OET Speaking (Medicine).</li>\r\n<li>Model Speaking Videos</li>\r\n<li>Common errors to avoid and top tips for exam success.</li>\r\n</ul>\r\n<p>Everything has been collated to help you reach grade B and beyond in your OET Speaking (Medicine) exam.</p>\r\n<p>BONUS LINK: Online resource centre for all 4 subsections:</p>', '', '190916100017.webp', 1, '2019-09-16 10:00:17'),
(57, 1, 'OET Course Updates June 2018', 'oet-course-updates-june-2018', '<p>In line with the new version of the OET, we&rsquo;re making some changes to our OET Course.</p>\r\n<p>From 6th July, 2018 we will have two versions of our OET (Medicine) and OET (Nursing) course:</p>\r\n<p>The current i10 OET will be be known as <strong>i10 OET Countdown for which there are only&nbsp;<span style="text-decoration: underline;">2 intakes left</span>:&nbsp;</strong></p>\r\n<ul>\r\n<li>15th June, 2018</li>\r\n<li>6th July, 2018</li>\r\n</ul>\r\n<p>Once the i10 OET Countdown is done, <span style="text-decoration: underline;"><strong>we will no longer be offering courses tailored to the old version of the OET.</strong></span></p>\r\n<p>Our brand new OET courses are:</p>\r\n<ul>\r\n<li>i10 4 x 4 OET&nbsp;Refresh (Medicine II)</li>\r\n<li>i10 4 x 4 OET Refresh (Nursing II)</li>\r\n</ul>\r\n<p>Both of which will be available from <span style="text-decoration: underline;">6th July, 2018.</span></p>\r\n<p>Finally, please note that our fees will be from:</p>\r\n<ul>\r\n<li>Archway, N19: &pound;539.00 (3 weeks)</li>\r\n<li>Ilford, IG1: &pound;539.00&nbsp;&nbsp;(3 weeks)</li>\r\n<li>Marylebone, W1H: &pound;692.00&nbsp;&nbsp;(3 weeks)</li>\r\n</ul>\r\n<p>We look forward to assisting you on your journey to registration!</p>', '', '190916095854.jpeg', 1, '2019-09-16 09:58:54'),
(58, 1, 'May #OETresults are coming next Tuesday', 'may-oetresults-are-coming-next-tuesday', '<p>The May #OETresults are coming next Tuesday!</p>\r\n<p>Did that give you a shiver? Are you suddenly nervous, panicking and stressed out? Let me guess&hellip; you are probably one of the healthcare professionals who&nbsp;did last month&rsquo;s OET exam, right?</p>\r\n<p>The cure for OET exam result stress is: <strong>us</strong>&nbsp;<em>of course</em>! Just kidding&hellip;or maybe not&hellip;</p>\r\n<p>Look, I know that waiting for the exam results is as stressful as doing an exam itself. So I will give you couple of tips to get a rid of the pre-exam results anxiety:</p>\r\n<p>&bull; Try to get yourself busy:&nbsp;go for a long walk in the park, read a nice relaxing book, and go for a dinner with your friends.<br /> &bull; Talk about your concerns with your friends, family or your team at IELTS Medical. Talking&nbsp;can be&nbsp;a good way to realise your stress!<br /> &bull; Be positive, positivity is always THE solution to everything. Wear your best smile as soon as you wake up, so that you will face your day&nbsp;from a different angle.<br /> &bull; Have you got plenty of fears? Just write them down, it will make you feel better because it will make you accept them and go on with your life.</p>\r\n<p>I hope you will feel better after following these few&nbsp;tips.</p>\r\n<p>Many of our students took last month&rsquo;s exam and we can attest to the fact that you worked really hard for it! So far we had had a really high percentage of students passing their exam at the first attempt and I am really confident when I am saying that this coming Tuesday our medics wont let us down.</p>\r\n<p>We&rsquo;ve got our fingers, toes&hellip; legs&hellip; arms crossed for you!</p>\r\n<p><strong>De-stress with us&hellip; Call 02036376722!</strong></p>', '', '190916095746.webp', 1, '2019-09-16 09:57:46'),
(59, 1, 'Taste the OET with a mock for starters', 'taste-the-oet-with-a-mock-for-starters', '<p>A great way to get <strong>a real taste</strong> of how it would be like to sit the OET Exam will be is to sit the mock test. Not only will you get a feel of the real exam conditions that will take place on your big test day, but you can also gage whether or not you need more time to study or practice on a particular area.</p>\r\n<p>The OET Live Mock Test takes place twice a month at our Marylebone Centre in Central London. It&rsquo;s on the first and second Sunday of each month. The first mock test is ideal for nurses and doctors due to sit their exam that month. Whilst&nbsp;the second mock test each month is better suited to those healthcare professionals wishing to sit their exams the <em>following</em> month.</p>\r\n<p>If you are one of the healthcare professionals that are already registered with us on the OET courses we provide, the cost of the mock test is &pound;65. &nbsp;Healthcare professionals that are not registered with us can still take advantage of the opportunity to take the OET Mock Test with us for &pound;79.</p>\r\n<p>Our learners have shared with us how valuable and helpful they have found sitting the mock test in preparation for their OET exam and shared the following feedback:</p>\r\n<p>&ldquo;It&rsquo;s really what I needed.&rdquo;</p>\r\n<p>&ldquo;It was a very good way to know what I need to focus on in my revision.&rdquo;</p>\r\n<p>&ldquo;I feel much more confident now.&rdquo;</p>\r\n<p>Some have found that they required further 1 to 1 tuition on a certain subject such as reading, listening, writing and listening.</p>\r\n<p>Others found that they were ready and prepared to sit the OET exam, relieving them of the stress and pressure, and instead filling them with the confidence that the hard work that they have put in deserves.</p>\r\n<p><strong>Get #OET clarity with us&hellip; Call 02036376722!</strong></p>', '', '190916095634.webp', 1, '2019-09-16 09:56:34'),
(60, 1, 'Our in-hospital London NMC OSCE Course', 'hospital-london-nmc-osce-course', '<p align="justify">Calling all professional nurses that are looking to go register with the NMC, we have a maximum of 12 places available on our OSCE course which is starting on <strong>Thursday 14<sup>th</sup> June 2018</strong>.</p>\r\n<p align="justify">Our NMC&nbsp;OCSE&nbsp;review ranges from 3 to 5 days&nbsp;and our nurses will be given coaching, guidance and continuous feedback to help you <span style="text-decoration: underline;"><strong>pass first time</strong></span>. The course is presented with a combination of classroom and practical training.</p>\r\n<p align="justify">Day 1 and Day 2 of our NMC OSCE course you will be led by Clinical Educator and&nbsp;Registered Nurse, Claire, covering all the skills and knowledge required in a classroom setting.</p>\r\n<p align="justify">Day 3 of the course takes place <strong>within an NHS Hospital,</strong> where you will be putting all of the skills and knowledge you have learned on Day 1 and Day 2 into practice. This will give you an actual feel of what it is like to work in a hospital and it will simulate the environment of your test day. Day 3 is also when you do your OSCE Mock Test, this will let you know where you are in terms of your examination.</p>\r\n<p>How exciting does all of this sound?!</p>\r\n<p align="justify">Should you opt to take the 5 day course we provide 2 full extra days of 1 to 1 or 1 to 2 feedback and tailored training with our Clinical Educators. This will give you the opportunity to refresh on and tackle any weaknesses you may have before you take your final exam.</p>\r\n<p align="justify">Our&nbsp;team is professional, dedicated and our pass rates are high. We continue to keep in touch with you online and on Whats App, assisting you to network with trainers and fellow nurses.</p>\r\n<p><em><strong>Become a UK pin registered nurse with us&hellip; Call 02036376722!</strong></em></p>', '', '190916095530.webp', 1, '2019-09-16 09:55:30'),
(61, 1, 'Failing the NMC OSCE', 'failing-nmc-osce', '<p align="justify">If you fail the NMC OSCE exam, all is not lost. You are allowed to re-sit, however there are limits and restraints on when and how many times so do read on carefully.</p>\r\n<p align="justify">All overseas qualified nurses that wish to register with the NMC in the UK will be required to pass the NMC OSCE exam. The OSCE is a practical test you need to pass prior to registering with the NMC. Since April 2017 the registration process has changed, allowing nurses who fail their first attempt at the OSCE to re-sit the exam after a minimum wait of 10 working days. If they fail it for a second time they will have the opportunity to sit it for a third time, however this would be after a three month from date of taken wait to allow them to prepare further for the NMC OSCE exam.</p>\r\n<p align="justify">This change will be especially beneficial to those overseas qualified nurses that are on the Tier 2 visa, as it was amended to reflect the need for nurses to gain entry to the UK in order to sit the OSCE prior to employment as a nurse commencing officially. It enables pre-registration nurses to enter the UK and prepare for the OSCE, while working as pre-registration nurse for up to to three months. It coincides with the eight month time limit given by their visa to complete and pass the OCSE exam successfully.</p>\r\n<p align="justify">Do note that if on the third sitting of the OSCE exam and you unfortunately fail to pass, your application will close, and you would have to re-apply by submitting a new application form. However you will not be able to sit the OSCE exam again for a minimum of six months. Also, if you fail all of the allowed OSCE re-sits you will lose your right to remain in the UK.</p>\r\n<p align="justify">Here at IELTS Medical, we have experience dealing with nurses who have failed their NMC OSCE. In fact, our <a href="http://www.oscenurses.com" target="_blank" rel="noopener noreferrer">oscenurses </a>course allows you to work on <strong>Pure APIE</strong> or <strong>Pure Skills</strong>, if you find yourself in the unfortunate position of having partial fail (well, partial pass) and wanting an OSCE training team beside you.</p>\r\n<p><em><strong>Pass your NMC OSCE with us&hellip; Call 02036376722.</strong></em></p>', '', '190916095427.webp', 1, '2019-09-16 09:54:27'),
(62, 1, 'Electric Sharpener', 'electric-sharpener', '<p align="justify">Today I am going to talk about one of our most successful and special students, Doctor A. What was particularly memorable&nbsp;about Doctor A was her politeness, her willingness to do better, her strength and her positivity towards life&hellip; her obsession with Marylebone&rsquo;s electric sharpener. Hours to sharpen a pencil &ndash; seriously, Doctor A?</p>\r\n<p align="justify">Doctor A joined our OET 4x 4 courses for doctors three intakes ago. She chose to study at our Marylebone branch.&nbsp; Before reaching out to us, Doctor A had tried the IELTS exam so many times she&rsquo;d lost count!&nbsp;She saw the OET she saw an opportunity; an open gateway&nbsp;for her to pass though&hellip;</p>\r\n<p align="justify">On July results day, I spoke to our June entrants as I always do &ndash; because results day is always an exciting day. It&rsquo;s full of surprises and joyfulness because many of our students get their required scores on the first attempt!</p>\r\n<p align="justify">After making several calls I reached Doctor A and hearing her warming voice made it clear straight away&nbsp;that she&rsquo;d nailed the OET exam.&nbsp;She&rsquo;d managed straight Bs in all four skills &ndash; although, being the high achiever that she is, she&rsquo;d hoped for an A</p>\r\n<p align="justify">As I said before Doctor A is one of&nbsp;favourite medics, but her OET success is not the only reason&hellip; Did you know that Doctor A named our <a href="../../../have-you-heard-about-our-game/">OET Speaking game Tic Toc Doc</a>&nbsp;and all she asked for in return was our electric sharpener (<em>pictured</em>).</p>\r\n<p align="justify"><em><strong>Get sharp with us&hellip; Call 02036376722!</strong></em></p>', '', '190916094655.webp', 1, '2019-09-16 09:46:55');
INSERT INTO `blog` (`id`, `author_user_id`, `title`, `slug`, `description`, `meta_description`, `photo_image`, `user_status`, `created_date`) VALUES
(63, 1, 'City NMC OSCE at Marylebone / UCLH', 'city-nmc-osce-marylebone-uclh', '<p>It&rsquo;s that time again! The 1st of August marks our next City NMC OSCE &ndash; it&rsquo;s <a href="http://www.oscenurses.com/" target="_blank" rel="noopener noreferrer">PURE APIE</a> followed by the standard 3 and 5 day <a href="http://www.oscenurses.com/" target="_blank" rel="noopener noreferrer">NMC OSCE</a>. The course starts at our City branch in Marylebone, W1H and is followed by a session at the ward of UCLH hospital around the corner.</p>\r\n<p>You can find more information on our NMC OSCE course&nbsp;at <a href="http://www.oscenurses.com" target="_blank" rel="noopener noreferrer">www.oscenurses.com</a> but here&rsquo;s a brief recap of our successful 3-day NMC OSCE course which looks like this:</p>\r\n<ul>\r\n<li>Day 1 is classroom based and features: Basic anatomy and physiology and background; APIE (Assessment, Care Planning, Implementation and Evaluation); Documentation; News charts and Observation Charts; Common NMC Practice Scenarios.</li>\r\n<li>Day 2 is either classroom or hospital based and works on: Skills including: ANTT; Basic Life Support; Peak Flow; Removal of Foley Catheter; CSU Sample and IM Injections.</li>\r\n<li>Day 3 is always London hospital based and includes: A&nbsp;<strong>full mock NMC OSCE exam</strong>. Individual feedback.<strong><u>Extras</u></strong>\r\n<p align="justify">Pre-course pack with revision videos; NMC OSCE goodie pack on day 1; Whatsapp Support group; 2-hour 1:1 in-person or online consultation with your trainer before your exam.</p>\r\n</li>\r\n</ul>\r\n<p>Our lead OSCE trainer and Clinical Educator is really happy with the results we&rsquo;re delivering in 2018 and the post-course surveys show that our nurses are happy too.</p>\r\n<blockquote>\r\n<p>I took a 2 day bespoke course and 1 day in the June course and I found all 3 days to be incredibly useful, informative and it helped me prepare fully for the exam.</p>\r\n<p>Very informative and the environment as well as the instructors were so accomodating and supportive.</p>\r\n<p>It was brilliant, it was more like person centred care, all individuals needs were met as well as the group concerns . It was super great!</p>\r\n</blockquote>\r\n<p align="justify">We ended last year on 98% pass and this year is turning out&nbsp;brilliantly too!</p>\r\n<p><em><strong>Pass your NMC OSCE with us&hellip; Call 02036376722!</strong></em></p>', '', '190916094533.webp', 1, '2019-09-16 09:45:33'),
(64, 1, 'New 2.0 Listening Material Each Week Until Christmas', 'new-2-0-listening-material-each-week-until-christmas', '<p>As with any examination, the OET exam requires consistent practice.<br /> With the majority of our medics planning to attempt (or re-attempt) their OET examination before the end of 2018, we&rsquo;re releasing exclusive OET Listening content each week until Christmas on our <a href="https://www.youtube.com/channel/UCpfFmzYaKPUae1sxKCm5p3A" target="_blank" rel="noopener noreferrer">Youtube channel here</a>.<br /> The audio is accessible via Youtube and via our tailor made Learning Portal, which you can find at <a href="http://learn.ieltsmedical.org" target="_blank" rel="noopener noreferrer">learn.ieltsmedical.org</a>. Medics on our courses are provided with access on registration, but we&rsquo;ve now extended our materials to our guest learners too (just choose Guest Login).</p>', '', '190916094041.webp', 1, '2019-09-16 09:40:41'),
(65, 1, 'Getting Ready For An NMC OSCE First Time Pass', 'getting-ready-nmc-osce-first-time-pass', '<p align="justify">The above image is a photo of our Whatsapp group (+447598311788) where our Lead OSCE Trainer Claire assisted not one&hellip; not two&hellip; but SIX out of SIX nurses to <strong>first time NMC OSCE success</strong>.</p>\r\n<p align="justify">As you know, UK registration for international nurses requires passing the NMC OSCE&nbsp;and its purpose is to satisfy UK pre-registration standards. This includes testing nurses on their communication and clinical skills. Successful nurses will have to satisfy OSCE examiners that they can make sound clinical decisions under pressure, across six stations. They will have 15 minutes at each station to deal with APIE and Nursing Skills using practical application of their theoretical nursing knowledge.</p>\r\n<p align="justify">It is important to realise that to pass this exam, the first time you come across these or similar scenarios cannot be <span style="text-decoration: underline;">at your test</span>.</p>\r\n<p align="justify">Here at IELTS Medical we provide an <a href="http://www.oscenurses.com" target="_blank" rel="noopener noreferrer"><strong>excellent OSCE preparation course</strong></a>&nbsp;that is Clinical Educator led. Our&nbsp;Lead OSCE trainer, Claire, is dedicated, experienced&nbsp;and successful.&nbsp;We have OSCE training at least once a month in North and Central London. To find out when our next OSCE coaching will take place, visit <a href="http://www.oscenurses.com" target="_blank" rel="noopener noreferrer">OSCE Nurses</a> or our <a href="https://www.eventbrite.co.uk/o/oet-and-nmc-osce-by-ielts-medical-12783634397" target="_blank" rel="noopener noreferrer">Eventbrite</a> page.</p>\r\n<p align="justify">Working in small groups, our nurses will receive coaching and guidance to help you pass the OSCE first time. We simulate a clinical environment, presenting you with scenarios that you will likely encounter as a Registered Nurse. At the end of the course you will be invited to sit a mock examination that is assessed.</p>\r\n<p align="justify">Claire leads our professional OSCE training team who have high standards and maintain a high (98% in 2017 and currently&nbsp;similar in 2018) pass rate. All of our trainers are registered NHS nurses and enjoy guiding our nurses to OSCE success. If you&rsquo;re ready to pass your OSCE, reach out.</p>\r\n<p>Pass your NMC OSCE with us&hellip; Call 02036376722!</p>', '', '190916093911.webp', 1, '2019-09-16 09:39:11'),
(66, 1, 'OET Remedy', 'oet-remedy', '', '', '190916093515.webp', 1, '2019-09-16 09:35:15'),
(67, 1, 'World Cup Update', 'world-cup-update', '<p>With every #IELTS , #OET , #PLAB1 , #PLAB2 , #CBT or #OSCE result comes the responsibility that our medics face to declare which country they are representing in the IELTS Medical World Cup. With this prestige comes bragging rights for one year for the medics from the winning country. Last year&rsquo;s winners were Pakistan whose players dominated almost every examination. This year, with the #OET heatwave, challengers from other countries are emerging victorious. Take the Philippines, for example. Despite not qualifying onto the top ten leaderboard last year, they&rsquo;ve inched to the top of the IELTS Medical World cup with 1st time #OET and #NMCOSCE scores the source of a concerted push to the peak.</p>\r\n<p>With only two months left of the year, and plenty of opportunities in all six examinations, there&rsquo;s still all to play for. Today saw entries from challengers representing #India, #Nigeria, #Romania, #Pakistan and #Spain&hellip; #StayTuned.</p>\r\n<p>Represent your country with us&hellip; Call 02036376722!</p>', '', '190916093410.webp', 1, '2019-09-16 09:34:10'),
(68, 1, 'OET 2.0 Listening Part B – Vet Consultation', 'oet-2-0-listening-part-b-vet-consultation', '<p>Visit learn.ieltsmedical.org and select Guest Login for the questions and answers. OET 2.0 Listening practice delivered to you each week until Christmas from a UK (London) based OET training centre. Remember to LIKE, SHARE and SUBSCRIBE for fresh OET 2.0 content.</p>', '', '190916093312.webp', 1, '2019-09-16 09:33:12'),
(69, 1, 'BREAKING NEWS: Green Light For Lowered IELTS Writing Score', 'breaking-news-green-light-for-lowered-ielts-writing-score', '<p align="justify">Following our&nbsp;update via&nbsp;<a href="https://www.facebook.com/IELTSMedicalLondon/" target="_blank" rel="noopener noreferrer">Facebook</a>&nbsp;last week, we&rsquo;re delighted to update that the <a href="https://www.nmc.org.uk/news/news-and-updates/change-to-english-language-requirements-for-nurses-and-midwives-get-green-light/?fbclid=IwAR2DckYolQ4mAya_9gnpuQ1LtQuwNlGJULwEQgdqddAifq3tqgDvpJ-0iHc" target="_blank" rel="noopener noreferrer">NMC have followed through</a> on stakeholder recommendations to accept a 6.5&nbsp;score for IELTS Writing as part of their English language requirements.</p>\r\n<p align="justify">From <strong>5th December 2018</strong>, nurses with a score of 6.5 in IELTS writing, but an overall score of 7.0 and above, will be permitted to&nbsp;proceed past the English language stage of NMC registration.</p>\r\n<p align="justify">EU and Overseas qualified nurses will still need to achieve an <strong>overall</strong> score of 7.0 in the Academic version of the IELTS examination. Along with a <strong>7.0 in the Listening, Reading and Speaking</strong> subtests. However, having met a lot of talented nurses who were held back by the previous IELTS Writing requirement, this is certainly a welcomed development.</p>\r\n<p align="justify">Certificates which are within 2 years of 5th December 2018 will be considered by the regulator, meaning that nurses who were previously prevented from moving past this stage will now become eligible to register or to proceed to either their <a href="http://www.cbtnurses.com" target="_blank" rel="noopener noreferrer">NMC CBT</a> or <a href="http://www.oscenurses.com" target="_blank" rel="noopener noreferrer">NMC OSCE</a> examination.</p>\r\n<p align="justify">Since the announcement yesterday, we&rsquo;ve spoken to some of our nurses and clarified that there is&nbsp;<em>currently</em>&nbsp;no change to the NMC&rsquo;s OET requirements (B-B-B-B in all 4 sections across a maximum of 2 sittings with no score below C+). The OET have, however, stated that they are in constant communication with the nursing regulator regarding their requirements.</p>\r\n<p align="justify">The choice between the two examinations is yours and here at IELTS Medical, we&rsquo;re happy to provide guidance to help you make an informed choice between the IELTS or OET.</p>\r\n<p>&nbsp;<em><strong>Get registered with us&hellip; Call 02036376722!</strong></em></p>', '', '190916093157.jpeg', 1, '2019-09-16 09:31:57'),
(70, 1, 'Wishing You A Merry Christmas, Happy Holidays and An Amazing 2019', 'wishing-merry-christmas-happy-holidays-amazing-2019', '<p align="justify"><strong>What an amazing year 2018 has been. </strong></p>\r\n<p align="justify">Surpassing our efforts in 2017, we&rsquo;ve seen even more dentists, nurses and doctors through the IELTS and OET respectively. We&rsquo;ve also delivered outstanding NMC CBT and OSCE courses and cheered when yet another one of our nurses received their #PininthePost. We&rsquo;ve facilitated introductions for some of&nbsp;you to NHS hospitals and Private Clinics and welcomed more language experts, senior registered nurses and practising medical doctors to the cause. We&rsquo;ve released not one&hellip; not two&hellip; but eight publications in our fields, with more planned for the first half of 2019.</p>\r\n<p align="justify">We really have met brilliant practitioners and like to think that we&rsquo;ve been a positive part of their journey towards what we hope will be exciting and fulfilling careers.</p>\r\n<p align="justify">Medics, it&rsquo;s been an absolute pleasure to&nbsp;welcome you to London and to the UK. We look forward to seeing you all in 2019!</p>\r\n<p align="justify"><strong>As always&hellip; To your success.</strong></p>', '', '190916093008.webp', 1, '2019-09-16 09:30:08'),
(71, 1, 'New GMC Welcome to UK Practice Courses for Doctors', 'new-gmc-welcome-uk-practice-courses-doctors', '<p align="justify">Like us, the GMC know how tough it is for overseas qualified applicants who will be working in a new country, often with a completely different healthcare system. When added to any language and/or cultural barriers, it can be overwhelming for our medical practitioners.</p>\r\n<p align="justify">An extract from an account by Dr Sutapa Biswas, Consultant Neurophysiologist at Chelsea and Westminster Hospital NHS Foundation Trust reads:</p>\r\n<blockquote>\r\n<p>I arrived alone in London, in an oversized purple coat on a drizzly spring morning. The weather brightened and my hopes of a life in UK soared; the purple coat (once lovingly chosen for its bright colour) became a tad unnecessary and eventually landed up (oversized as it was, I lost some more weight in London) in a charity shop.</p>\r\n</blockquote>\r\n<p>&hellip; <a href="https://gmcuk.wordpress.com/2018/08/29/welcoming-doctors-to-uk-practice/" target="_blank" rel="noopener noreferrer">For the full story click here</a>.</p>\r\n<p align="justify">Our medics here have similar stories. Some have left similar hospitals in other English speaking countries, but some have left war torn nations and are working diligently to earn their licence to practice medicine again. The GMC&rsquo;s free workshop, Welcome to UK Practice, support doctors with the transition to UK working life. From their offices in London, Belfast, Cardiff, Edinburgh and Manchester and attendees can expect to meet other doctors, discuss their experiences and most importantly, common ethical scenarios they are likely to encounter whilst working.</p>\r\n<p><a href="https://www.smartsurvey.co.uk/s/BookGMCWelcome/" target="_blank" rel="noopener noreferrer">Click here to book your place today</a>.</p>\r\n<p>Start planning with us &hellip; Call 020236376722!</p>', '', '190916092841.webp', 1, '2019-09-16 09:28:41'),
(72, 1, 'Spotlight on: OET Listening Guide Volume II Book for Occupational English Test', 'spotlight-oet-listening-guide-volume-ii-book-occupational-english-test', '<p align="justify">The Listening section of the Occupational English Test features 3 parts of sets of listening audio. Part A is a pair healthcare professional &ndash; patient consultation that requires an ability to listen for detail. Part B is a set of six multiple choice questions featuring an approximately 1 minute long audio that requires you to choose one answer from three possible choices. Finally, part C is also a set of six multiple choice questions that accompany a longer mono or dialogue.</p>\r\n<p align="justify">Here are IELTS Medical, we think that the best way to concur this test is to learn a particular technique, stick with in and practice. This guide is the perfect way to start your journey to a B and beyond for the OET Listening.</p>\r\n<p align="justify">Listen the OET way with us&hellip; Call 02036376722!</p>', '', '190916092649.webp', 1, '2019-09-16 09:26:49'),
(73, 1, 'Breaking News: Oetonline.net launched – grab a seat', 'breaking-news-oetonline-net-launched-grab-seat', '<p>We&rsquo;re delighted to introduce OET Online Courses and Classes for Doctors and Nurses. Led by a native OET instructor, medics meet either from 10:00 &ndash; 12:45 or 18:30 &ndash; 20:45 GMT. With courses that focus on all 4 skills (Listening; Reading; Speaking and Writing), attendees can look forward to an impactful course that is sure to help their OET preparation.</p>\r\n<p>Prospective medics can grab an empty seat and register themselves on the next upcoming course for live preparation each week.</p>\r\n<p>Wherever you are in the world, prepare with us&hellip; Call 0203 637 6722!</p>', '', '190916092542.webp', 1, '2019-09-16 09:25:42'),
(74, 1, 'NMC CBT UK Reviews – 4 Day London Course', 'nmc-cbt-uk-reviews-4-day-london-course', '<p>We&rsquo;re super excited to kick off 2019 with our 4-Day CBT Courses. Designed for nurses, by Senior Registered NHS nurses, the review provides a refresher on each of the professional domains and includes comprehensive instruction on the nursing blue print and drug calculations.</p>\r\n<p>The comprehensive <a href="http://www.cbtnurses.com"><strong>NMC CBT Core Course</strong></a> covers topics across the NMC CBT including:</p>\r\n<ul>\r\n<li>The Nursing Blue Print</li>\r\n<li>Infection Control</li>\r\n<li>Drug Calculation for Syringe Pumps and Infusion ?</li>\r\n<li>Domain 1: Professional values</li>\r\n<li>Domain 2: Communication and interpersonal skills</li>\r\n<li>Domain 3: Nursing practice and decision-making</li>\r\n<li>Domain 4: Leadership, management and team working</li>\r\n</ul>\r\n<p>Plus all of our learners will have the opportunity to be entered into a CBT Mock examination against the clock.</p>\r\n<p>Courses start from &pound;150.48&nbsp;all inclusive of course materials and practice questions.</p>\r\n<p><em><strong>Pass your CBT with us&hellip; Call 0203 637 6722!</strong></em></p>', '', '190916092435.webp', 1, '2019-09-16 09:24:35'),
(75, 1, 'Is this the first iPhone and Android OET Speaking App?', 'first-iphone-android-oet-speaking-app', '<p>Could this be the <strong><em>first</em></strong> Occupational English Test iPhone and Android Speaking App? Within 48 hours, our<strong> brand new OET Speaking Game Tic Toc Doc</strong> will be on the iPhone app store. Its debut on the Android platform will follow shortly afterwards. Combining OET Speaking 2.0 elements into a fun game, we&rsquo;ve brought you a game that connects you to OET test takers <strong>and</strong> Native English Speakers around the world.</p>\r\n<p>Introducing Tic Toc Doc, the world&rsquo;s first Occupational English Test application &hellip;. (we think!)</p>\r\n<p><strong>It&rsquo;s really easy to play: </strong></p>\r\n<ol>\r\n<li>Log on or Register.</li>\r\n<li>Pick your speaking partner.</li>\r\n<li>Receive handy OET type questions to ask your patient.</li>\r\n<li>Then both of you take turns speaking against the clock whilst the doctor analyses the patient&rsquo;s case and tries to guess their Patient&rsquo;s character.</li>\r\n<li>The first to reach five points in the game &ndash; wins!</li>\r\n</ol>\r\n<p>Here&rsquo;s Lokesh and Christina giving it a go&hellip;</p>\r\n<p>https://www.youtube.com/watch?enablejsapi=1&amp;amp;autoplay=0&amp;amp;cc_load_policy=0&amp;amp;iv_load_policy=1&amp;amp;loop=0&amp;amp;modestbranding=0&amp;amp;rel=0&amp;amp;fs=1&amp;amp;playsinline=0&amp;amp;autohide=2&amp;amp;theme=dark&amp;amp;color=red&amp;amp;controls=1&amp;amp;" class="__youtube_prefs__" title="YouTube player" allow="autoplay; encrypted-media" allowfullscreen data-no-lazy="1" data-skipgform_ajax_framebjll=""&amp;gt;</p>\r\n<p>The app debut is set for <span style="text-decoration: underline;">2nd February, 2019</span> and we&rsquo;re <strong>SUPER</strong> excited&hellip; Are you excited too?</p>\r\n<p><em><strong>Get OET Speaking with us&hellip; Call 02036376722!</strong></em></p>', '', '190916092326.webp', 1, '2019-09-16 09:23:26'),
(76, 1, 'My husband had enrolled and he has passed in first attempt..', 'husband-enrolled-passed-first-attempt', '<div id="js_f5" class="_5pbx userContent _3576" data-ft="{&quot;tn&quot;:&quot;K&quot;}">\r\n<p>When Dr G&rsquo;s wife reached out to us in December 2018, her husband was at wits end with the IELTS exam. Having taken the IELTS twice, he was totally frustrated with the examination and keen for another solution. Dr G&rsquo;s wife had heard of the Occupational English Test, but wasn&rsquo;t sure on which provider would be the best for her husband. Having seen <a href="http://oetdoctors.co.uk" target="_blank" rel="noopener noreferrer">IELTS Medical&rsquo;s OET Course for Doctors</a> online, she reached out to enquire as to whether we had a venue in Newcastle&hellip;. We don&rsquo;t, but we<em><strong> do</strong> </em>have <a href="http://oetonline.net" target="_blank" rel="noopener noreferrer">oetonline.net</a>. Dr G took a seat and connected with our highly recommended OET tutor Janet three times a week until the day before his examination. Today, our Whatsapp rung cheerily with a message from Dr G&rsquo;s wife. She said:</p>\r\n<blockquote>\r\n<p>Many many thanks to this course&hellip; My husband had enrolled and he has passed in first attempt&hellip; Thanks a lot</p>\r\n</blockquote>\r\n<p><strong>Well, Dr G didn&rsquo;t just &ldquo;pass&rdquo; he scored: A-B-B-B. </strong></p>\r\n<p>If we can assist you with your OET, visit&nbsp;<a href="https://l.facebook.com/l.php?u=http%3A%2F%2Fwww.oetonline.net%2F%3Ffbclid%3DIwAR0R6posiqyaCr26rlsolWJbwuulCZsJ0N8yxVuzXhFID4No8Qe99jLWzT0&amp;h=AT1O0nC2pMDxUDpmUmEkCQjnWnxoQ2hQZyyuVFdnujKJqkFZXHOD2vWGXZA9bB8kkWPF38oaPi8xOTtjt2AZ-h6SqYCk6EaQmSWH-wrEQDoCcb6TLiyT5R4H2_4euVHcx0Elrf04dFKYxXykMGNO-BS73Q_3LYnBNkShkjc4JZdEPJ_1Uj2pkmxYQT778-fXHfaXyvC9CEouLrwHr8NYQHIhRpTvnau7VqBQwUbyWVwiVJxZi5C-dUAbaXUqoMH9eqttZFYti5Y0G9EKO30hRmgr95trxvzZeFaXzwj5iV-B51idHUwUNshdS4WjEXl__KboNo7cvJaLebzDUDpwXPJ7cZwD1H_Jgg696c-DlEUHXvOKKlHdCmkpOEz0xRiwK5hZbQ3WR4VeZ9S_tZLbtqFizIgycmMSwEwwwQju0WRwYmQ_p6FLcj8S2gJTHknINIlWBTfJth4tkulALzq9tyzQl-q115U2tBIb8HBfOxyTFGjRG5LuFRjguUY3zczuZrHkzuEht-P2BJixjVA4jI2U1juTmOTRDCFzFGaCHf9zbpv6FTk_IG5-03JrEFb-ZfAzGs_PE_hbYyOkdpjbBZo2jezT42AIG2o0qaqWwqZsaiPVcE7h4-POOHond2rd0jiqJLNDsd1X1TomKfHXe5B0BphdmHdgLt2NK-s6uwRS1rMiueBIqYs6HaZXil1zTcvvq9Xlr7Hohje-iSMhdj2Tv2UCXurY68VBXx306kqljPAn-zxMnGg" target="_blank" rel="nofollow noopener noreferrer" data-ft="{&quot;tn&quot;:&quot;-U&quot;}" data-lynx-mode="async">www.oetonline.net</a>&nbsp;today.</p>\r\n<p><em><strong>Jump online with us&hellip; Call 02036376722!</strong></em></p>\r\n</div>', '', '190916092046.webp', 1, '2019-09-16 09:20:46'),
(77, 1, 'Medically trained patients on our NMC OSCE course?', 'medically-trained-patients-nmc-osce-course', '<p>We&rsquo;re always excited to see our doctors and even more so when they <span style="text-decoration: underline;"><em><strong>volunteer</strong></em></span> to play patients&nbsp;during our <a href="http://www.oscenurses.com">NMC OSCE</a> scenarios. You see, our <a href="http://www.oscenurses.com">OSCE course</a> is always led by Senior Registered Nurses and our <a href="http://www.oscenurses.com">OSCE nurses</a> are always delighted to use the Laerdal Anne or Sim Man dummies that are always ready, willing and able patients. However, it&rsquo;s always nice to have a <strong>live</strong> (and rather unpredictable</p>\r\n<p align="justify">patient there in person (just like in the examination) &ndash; and it&rsquo;s even better when they&rsquo;re medically trained! Our February nurses were in for a treat when Dr. D made a Special Guest appearance starring as <a href="http://www.oscenurses.com">OSCE</a> patient. From Shortness of Breath to Bowel issues, Dr. D&rsquo;s portrayals made what was a &ldquo;wonderful&rdquo; day, <strong><em>even better</em></strong>.</p>\r\n<p align="justify">Thank you Dr. D and who knows, <em>you</em> may get to meet a medically trained patient on your next <a href="http://www.oscenurses.com">NMC OSCE</a> course on 4th March, 2019.</p>\r\n<p align="justify"><em><strong>Enjoy special guests with us&hellip; Call 02036376722!</strong></em></p>', '', '190916091942.webp', 1, '2019-09-16 09:19:42'),
(78, 1, 'OET 2.0 Listening Part C Practice Test – Dr Charles Firth – Depression and Physical Activity', 'oet-2-0-listening-part-c-practice-test-dr-charles-firth-depression-physical-activity', '', '', '190916091707.jpeg', 1, '2019-09-16 09:17:07'),
(79, 1, 'Occupational English Test (OET) Open Day for Doctors and Nurses – London Training Centre', 'occupational-english-test-oet-open-day-for-doctors-and-nurses-london-training-centre', '<p align="justify">Since its relatively recent acceptance by the NMC and GMC, the Occupational English Test is quickly becoming the English language proficiency exam of choice for healthcare professionals all over the world. Candidates cite the examination&rsquo;s healthcare focus as a strong reason for their preference, and our open day promises to introduce you to other reasons why the OET could be the best choice for you too. The morning is led by a native OET trained tutor and it will provide a whistle stop tour through each of the four skills, as well as the opportunity to give it a go for yourself and receive an idea of your current language level.</p>\r\n<p align="justify">The best part of the whole thing? It&rsquo;s FREE! That&rsquo;s right &ndash; you&rsquo;ll have the opportunity to satisfy your curiosity about the Occupational English Test on us, as well as a surprise treat for you on the day too.</p>\r\n<p>What&rsquo;s the catch, I hear you ask?</p>\r\n<p>Well,&nbsp;<em><strong>only 20 candidates will be admitted</strong></em>, so register early to avoid disappointment.</p>\r\n<p align="justify">Have a glimpse into our previous open day and a little word from one of our OET patients, Melissa: https://youtu.be/RUrkBtDh0C0</p>\r\n<p>To register your space or for more information, call 02036376722.</p>', '', '190916091548.webp', 1, '2019-09-16 09:15:48'),
(80, 1, '5 star feedback for our NMC OSCE Training', 'nmc-osce-training', '<p>It&rsquo;s always incredible when our nurses are here for the NMC OSCE 3 or 5 day course. As their final stage before the NMC registration, the stakes are high meaning that an effective OSCE course is a must. Our NMC OSCE course is delivered over 3 or 5 days and is based on the NMC criteria. We deliver the programme in three coordinated stages where Day 1 consists of APIE and Day 2 consists on a focus on NMC OSCE Skills. The pi&egrave;ce de r&eacute;sistance is saved for Day 3 where we stage an NMC Mock Examination on the ward. For nurses who would like to work on any areas of weakness, identified by the Mock Examination, our 5-day option allows you to do just that. Training in pairs with our Clinical Educator, you will be given the opportunity and support to consolidate your knowledge and prepare for first time NMC OSCE success.<br /> We have a 98% first time pass rate and a 100% second time pass rate for our NMC OSCE course, making this an incredibly successful 3 or 5 days.<br /> <strong><br /> <em>Get ready to pass your NMC OSCE with us&hellip; <a href="http://www.oscenurses.com" target="_blank" rel="noopener noreferrer">Book online</a> or call 0203 637 6722!</em></strong></p>', '', '190916091418.webp', 1, '2019-09-16 09:14:18'),
(81, 1, 'IELTS Survivor to OET Champion', 'oet-results', '<div>\r\n<p align="justify"><span style="font-size: 18px;">The bright smile of Nurse N first lit up the IELTS Medical centre in early 2017, when she came to us for assistance with her IELTS examination. She had studied her nursing degree in English, but the NMC required proof of her English language proficiency. Nurse N attempted the IELTS several times, scoring admirable results in her Listening, Speaking and Writing. Unfortunately, scoring 6.0 in her&nbsp;Reading held her back. Imagine Nurse N&rsquo;s elation when we called her in November 2017 to let her know about the OET&rsquo;s acceptance by the NMC. As&nbsp;the mother of two young children, Nurse N had to combine study of the new examination with the childcare of her little ones. It was a challenge, but she skilfully managed it through our <a href="http://www.oetnurses.co.uk" target="_blank" rel="noopener noreferrer">OET course</a>&nbsp;and took her OET examination on completion. Imagine our surprise, when she scored B-B-B in Speaking, Listening and <em><span style="text-decoration: underline;"><strong>Reading</strong></span></em>&hellip; but a <strong><em>C in Writing</em></strong>! The cruel irony wasn&rsquo;t lost on Nurse N, who called the centre&nbsp;to book Pass Guarantee** lessons for her OET Writing&hellip; Her final OET exam was shortly after this and she scored &hellip; well&hellip; take a look&hellip;</span></p>\r\n<p><span style="font-size: 18px;"><strong>&lt;&lt;&lt;&nbsp;</strong></span></p>\r\n<p align="justify"><span style="font-size: 18px;">You can switch from IELTS to OET with us&hellip; Call 02036376722!</span><br /> <span style="font-size: 18px;"> (<em>** We can guarantee your OET scores when you book with us &ndash; Terms Apply</em>)</span></p>\r\n</div>', '', '190916091307.webp', 1, '2019-09-16 09:13:07'),
(82, 1, 'OET Reading Part B teaser…', 'oet-reading-part-b', '<p>Try this OET Reading Part B question and let us know how you did&hellip;</p>\r\n<p>MEMO: To all (ward B)</p>\r\n<p>This email follows a recent spate of complaints from relatives of service users. As you may know, such complaints are rarely routed to the correct department &ndash; Patients Advice and Liaisons Service &ndash; and are instead routed to department heads. As I am sure you can imagine, these departments are likely to be understaffed and busy. From the correspondence we have seen recently, these complaints could have been avoided with a little more attention from the members of staff concerned.</p>\r\n<p>As a nurse working on our wards, it is important to remember that our duty to patients extends to their next of kin and carers. Time spent engaging with them, even over the most minor of issues, is likely to be incredibly beneficial and may ultimately prevent impending complaints. The aim of this time spent may include, for example, providing explanations that remove any doubt or ambiguity or explanations of next steps.</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>The purpose of this memo is to advise nurses of the need to:-</li>\r\n</ol>\r\n<p>?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Engage with patient&rsquo;s relatives and carers<br /> ?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Understand that relatively trivial matters may cause complaints<br /> ?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ensure that explanations are delivered slowly and clearly<br /> You can practice more OET Reading at <a href="http://learn.ieltsmedical.org" target="_blank" rel="noopener noreferrer">learn.ieltsmedical.org</a>&hellip; Or for more OET Reading Practice, take a look at our <a href="https://www.google.com/url?sa=i&amp;source=images&amp;cd=&amp;cad=rja&amp;uact=8&amp;ved=2ahUKEwj4qo7cnoLhAhWCx4UKHWhsAEEQjxx6BAgBEAI&amp;url=https%3A%2F%2Fieltsmedical.co.uk%2Fshop%2Foet-medicine-reading-guide-refresh-2-0-book%2F&amp;psig=AOvVaw0Yo-Q78Mfrnz_LdAIA_vVQ&amp;ust=1552673745879723" target="_blank" rel="noopener noreferrer">OET Reading Guide here</a>&hellip;</p>', '', '190916091147.webp', 1, '2019-09-16 09:11:47'),
(83, 1, 'Intensive OET Preparation Course', 'oet-preparation-course-intensive', '<p><span style="text-decoration: underline;"><strong>Effective OET Preparation Course &ndash; Intensive Course</strong></span></p>\r\n<p>The Occupational English Test (OET)&nbsp;is an English test for healthcare professionals that can be used as an alternative to IELTS to satisfy the English language requirements of the GMC or NMC for doctors and nurses &amp; midwives respectively. Doctors and nurses require a grade B (equivalent to IELTS 7.0 &ndash; 7.5 or CEFR C1) in order to register.</p>\r\n<p><span style="text-decoration: underline;"><strong>Our Intensive Course</strong></span></p>\r\n<p>Our most intensive course includes all four skills &ndash; OET Listening; OET Reading; OET Speaking and OET Writing &ndash; and features one of the largest collections of OET materials in the UK. The course includes intensive study of the medical English that you need to be successful in your OET examination.&nbsp;Your study options are:</p>\r\n<ul>\r\n<li style="list-style-type: none;">\r\n<ul>\r\n<li>10am to 3pm from Monday to Thursday</li>\r\n<li>10am to 3pm from Friday to Monday</li>\r\n<li>5pm to 8:30pm on Friday and Monday plus 10am to 3pm on Saturday and Sunday.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>We ensure to provide you with tips and strategies in order to develop your skills to make sure that you are able to tackle each aspect of the examination. We also provide you with full exam practice.</p>\r\n<p>&nbsp;</p>\r\n<p>Plus: IELTS Medical London is part of the OET Preparation Provider&rsquo;s Programme, which provides us with up-to-date communications directly from the OET, meaning that the courses we deliver are directly informed by the organisation themselves.</p>\r\n<p><span style="text-decoration: underline;"><strong>Testimonials</strong></span></p>\r\n<p><span style="text-decoration: underline;"><strong>Course details</strong></span></p>\r\n<p><span style="font-size: 18px;">English level required: Minimum B2 (or recent IELTS achievement of 6.0 &ndash; 6.5)</span><br /> <span style="font-size: 18px;"> Course length: 3 weeks</span><br /> <span style="font-size: 18px;"> Maximum class size:&nbsp;8</span><br /> <span style="font-size: 18px;"> Hours per week: 16 hours</span><br /> <span style="font-size: 18px;"> Course fee: &pound;692 (including registration and materials)</span><br /> <span style="font-size: 18px;"> Location: IELTS Medical&nbsp;London &ndash; 22-25 Portman Close, Marylebone, London, W1H 6BS</span></p>\r\n<p><span style="text-decoration: underline;"><strong>Book this course</strong></span></p>\r\n<p><span style="text-decoration: underline;"><strong>Alternatively, you can choose:<br /> </strong></span><span style="font-size: 20px;"><a href="http://www.oetdoctors.co.uk" target="_blank" rel="noopener noreferrer">Online for Doctors</a></span><br /> <span style="font-size: 20px;"><a href="http://www.oetnurses.co.uk" target="_blank" rel="noopener noreferrer">Online for Nurses</a></span><br /> <span style="font-size: 16px;"><strong>By Phone: 0203 637 6722 (International: +44203 637 6722)</strong></span></p>', '', '190916091034.webp', 1, '2019-09-16 09:10:34'),
(84, 1, 'OET Revision Course', 'oet-revision-course', '<ul>\r\n<li><strong>By Reshawn</strong></li>\r\n</ul>\r\n<p align="justify">The OET Revision Course is a great way for you to reassure yourself that you&rsquo;ve got all the tools you need to confidently pass your OET examination. Happening at our Central London, Marylebone branch,&nbsp;the course is easily accessible by almost any mode of transport (eg. a mere five minute walk from Marble Arch and ten from Baker Street). As you would expect, the course covers all of the fundamentals you need to pass the OET and to do so well. It is engineered in such a way that equal time is devoted to each part of the exam, ensuring full understanding and feedback. These sub-courses, as you may already know, include OET Reading, OET Writing, OET Listening and OET Speaking. During each session, we boost your learning and refresh the strategies you need to succeed. Plus, our course is taught by OET trained native UK tutors.&nbsp;Revision coursebooks are provided at the start of the course so that you can follow the instructor and practice at home. You will also receive access to our Virtual Learning Environment (or VLE) at <a href="http://learn.ieltsmedical.org" target="_blank" rel="noopener noreferrer">learn.ieltsmedical.org</a> so that you can practice OET exam type questions against the clock.&nbsp;&nbsp;Full and detailed solutions are provided during the contact hours along with explanations from our staff of well trained instructors. These courses run either from 15:30 to 17:30 or from 18:00 to 20:00 at 22-25 Portman Close.</p>\r\n<blockquote>\r\n<p align="justify">Revising in groups is a rewarding experience. You can reach out to new OET speaking partners and you can rest assured that the other healthcare professionals on the course are just as motivated as you are. Such a refreshing boost, right before the real examination, is a great idea to supplement your extensive investment in your OET studies.</p>\r\n</blockquote>\r\n<p align="justify">Please note that only upper intermediate learners with an IELTS equivalent of 6.0 &ndash; 6.5 and above will be admitted to the revision week before the may examination.</p>\r\n<p align="justify"><em><strong>Revise OET with us&hellip; Call 02036376722.</strong></em></p>', '', '190916065224.webp', 1, '2019-09-16 06:52:24'),
(85, 1, 'OET NEWS Gwen’s Gift for April OET Courses', 'oet-news-gwens-gift-april-oet-courses', '<p>Throughout the month of March, our OET tutor Gwen has been refreshing her teaching skills and she&rsquo;s due to return, all bright eyed and bushy tailed. To celebrate, we&rsquo;d like to give you Gwen&rsquo;s Gift which is 29% off our signature IN PERSON 3-week Central London OET (Medicine) 25 hours a week course. This applies for either:<br /> Friday &ndash; Monday course 5th &ndash; 22nd April, 2019<br /> Monday &ndash; Thursday course 8th &ndash; 25th April, 2019<br /> Is &pound;494<br /> Call us today on 02036376722 quoting &ldquo;Gwen&rsquo;s Gift&rdquo;</p>', '', '190916065132.webp', 1, '2019-09-16 06:51:32'),
(86, 1, 'The UK’s Largest Nursing and Midwifery Job Fair – Next Saturday – Portman Square', 'uks-largest-nursing-midwifery-job-fair-next-saturday-portman-square', '<p align="justify">It&rsquo;s the UK&rsquo;s largest job fair for nurses and midwives in the UK and it&rsquo;s taking place next Saturday <strong><em>less than 2 minutes walk from the IELTS Medical centre</em></strong>. Job fairs are a great opportunity to meet employers directly. Employers such as&nbsp;Great Ormond Street Hospital for Children; East London NHS foundation trust;&nbsp;East Kent Hospitals University&nbsp;NHS&nbsp;Foundation Trust; Medway NHS Trust; Lewisham and Greenwich NHS Trust; South West London and St Georges and other Public and Private Hospitals, plus Nursing and Care Homes too. Employers will be holding interviews on the day for all grades including newly qualified nurses and midwives.</p>\r\n<p align="justify"><span style="text-decoration: underline;">Nursing specialties advertised at the job fair</span></p>\r\n<p align="justify">Accident and Emergency (A&amp;E), Acute Internal Medicine, Adult, Allergy, Anaesthesia, Cardiology, Cardiothoracic Surgery, Care Home, Children&rsquo;s, Child and Adolescent Mental Health Services (CAMHS), Community, Clinical Genetics, Clinical Oncology, Clinical Radiology, Dermatology, Diabetes, Emergency Department (ED), Emergency Medicine, Endocrinology, Endoscopy, Gastroenterology, General Internal Medicine, General Practice, General Psychiatry, General Surgery, Geriatric Medicine, Haematology, Histopathology, Intellectual Disability Psychiatry, ICU, Intensive Care Medicine, Immunology, Learning Disability, Medical Oncology, Mental Health &amp; Psychiatric, Midwife &amp; Neonatal Midwifery, Neurology, Neurosurgery, Obstetrics &amp; Gynaecology, Occupational Medicine, Old Age Psychiatry, Operating Theatre, Ophthalmology, Oral &amp; Maxillofacial Surgery, Otorhinolaryngology, Paediatrics, Paediatric Surgery, Palliative Care and Oncology, Palliative Medicine, Psychiatry, Public Health, Rehabilitation Medicine, Renal Medicine, Respiratory Medicine, Rheumatology, Stroke Medicine, Surgery, Trauma &amp; Orthopaedic Surgery, Tropical Medicine, Urology, Vascular Surgery.</p>\r\n<p>Visit the <a href="http://www.nursingjobfair.co.uk/" target="_blank" rel="noopener noreferrer">Nursing Job Fair</a> website to register today.</p>\r\n<p><em><strong>Find work with us&hellip; Call 0203 637 6722.</strong></em></p>', '', '190916064947.webp', 1, '2019-09-16 06:49:47'),
(87, 1, 'NMC CBT for Nurses: “I wish it was more days…”', 'nmc-cbt-preparation-for-nurses', '<p align="justify">Today was the final day of our jam-packed NMC CBT Course and whilst we were expecting attendees to be&nbsp;relieved, instead one of our anonymous client satisfaction surveys expressed this simple, but effective wish:</p>\r\n<blockquote>\r\n<p align="justify">I wish it was more days.</p>\r\n</blockquote>\r\n<p align="justify">We understand, Nurse E, we wish our Senior Registered Nurse Educator Ines extended her excellent 4-day course too. However, 4 days is sufficient to cover the topics that her course includes. The comprehensive, &ldquo;interactive&rdquo; course includes but is not limited to: NMC CBT Overview; Critical CBT Topics; Blood Transfusions; Infection Control; Nutrition; Interpretation of Diagnostic Tests; UK Nursing Law and Ethics; Safeguarding Children and the Elderly; Medicines Management and Drug Calculations.</p>\r\n<p align="justify">Class sizes are&nbsp;limited to 6 nurses in person and 10 nurses online and our next course starting on 2nd May, 2019 already is already showing <a href="http://www.cbtnurses.com" target="_blank" rel="noopener noreferrer">LIMITED SPACES</a>.</p>\r\n<p align="justify"><strong>Courses take place in person at our Centre in London or <a href="http://www.cbtnurses.net" target="_blank" rel="noopener noreferrer">online</a>. </strong></p>\r\n<p align="justify">Our course also includes a full mock NMC CBT examination with <span style="text-decoration: underline;"><strong>instant</strong></span> results. One of our nurses had this to say about the course:</p>', '', '190916064832.webp', 1, '2019-09-16 06:48:32'),
(88, 1, '“I passed… It was a close cut though”', 'ielts-for-nurses-2019', '<p align="justify">On Friday evening, our <strong>Whatsapp</strong> phone rang with news from Nurse H. She sent the results to the left and said,</p>\r\n<blockquote>\r\n<p align="justify">I passed&hellip; It was a close cut though.</p>\r\n</blockquote>\r\n<p align="justify">Whilst we were delighted for Nurse H, we have to disagree that it was <em>close</em>. You see, when Nurse H came to us in January 2019 for an Intermediate IELTS course, she purchased 15 sessions. Working as a domiciliary carer left her with very little time for her studies, but her recent IELTS Scores (7.0 in Listening; Reading and Speaking and 6.0 in Writing) would not allow her to return to her nursing career and that <em>simply wouldn&rsquo;t do</em>. Determined to succeed, Nurse H enrolled at&nbsp;IELTS Medical and paced her studies around her job. Choosing to study across alternate Thursdays; Saturdays and Sundays for two and a half months, she booked and attended&nbsp;<strong><em>flexible</em></strong> sessions to coincide with her rota at work. She diligently progressed, completing the <strong><em>mountains</em></strong> of IELTS homework she was given on time, yet all the while her bright smile never wavered! When the results came through, we were not surprised that within a short period of time, Nurse H had progressed two bands in Listening, one band in Speaking and <em>crucially</em> half a band in her IELTS Writing. In truth, when we compared the writing she had produced at the start of the course, with what she was consistently producing by the end, we thought her IELTS Writing deserved a higher score. Alas, I digress. Ultimately we&rsquo;re delighted for Nurse H, whose next step is the NMC CBT (which &ndash;&nbsp;<em><strong>ahem</strong></em> &ndash; <a href="http://www.cbtnurses.com" target="_blank" rel="noopener noreferrer">we do here too</a>). Very well done, Nurse H &ndash; we salute you.</p>\r\n<p align="justify"><em><strong>Get flexible with us&hellip; Call 02036376722!</strong></em></p>', '', '190916064725.webp', 1, '2019-09-16 06:47:25'),
(89, 1, 'Flexible IELTS Courses for Doctors and Nurses', 'flexible-ielts-courses-doctors-nurses', '<ul>\r\n<li><span style="text-decoration: underline;"><strong>Flex courses (Group or One:One)</strong></span>\r\n<p align="justify">Our doctors and nurses frequently comment that they are extremely happy that we are open 7 days a week. Long shifts, long days and short annual leaves means that sometimes there&rsquo;s very little time to engage in continuing professional development. Here at IELTS Medical, our&nbsp;Central London centre is open 7 days a week. This means that you can count on academic support at a time that suits<strong> you</strong>. Our IELTS Flex allows you to be able to structure your contact time with our native English IELTS experts for 1 hour sessions between 10:00am &ndash; 9:15pm in person and online. Most of our medics come in for 2 sessions either twice or three times each week until they are ready to <strong>successfully</strong> attempt the IELTS exam.&nbsp; No matter how many times you&rsquo;ve attempted the IELTS exam before, believe us when we tell you that<em><strong> if you do not know what the examiner</strong> </em>is looking for then you are wasting your time. We know what the examiner is looking for and as well as giving you test preparation, we<strong><em> will help you improve your language skills </em></strong>and ultimately help you improve at work.</p>\r\n<p>Superb IELTS Courses for Healthcare Professionals In Person (Marylebone, Central London) or online (Worldwide) Native Ex-IELTS Examiners and IELTS Experts in a course that&rsquo;s led by healthcare and English language professionals? It&rsquo;s got to be IELTS Medical.</p>\r\n<p><em><strong>Get flex with us&hellip; Call 02036376722!</strong></em></p>\r\n</li>\r\n</ul>', '', '190916064612.webp', 1, '2019-09-16 06:46:12'),
(90, 1, 'LIVE OET Speaking Practice', 'live-oet-speaking-practice', '<p align="justify">With the Speaking subtest of the Occupational English Test (OET), preparation is key. The Speaking subtest is arguably the most unpredictable of the four OET tests, because successful completion depends on working with your interlocutor to showcase your communication skills. In this part of the exam, you will have a <strong>roleplay</strong> card with up to five tasks. This means that you will be taking your professional role against an interlocutor that is playing a patient or patient&rsquo;s carer or relative.</p>\r\n<p align="justify"><span style="text-decoration: underline;"><strong>The format of the exam</strong></span></p>\r\n<p align="justify">The format of this part of the exam is the same throughout.</p>\r\n<div>2 mins getting to know the interlocutor</div>\r\n<div>2-3 mins of preparation for the first roleplay</div>\r\n<div>5 mins roleplay 1</div>\r\n<div>2-3 mins &nbsp;preparation for the&nbsp;second roleplay</div>\r\n<div>5 mins roleplay 2</div>\r\n<div>The OET Speaking test lasts for approximately 20 mins</div>\r\n<p align="justify">Typically a roleplay card will explain the situation and what the OET require you to do. You will usually be allowed to keep your card, but some medics have reported that they were not permitted to do so at some test centres. Regardless, it can be challenging to think of what to say when faced with an unfamiliar situation on the day. Preparation for this is crucial, but it can be difficult to find a willing OET Speaking partner who both knows the expectations of the exam and is ready, willing and able to deliver a performance that will be helpful for your OET preparation.</p>\r\n<p><span style="text-decoration: underline;"><strong>LIVE OET Speaking Practice&nbsp;</strong></span></p>\r\n<p align="justify">Our native English OET interlocutors are able to provide mock OET Speaking roleplays, allowing you to rehearse your OET Speaking skills before your big day. Choose your profession and register your request at any time of the day that is suitable in your timezone here:</p>\r\n<p><span style="text-decoration: underline;"><strong>Doctors:</strong></span><strong>&nbsp;</strong><a href="http://speaking.oetdoctors.co.uk" target="_blank" rel="noopener noreferrer">speaking.oetdoctors.co.uk</a></p>\r\n<p><span style="text-decoration: underline;"><strong>Nurses:</strong></span><strong>&nbsp;</strong><a href="http://speaking.oetnurses.co.uk" target="_blank" rel="noopener noreferrer">speaking.oetnurses.co.uk&nbsp;</a></p>\r\n<p><em><strong>Get Speaking Partnered with us&hellip; Call 02036376722!</strong></em></p>', '', '190916064357.webp', 1, '2019-09-16 06:43:57'),
(91, 1, 'OET Test Day Prep – Every Wednesday Until June and July Exams', 'oet-test-day-prep', '<p align="justify"><span style="font-size: 18px;">This Wednesday saw the second session of OET Test Day prep for Nurses who have registered for the OET examination through IELTS Medical. We tackled OET listening part C where we looked at how to tackle the OET Listening subtest. Our nurses usually find part C the hardest of the three and it was encouraging to see that they were each willing to put in the effort to decipher the opinion of the speaker in order to score high marks on the test. It was also encouraging to see a healthy attendance rate on a weekday evening &ndash; one of our nurses even joined<em> LIVE from her car</em>!</span></p>\r\n<p><span style="font-size: 18px;">As we march towards the May, June and July examinations, we look forward to the next session of OET Test Day Prep, which will concentrate on the Writing part of the test. Our group is a studious one, with some of our nurses having attended the session after studying in centre from 10am to 3pm!!</span></p>\r\n<p><a href="https://live.vcita.com/site/ieltsmedical/online-scheduling?service=d5wbjbunbg0im3uf" target="_blank" rel="noopener noreferrer">You can join our group via this online link.</a></p>\r\n<p align="justify"><span style="font-size: 18px;">We salute you nurses and we look forward to seeing you again soon&hellip;</span></p>\r\n<p><span style="font-size: 18px;"><em><strong>Get Test Prepped with us&hellip; Call 02036376722!</strong></em></span></p>', '', '190916064128.webp', 1, '2019-09-16 06:41:28');
INSERT INTO `blog` (`id`, `author_user_id`, `title`, `slug`, `description`, `meta_description`, `photo_image`, `user_status`, `created_date`) VALUES
(92, 1, 'OET 2.0 Listening Practice – Diabulimia by Dr. Annalise Keating', 'oet-2-0-listening-practice-diabulimia-dr-annalise-keating', '<p><span style="text-decoration: underline; color: #000000;"><strong>Transcript</strong></span></p>\r\n<p align="justify"><span style="color: #000000;">Hello my name is Annalise Keating and I&rsquo;m a gastroenterologist working with a multinational team to raise awareness of a relatively obscure condition called Diabulimia.</span></p>\r\n<p align="justify"><span style="color: #000000;">The name is derived from a mixture of diabetes and bulimia, as it describes the situation where type one diabetics develop the behavioural characteristics that are common to the aforementioned eating disorder. As insulin restriction is a significantly more dangerous act than calorie purging, the sooner something can be done about the countless lives being lost because of Diabulimia, the better. To put things in context, it is estimated that approximately 300,000 people in the Canada are living with type 1 diabetes. Whilst the exact number of people living with Diabulimia is unknown, alarmingly, up to 40% of sufferers (who are mainly female) aren&rsquo;t taking enough insulin to survive. With that acknowledged, it would be remiss not to mention that those affected are not exclusively women.</span></p>\r\n<p align="justify"><span style="color: #000000;">A recent German study suggests that 11.2% of boys aged nineteen and under are using intentionally depriving themselves of insulin in a drive to be either thin or thinner. Yet despite the widespread reach of this condition, it is not as visible as other similar disorders, such as anorexia or bulimia nervosa. Part of the reason the condition is so low-profile, is the fact that the condition is not a recognised medical or psychiatric term, but rather it highlights the practice of reducing or eliminating insulin in a bid to lose weight.</span></p>\r\n<p align="justify"><span style="color: #000000;">As diabetes sufferers cannot produce insulin but need it in order to survive, the practice of restricting their intake with the aim of losing weight incredibly dangerous. Suffers develop incredibly high blood sugars, which has the potential to produce multiple, irreversible diabetic complications. This can include neuronal, retinal and renal damage. The most common symptoms of the disease includes irritability, decreased concentration and motivation and diabetic ketoacidosis; all of which are analogous to diabetes. Rather eerily, by making the decision to cease treatment, suffers are essentially turning the clock back on their condition.</span></p>\r\n<p align="justify"><span style="color: #000000;">I work in conjunction with colleagues who do a lot of work with various outreach groups and friends and family of people with insulin dependent diabetes mellitus. This type of outreach work was sparked by the many case studies of young people whose lives have been claimed by the disease. One such account is of the life of Megan, a twenty seven year old, who took her life after battling with the disease. Typically of people with the condition, Megan developed an unhealthy pre-occupation with food. She also became increasing uncomfortable taking her daily medication, comparing injecting her insulin to injecting fat into her body. Her sporadic insulin restriction then became a greater feature of her life. The unhealthy preoccupation with her diet led her to the discovery that despite not lowering her food intake, because she had drastically reduced her medication, she was losing weight.</span></p>\r\n<p align="justify"><span style="color: #000000;">The weight loss is a result of the body&rsquo;s cells failing to absorb blood sugar, with the consequence of prolonged, elevated blood sugar in the individual. This causes the organs to be saturated in glucose. Such consequences are so severe and irreversible that early detection is a governmental priority.</span></p>\r\n<p align="justify"><span style="color: #000000;">The UK&rsquo;s NHS clinical team have been involved in producing the NICE guidelines on eating disorders, devoting part of the report to managing people suffering from an eating disorder and diabetes concurrently. The guidelines have been distributed nationally in a bid to tackle the illness. Furthermore, the organisation is integrating psychological services with GP practices by placing 3,000 new mental health therapists in surgeries. In addition, other private and charitable organisations are also keen to play their part. A prominent example includes Jacqueline Allan, founder of national charity Diabetics With Eating Disorders. Allan is presently campaigning for the omission of insulin for weight loss purposes, to be recognised as a mental illness. The theory is that increasing the condition&rsquo;s, visibility it will become easier to engage multidisciplinary teams including endocrinologists, mental health professionals and specialists like myself, who specialise in the condition, to provide a 360 degree treatment service. Until that is achieved, however, the road to medical and psychological recognition continues.</span></p>', '', '190916063738.webp', 1, '2019-09-16 06:37:38'),
(93, 1, 'NMC OSCE Reviews – 3 or 5 day options', 'nmc-osce-reviews', '<p align="justify"><span style="font-size: 18px;">This valuable feedback accurately describes our NMC OSCE for Nurses course that includes APIE, Skills and a Mock Examination with feedback. The course is at least once a month, either <a href="http://www.oscenurses.com" target="_blank" rel="noopener noreferrer">3 or 5 days</a>&nbsp;long, and it is led by our Clinical Nurse Educator Claire. Ultimately, the secret to the success of the nurses on our course is that&nbsp;you&nbsp;are motivated and eager to understand how to practice safely and competently in the UK. Here are a few things you should know about our NMC OSCE reviews:</span></p>\r\n<p align="justify"><span style="font-size: 18px;">Firstly, <strong>we&rsquo;re in this with you</strong>. Over the years, we&rsquo;ve seen many nurses through the exam and into their first job as a UK registered nurse.</span></p>\r\n<p align="justify"><span style="font-size: 18px;">Secondly, <strong>we take great care to show you</strong> the standard that the NMC expect of you and your learning outcomes on the course, closely match the&nbsp;NMC&rsquo;s criteria.</span></p>\r\n<p align="justify"><span style="font-size: 18px;">Thirdly, <strong>we provide you with pre-course material on registration</strong>, so that you can get your learning started as quickly as possible.</span></p>\r\n<p align="justify"><span style="font-size: 18px;">Fourthly, <strong>we provide you with support</strong> via Whatsapp and Webinars so that you can clarify any doubts you may have.</span></p>\r\n<p align="justify"><span style="font-size: 18px;">Plus,<strong> we&rsquo;re open 7 days a week at HQ</strong>, so you can pop in and practice your skills.</span></p>\r\n<p align="justify"><span style="font-size: 18px;">Finally and crucially, <strong>we also give you the opportunity to ask any and all questions</strong> you may have about the exam and &ndash; more generally &ndash; about what it is like to practice as a nurse in the UK.</span></p>\r\n<p align="justify"><span style="font-size: 18px;">You see, our Nurse Education Team has decades of UK nursing experience combined and when you enrol in our courses, you have the backing and support of a dedicated team of nurses by your side every step of the way.</span></p>\r\n<p align="justify"><span style="font-size: 18px;">Join us&nbsp;for this effective NMC OSCE for Nurses Course that we deliver to you competently and professionally from our London HQ and Hospital Training rooms.</span></p>\r\n<p><span style="font-size: 18px;"><em><strong>Pass your OSCE with confidence&hellip; with us&hellip; Call 02036376722!</strong></em></span></p>', '', '190916063307.webp', 1, '2019-09-16 06:33:07'),
(94, 1, 'Which is easier for healthcare professionals – IELTS or OET?', 'ielts-vs-oet-which-is-easier-for-medical-professionals', '<p align="justify"><span style="font-size: 18px;">When it comes to both the IELTS and the OET,&nbsp;the question we are asked most often is, &ldquo;Which is easier IELTS or OET?&rdquo; and our response is usually, &ldquo;It depends.&rdquo; You see there are advantages and disadvantages to either English test depending on your situation.</span></p>\r\n<p><span style="font-size: 18px;"><strong>Which one is better?&nbsp;</strong></span></p>\r\n<p align="justify"><span style="font-size: 18px;">That question is like comparing a Ferrari to a Lamborghini &ndash; either will get you to where you need to go, it just depends on which you prefer. Both the IELTS and the OET are high stakes Cambridge examinations that are trusted by healthcare regulators. They both test your English Listening; Reading; Speaking and Writing skills and they both evidence your English language ability. Both examinations&nbsp;reassure your regulators that you can communicate effectively if you reach 7.0 &ndash; 7.5 in IELTS and 4B grades in the OET. This step is&nbsp;in your best interests and the best interests of&nbsp;your future patients here in the UK. With that acknowledged, the IELTS is more readily available than the OET, both in terms of available test dates and locations.&nbsp; There are currently&nbsp;500 IELTS test centres compared to 110 OET locations.</span></p>\r\n<p><span style="font-size: 18px;"><strong>Which one is cheaper?&nbsp;</strong></span></p>\r\n<p align="justify"><span style="font-size: 18px;">You see, there is&nbsp;a phrase that we hear a lot, which is that &lsquo;the OET is expensive&rsquo;. Yes, on the face of it, if you compare the two exams,&nbsp;to take the IELTS test costs &pound;155 &ndash; &pound;175 depending on where you take it. The OET, on the other hand, costs &pound;290 &ndash; &pound;350 (a difference of approximately &pound;195) depending on whether you enter individually or as part of a group. The cost of preparation for the IELTS is comparatively lower too. However, if you consider your chances of success for both of them, you may see things a little differently. The IELTS can be considered more random than the OET. The topic of a question in the IELTS exam can be historical, political, economical, geographical, sociological&hellip; The list is endless. Conversely, the OET is profession specific and as such, all of the material will be healthcare focused. &nbsp;This means that it could be considered unpredictable by comparison, and therefore more difficult. To add a level of credence to that argument, in January 2018, the OET stated that for every 1 person who passes the IELTS, 4 pass the OET.</span></p>\r\n<p><span style="font-size: 18px;"><strong>Which&nbsp;test&nbsp;should&nbsp;you do?</strong></span></p>\r\n<p align="justify"><span style="font-size: 18px;">Ultimately, both exams will help you to demonstrate to <strong>yourself</strong> and your regulator &ndash; either the&nbsp;<a href="https://www.gmc-uk.org/registration-and-licensing/join-the-register/before-you-apply/evidence-of-your-knowledge-of-english" target="_blank" rel="noopener noreferrer">GMC for doctors</a> or&nbsp;the <a href="https://www.nmc.org.uk/registration/joining-the-register/english-language-requirements/" target="_blank" rel="noopener noreferrer">NMC for nurses</a> &ndash; that you have the necessary level of English language skill to practice safely in the UK. Every day we speak to doctors and nurses who decide to do either the IELTS or OET and the one they eventually choose is a personal decision. We see plenty of healthcare professionals through both exams and we can do the same for you.</span></p>\r\n<p><span style="font-size: 18px;"><em><strong>Prepare for the <span style="text-decoration: underline;">right</span> exam with us&hellip; Call 0203 637 6722.</strong></em></span></p>', '', '190916062918.webp', 1, '2019-09-16 06:29:18'),
(95, 1, 'Are you preparing for your NMC CBT exam? New to iOS – NMC CBT for Nurses the App', 'nmc-cbt-for-nurses-ios-app', '<p align="justify"><span style="font-size: 18px;">If you&rsquo;re preparing for your NMC CBT examination and need to practice your CBT for Nurses on the go, have we got a treat for you. We&rsquo;ve brought updated knowledge about the NMC CBT right into your handbags and pockets. Would you like a link? <a href="https://itunes.apple.com/us/app/cbt-for-nurses-nmc-cbt-app/id1463111339" target="_blank" rel="noopener noreferrer">Here it is</a>. That&rsquo;s right. Our brand new CBT app is live on the iOS App store. Nurses with iPhones can look forward to the following</span></p>\r\n<p><span style="font-size: 18px;"><strong><span style="text-decoration: underline;">App features</span></strong></span></p>\r\n<ul>\r\n<li><span style="font-size: 18px;">NMC CBT Mock Examinations</span></li>\r\n<li><span style="font-size: 18px;">Updated NMC CBT Tips</span></li>\r\n<li><span style="font-size: 18px;">A Hotline to our UK Nurse Educators</span></li>\r\n</ul>\r\n<p><a href="https://itunes.apple.com/us/app/cbt-for-nurses-nmc-cbt-app/id1463111339" target="_blank" rel="noopener noreferrer">Download from the iOS App store today</a>.</p>\r\n<p><em><strong>Get App-y with us&hellip; Call 02036376722!</strong></em></p>', '', '190916062751.webp', 1, '2019-09-16 06:27:51'),
(96, 1, 'OET Results-I couldn’t stop crying happy tears… I’d battled with this for 3 years.', 'oet-results-day', '<p><span style="font-size: 18px;">When Doctor K opened her OET Medicine results at 4am this morning she said, &ldquo;I couldn&rsquo;t stop crying happy tears&hellip; I&rsquo;d battled with this for 3 years.&rdquo;</span></p>\r\n<p align="justify"><span style="font-size: 18px;">Having taken the IELTS examination multiple times without success in the writing subtest, Doctor K was reluctant to try the OET exam. It was only after encouragement from her loved ones that she thought she would give it a go. She sought out another provider, but found that after several months with them, she&rsquo;d not made the progress that she needed to proceed with UK registration. A 300 score in the OET exam, fell short of the 350 she required and it took its toll. After receiving advice from an IELTS Medical alumna, Doctor K booked a visit at the IELTS Medical London Centre. &ldquo;I got your number from a friend,&rdquo; she said. &ldquo;She said you helped her pass the OET &ndash; can you help me?&rdquo;</span></p>\r\n<p><span style="font-size: 18px;">The answer was yes.</span></p>\r\n<p align="justify"><span style="font-size: 18px;">You see, Doctor K had a good foundation in her OET Listening; Reading and Speaking and her English language skills are strong. She merely needed to know what the OET assessors required of her to reach that OET grade B. She selected the OET Remedy Course and elected to train as often as she could <em><strong>in spite of her studies coinciding with Ramadan</strong></em>. Her diligence and hardwork was remarkable and it was a joy to assist Doctor K from that mid-April afternoon to the 16th May&hellip; 2 days before her examination.</span></p>\r\n<p><span style="font-size: 18px;"><em><strong>How did she do?&hellip;</strong></em></span></p>', '', '190916062645.webp', 1, '2019-09-16 06:26:45'),
(97, 1, 'NMC OSCE 3-Day Course', 'nmc-osce', '<p><span style="font-size: 18px;"><span style="text-decoration: underline;"><strong>Meeting Nurses at the Final Stage</strong></span></span></p>\r\n<p align="justify"><span style="font-size: 18px;">The delightful thing about having the NMC Course at IELTS Medical London is that we get to meet nurses at the final stage of their registration journey each and every month. At this stage, our nurses will have already proven their English language ability and showed the NMC that they either remember their nursing theory or that they have put in the work to adapt to the UK way.&nbsp; Now, it&rsquo;s all about providing evidence that they can be a nurse. As I&rsquo;m sure you can imagine, the stakes are always high.</span></p>\r\n<p><span style="text-decoration: underline; font-size: 18px;"><strong>Our Responsibility to You</strong></span></p>\r\n<p align="justify"><span style="font-size: 18px;">Here at IELTS Medical London, we know that we have a responsibility to deliver the best possible NMC OSCE course to you. Our Clinical Educators are led by Senior Nurse Educator, Claire &ndash; a registered nurse who knows the NMC OSCE exam incredibly well. Having seen many nurses through to a first time NMC OSCE pass, she has designed courses that deliver results.&nbsp; You&rsquo;re in the safest possible hands at IELTS Medical London, because we know that that&rsquo;s our duty to you.</span></p>\r\n<p><span style="text-decoration: underline; font-size: 18px;"><strong>Your Responsibility to Yourself</strong></span></p>\r\n<p align="justify"><span style="font-size: 18px;">You&rsquo;ve found a great NMC OSCE training centre. Great. That&rsquo;s half the battle won. However, you will need to make sure that you practice, practice, practice. Over and over again. You&rsquo;ll have received guidance about the best techniques and methods to produce an accurate assessment and how to show you have competent nursing skills. Now it&rsquo;s time to put that knowledge into action. You&rsquo;ll likely be nervous on the day; most nurses are. However, when you&rsquo;ve prepared as well as you will have done here, there you&rsquo;ll be ready to show the OSCE examiners that you can practice safely in the UK &ndash; which is what this exam is all about.</span></p>\r\n<p><span style="text-decoration: underline; font-size: 18px;"><strong>Purpose Built Practice Rooms</strong></span></p>\r\n<p><span style="font-size: 18px;">If you need a place to practice, we&rsquo;ve got you covered. From July 2019, the IELTS Medical London Marylebone Centre will have a state of the art, purpose built practice room designed for you to practice your stations. It&rsquo;s our way of saying: &lsquo;We&rsquo;re in this with you&rsquo;.</span></p>\r\n<p><span style="font-size: 18px;"><em><strong>Get OSCE Reviewed with us&hellip; Call 020366376722!</strong></em></span></p>', '', '190916062540.webp', 1, '2019-09-16 06:25:40'),
(98, 1, 'OSCE for Nurses – App Companion to London OSCE Course', 'osce-for-nurses-app-companion-to-london-osce-course', '<p align="justify"><span style="font-size: 18px;">We&rsquo;re delighted to announce that our OSCE for Nurses app is now LIVE on the iOS app store. The NMC OSCE examination is a tough one that requires mastery of APIE and a set of skills. Here at IELTS Medical we have monthly NMC OSCE courses. Every course, our Lead OSCE Trainer makes it clear to our nurses that practice is a<strong> must</strong>. We thought we&rsquo;d make the process a little easier by putting the practice right in your pocket.</span></p>\r\n<p align="justify"><span style="font-size: 18px;">The app includes NMC On-the-Spot Quizzes; Demo videos and &ndash; crucially &ndash; a hotline to our Clinical Nurse Educators who have decades of experience nursing in the UK and several years&rsquo; of experience specifically with the NMC OSCE examination. <a href="https://apps.apple.com/app/id1467514800" target="_blank" rel="noopener noreferrer">Click here to download the app</a>.</span></p>', '', '190916062429.webp', 1, '2019-09-16 06:24:29'),
(99, 1, 'Next OET for Doctors intake…', 'oet-doctors-intensive-preparation-in-person-in-london', '<p align="justify"><span style="font-size: 18px;">The 15th July, 2019 will see a brand new cohort of international doctors begin our next intensive courses. You can choose either 3 or 6 week preparation of OET for Doctors preparation. We have extracted and bottled the elements of our tried and tested <strong>OET Refresh 2.0 course. </strong>We&rsquo;ve mixed this with the elements of our intensive <strong>OET Revision 2.0 course </strong>and created the perfect <strong>OET</strong> <strong>Remedy 2.0</strong>. Training in groups of maximum six doctors, our medics will study all four modules of the exam including: OET Listening; Reading; Speaking and Writing. Preparing thoroughly with OET trained tutors and with access to exclusive OET materials. This includes our<a href="https://apps.apple.com/us/app/oet-medicine-app-for-doctors/id1467042015?ls=1" target="_blank" rel="noopener noreferrer"> brand new OET app</a> that is live on the iOS app store, you&rsquo;re in the right place if passing the OET is your number one goal.</span></p>\r\n<p><span style="font-size: 18px;">There are various study options available to our medics:</span></p>\r\n<p align="justify"><span style="font-size: 18px;"><strong><span style="text-decoration: underline;">Option 1: Monday to Thursday<br /> </span></strong>Training 4 days a week from 10:00 am to 3 pm and training in groups of maximum 6 international doctors at our training centre in Marylebone, Central London.</span></p>\r\n<p align="justify"><span style="font-size: 18px;"><strong><span style="text-decoration: underline;">Option 2: Friday to Monday<br /> </span></strong>Training 4 days a week from 10:00 am to 3 pm and training in groups of maximum 6 international doctors at our training centre in Marylebone, Central London.</span></p>\r\n<p align="justify"><span style="font-size: 18px;"><strong><span style="text-decoration: underline;">Option 3: Saturday and Sunday<br /> </span></strong>Training 2 days a week from 10:00 am to 3 pm and training in groups of maximum 6 international doctors at our training centre in Marylebone, Central London.</span></p>\r\n<p><span style="font-size: 18px;">Choose a training centre that&rsquo;s just as invested in your future as you are.</span></p>\r\n<p align="justify"><span style="font-size: 18px;"><em><strong>Progress with us&hellip; Call 02036376722&hellip;</strong></em></span></p>', '', '190916043137.webp', 1, '2019-09-16 04:31:37'),
(100, 1, 'IELTS and OET are sufficient for immigration', 'ielts-oet-sufficient-for-immigration', '<p><span style="color: #0b0c0c; font-family: ''GDS Transport'', Arial, sans-serif; font-size: 19px;">The Home Office has also streamlined English language testing ensuring that doctors, dentists, nurses and midwives who have already passed an English language test accepted by the relevant professional body, do not have to sit another test before entry to the UK on a Tier 2 visa. This change will make sure that hospitals and medical practices across the country will be able to access the staff they need more quickly.</span></p>', 'home office', '190910064236.jpg', 1, '2019-09-10 18:42:36'),
(101, 1, 'She flexed her way to a B-B-B-B pass', 'flexible-oet-course-for-nurses-in-london', '<p><span style="font-size: 18px;">So the June OET results were earlier than expected and released today. We know this, because our phones and Whatsapp messages rang with glee at some <strong>phenomenal scores</strong>.</span></p>\r\n<h2><span style="text-decoration: underline; font-size: 18px;"><strong>12 hours a day and 5 days a week</strong></span></h2>\r\n<p align="justify"><span style="font-size: 18px;">One nurse in particular was an absolute joy to assist. Nurse L came into the centre one evening looking for a solution. Having qualified in Italy, the OET was the only thing between her and practicing as a nurse in one of the best Children&rsquo;s hospitals in the country. She knew that passing the OET was something that she wanted. She also knew, however, that her healthcare assistant job required her 12 hours a day and 5 days each week. If she was going to do this and do this quickly, she needed an OET course provider that was equipped to deliver flexible courses.</span></p>\r\n<h2><span style="text-decoration: underline;"><strong>Flexing across 33 days?</strong></span></h2>\r\n<p align="justify"><span style="font-size: 18px;">Nurse L received her schedule from the hospital a month in advance, meaning that when she enrolled, she was able to provide the dates and times of the 10 OET Flex Sessions she required. A <strong>benchmarking</strong> exercise during her first session highlighted OET writing as the only area she needed to concentrate her tuition efforts on and she chose the <strong>OET Flex Course</strong> to support this. The OET Flex course allows you to purchase 10; 20 or 30 sessions in advance and to select any vacant sessions between 10:00 am &ndash; 9:15 pm during the week or 10:00 &ndash; 17:00 on weekends. Nurse L spaced her course out across the month of May and then attended a single revision session one week before the exam.</span></p>\r\n<h2><span style="text-decoration: underline;"><strong>The result</strong></span></h2>\r\n<p><span style="font-size: 18px;">Rather predictably, Nurse L achieved B-B-B-B across all 4 skills on her first attempt.</span></p>\r\n<p><span style="font-size: 18px;">Need a provider who can flex with your needs?</span></p>\r\n<p><strong>Flex your way to a B-B-B-B pass with us&hellip; Call 02036376722!</strong></p>', '', '190907053457.webp', 1, '2019-09-07 05:34:57'),
(102, 1, 'Summer Surprises', 'summer-fun-summer-surprises', '<p><span style="font-size: 18px;"><strong>Summer Surprises!</strong></span></p>\r\n<p align="justify"><span style="font-size: 18px;">This afternoon we decided to surprise our medics with a slight detour. A change of scene from the standard #OET Speaking class. We headed to a destination that was just minutes away our centre in Marylebone. Our medics were pleasantly surprised as their car pulled up outside #<a href="http://bloomsburybowling.com/" target="_blank" rel="noopener noreferrer">Bloomsbury Bowl</a> for an afternoon full of bowling, pizza and fun!</span></p>\r\n<p align="justify"><span style="font-size: 18px;">Between the banter, high fives, eating and congratulations our close knit cohort created memories that we hope will stay with them beyond the Summer.</span></p>\r\n<p align="justify"><span style="font-size: 18px;">As an aside, to all of you &ndash; from your Team at IELTS Medical &ndash; it really has been a pleasure getting to know all of you and we wish you success in the OET and in your futures.</span></p>\r\n<p align="justify"><span style="font-size: 18px;"><em><strong>Keep in touch.</strong></em></span></p>\r\n<p><span style="font-size: 18px;"><em><strong>Get in the mood for Summer with us&hellip; Call 02036376722!</strong></em></span></p>', '', '190907053344.webp', 1, '2019-09-07 05:32:55'),
(103, 1, 'OET Revision Crash Course before 31st August Exams', 'oet-revision-crash-course-before-31st-august-exams', '<p><strong>OET Revision Crash Course before 31st August Exams @ 10:00 &ndash; 12:45 from Monday 26th &ndash; Friday 30th August.</strong></p>\r\n<p align="justify">The OET Revision Course is BACK. If you&rsquo;ve taken a break from your OET revision or need that additional boost before the big day, it&rsquo;s a great way for you to reassure yourself that you&rsquo;re ready to pass your OET examination.</p>\r\n<p align="justify">Planned at our Central London &ndash; Marylebone branch &ndash; the course is easily accessible by almost any mode of transport (eg. a mere five minute walk from Marble Arch and ten from Baker Street).</p>\r\n<p align="justify">As you would expect, the course covers all of the fundamentals you need to pass the OET and to do so well. It is engineered in such a way that equal time is devoted to each part of the exam, ensuring full understanding and feedback. Courses here are taught by OET trained native UK tutors and revision coursebooks are provided at the start of the course so that you can follow the instructor and practice at home. You will also receive access to our Virtual Learning Environment (or VLE) at <a href="http://learn.ieltsmedical.org" target="_blank" rel="noopener noreferrer">learn.ieltsmedical.org</a> so that you can practice OET exam type questions against the clock.&nbsp;&nbsp;Full and detailed solutions are provided during the contact hours along with explanations from our staff of well trained instructors.</p>\r\n<blockquote>\r\n<p align="justify">Revising in groups is a rewarding experience. You can reach out to new OET speaking partners and you can rest assured that the other healthcare professionals on the course are just as motivated as you are. Such a refreshing boost, right before the real examination, is a great idea to supplement your extensive investment in your OET studies.</p>\r\n</blockquote>\r\n<p align="justify">Please note that only upper intermediate learners with an IELTS equivalent of 6.0 &ndash; 6.5 and above will be admitted to the revision week before the may examination.</p>\r\n<p align="justify"><em><strong>Revise OET with us&hellip; Call 02036376722.</strong></em></p>\r\n<p align="justify">(*&nbsp;Intermediate learners are advised to undertake a full course in the OET &ndash; see oetdoctors.co.uk or oetnurses.co.uk).</p>', '', '190907053143.webp', 1, '2019-09-07 05:31:43'),
(104, 1, 'Excellent NMC OSCE Pass Rates… It’s the way she explains it…', 'excellent-nmc-osce-pass-rates-its-the-way-she-explains-it', '<p><span style="text-decoration: underline; font-size: 18px;"><strong>It&rsquo;s the way she explains it&hellip;</strong></span></p>\r\n<p align="justify"><span style="font-size: 18px;"><span style="font-family: arial;">Whenever we ask our nurses about <em>just what it is</em> that makes our NMC OSCE courses so successful, they often cite our <strong>Lead Nurse Educator Claire</strong>. &ldquo;It&rsquo;s the way she explains it,&rdquo; you say and we wholeheartedly agree. </span></span></p>\r\n<p align="justify"><span style="font-size: 18px;"><span style="font-family: arial;">You see, across our NMC OSCE 3 and 5 day courses in London, we know that you&rsquo;ll get a lot of information. We also know that you need to take it all in and that you&rsquo;ll need to do this relatively quickly. As such, Claire leads the course in-person and in an approachable and accessible way. So, not only do you get to learn and make new friends and colleagues, but you also have fun too&hellip;. But wait, there&rsquo;s more:</span></span></p>\r\n<p align="justify"><span style="font-size: 18px;"><span style="font-family: arial;">After the course, because we don&rsquo;t want you to miss our Nurse Education Team <em>too much</em>, we&rsquo;ve built you apps. On the OSCE for Nurses app, we&rsquo;ve got NMC OSCE demonstrations that give you a glimpse into practice sessions on the course.</span></span></p>\r\n<p><span style="font-size: 18px;"><span style="font-family: arial;">The OSCE for Nurses app <a href="https://apps.apple.com/us/app/osce-for-nurses/id1467514800?ls=1" target="_blank" rel="noopener noreferrer">available now for iOS</a> and <a href="https://play.google.com/store/apps/details?id=com.ieltsmedical.osce&amp;gl=GB" target="_blank" rel="noopener noreferrer">Android</a>.</span></span></p>', '', '190907053026.webp', 1, '2019-09-07 05:30:26'),
(105, 1, 'NHS Jobs.. After the Journey…. #SeptemberStreaming', 'nhs-job-after-the-journey', '<p><span style="font-size: 18px;">A lot of our medics are too busy preparing for the various exams to think about their next steps. </span></p>\r\n<p><span style="font-size: 18px;">But, what about life after the journey?</span></p>\r\n<p><span style="font-size: 18px;">Once you&rsquo;ve finished your exams what happens next?</span></p>\r\n<p><span style="font-size: 18px;">Well, we caught up with some of our nurses who finished her IELTS, CBT and OSCE with us before landing a job with one of our hospital clients&hellip;</span></p>\r\n<p><span style="font-size: 18px;">Our <strong>After the Journey Series</strong> will be streaming in September.</span></p>\r\n<p><span style="font-size: 18px;">Stay tuned&hellip;</span></p>\r\n<p><span style="font-size: 18px;"><em><strong>Take your next steps with us&hellip; Call 02036376722.</strong></em></span></p>', '', '190907052906.webp', 1, '2019-09-07 05:29:06'),
(106, 1, 'OET Group Booking System', 'oet-group-booking-system', '<p><span style="font-size: 18px;">It is now <strong><em>easier than ever</em></strong> to book your OET exam as part of a group with us.</span></p>\r\n<p><span style="font-size: 18px;">Step 1: Visit <a href="http://learn.ieltsmedical.org" target="_blank" rel="noopener noreferrer">learn.ieltsmedical.org</a></span></p>\r\n<p><span style="font-size: 18px;">If you are a learner on one of our courses, login and visit<strong> Centre Course Dates</strong> and select the group you would like to enter with.</span></p>\r\n<p><span style="font-size: 18px;">For our guests, select guest login and visit <strong>Centre Course Dates</strong> and select the group you would like to enter with.</span></p>\r\n<p><span style="font-size: 18px;">Entry into one of our groups, automatically qualifies you for a LIVE OET Mock Exam at our London centre.</span></p>\r\n<p><span style="font-size: 18px;"><em><strong>Get into a group with us&hellip; Call 02036376722!</strong></em></span></p>', '', '190907052731.webp', 1, '2019-09-07 05:27:31'),
(107, 1, 'They''ve sent us the grades in numbers... I think I''ve got 4Bs...Am I right?', 'oet-results-grades-to-numbers', '<ul>\r\n<ul>\r\n<li><strong>By Ana</strong></li>\r\n</ul>\r\n</ul>\r\n<p align="justify">It was a hot afternoon in July when Doctor S. first&nbsp;arrived at&nbsp;the centre, having just arrived in London a few weeks before.&nbsp;</p>\r\n<p align="justify">As an experienced&nbsp;Mastologist and Gynaecologist who trained in Brazil, she was drawn to the thriving breast cancer departments in London and sought to make a difference.&nbsp;</p>\r\n<p align="justify"><span style="color: #808080;">With a choice of either IELTS or OET, she surveyed both exams and decided that she preferred the OET. She felt that her experience as a doctor and her strong language skills would&nbsp;make this an efficient choice and opted for our 3-week OET (Medicine) preparation course.</span></p>\r\n<p align="justify"><span style="color: #808080;">During this time, Doctor S was an exemplary OET learner. She was engaged <em>and engaging</em>, studious and an absolute pleasure to assist. It was therefore no surprise when she emailed to ask:</span></p>\r\n<p class="yiv8835864294MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px;"><strong><em><span style="font-family: arial, helvetica, sans-serif;">"<span style="font-size: 13.3333px; color: #000000;">I am sending my results to you. They''ve sent to us the grades in numbers.&nbsp;</span>I think I have got 4 Bs. Please let me know if I am right."&nbsp;</span></em></strong></p>\r\n<p align="justify"><span style="color: #808080;">She was indeed correct: 420 in Listening (B); 380 in Reading (B); 360 in Speaking (B) and 350 in Writing (B). </span></p>\r\n<p align="justify"><span style="color: #808080;">We think you''re absolutely lovely Doctor S and wish you an excellent Mastology and Gynaecology career here in the UK.&nbsp;</span></p>\r\n<p class="yiv8835864294MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px;"><span style="font-size: 10pt;"><em><strong><span style="font-family: arial, helvetica, sans-serif;">Progress your career with us... Call 02036376722!&nbsp;</span></strong></em></span></p>', 'Superb OET results', '190920021947.jpg', 1, '2019-09-20 14:15:59'),
(108, 4, 'An Artists Impression of APIE', 'nmc-osce-course-for-nurses', '<p>A sketch of Day 1 of our outstanding NMC OSCE Course.&nbsp;</p>', 'NMC OSCE Courses start with Day 1 with APIE', '190927111103.JPG', 1, '2019-09-27 11:11:03'),
(109, 1, 'NMC OSCE Course Tomorrow...!', 'nmc-osce-course', '<p style="text-align: justify;"><span style="font-size: 10.5pt; font-family: ''Verdana'',sans-serif; color: black;">It''s that time again... That''s right, in less than 12 hours it''ll be time for another yet another successful NMC OSCE Course and Review here in London, United Kingdom. The course is so successful that we are absolutely delighted to have helped hundreds of nurses from arrival in the UK to NMC registration. </span></p>\r\n<p style="text-align: justify;"><span style="font-size: 10.5pt; font-family: ''Verdana'',sans-serif; color: black;">On registration to the course, nurses can look forward to an online whistle-stop tour through the exam, familiarisation with the NMC code of conduct, guidance to useful links, OSCE tips, OSCE quizzes and helpful videos that they can rehearse as part of the OSCE exam preparation. Accessible through our interactive learning platform or via its companion iOS and soon to be Android mobile applications, we share with our nurses what we know about this formidable examination. As the final stage before UK registration with the Nursing and Midwifery Council, quality preparation is a must. </span></p>\r\n<p style="text-align: justify;"><span style="font-size: 10.5pt; font-family: ''Verdana'',sans-serif; color: black;">Then each month - most times twice a month - nurses from all over the world and all over the country, join us for 3 or 5 days. Our signature 3-day course includes APIE and OSCE care planning on day one, OSCE skills on day two and a full mock examination on day 3. Then for the nurses who wish to work on any issues identified during the mock examination between the course and their exam, we have a 5-day offering which provides two refresher days that are closer to the big day.&nbsp;&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="font-size: 10.5pt; font-family: ''Verdana'',sans-serif; color: black;">Our interactive and practical course is expertly led by practicing UK Registered Senior Nurses and includes everything that our nurses require to pass the examination on the first attempt. We''ve seen many international nurses from Australia, Bangladesh, Canada, DR Congo, Ghana, India, Kenya, Nepal, New Zealand, Nigeria, the Philippines and the United States of America - to name a few...</span></p>\r\n<p style="text-align: justify;"><span style="font-size: 10.5pt; font-family: ''Verdana'',sans-serif; color: black;">Let us help&nbsp;<strong><span style="font-family: ''Verdana'',sans-serif;">you</span></strong>&nbsp;join the NMC register too...&nbsp;</span></p>\r\n<p style="font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;"><strong><em><span style="font-size: 10.5pt; font-family: ''Verdana'',sans-serif; color: black;">Join the&nbsp;Nursing and Midwifery Council register with us...&nbsp;Call 02036376722!</span></em></strong></p>', 'Our interactive and practical NMC OSCE course takes place in London every month. Nurses from all over the world join us for 3 - 5 days to receive excellent instruction on this high stakes examination.  Our course is expertly led and has a brilliant first time pass rate. ', '191006092507.jpg', 1, '2019-10-06 21:25:07'),
(110, 7, 'The first step for international nurses moving to UK', 'first-step-for-international-nurses-moving-to-UK', '<p class="yiv6350766936MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;"><strong>First step for international nurses moving to UK</strong></p>\r\n<p class="yiv6350766936MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;">You may wonder what is the first step to take on a journey to move to the UK and start working for the NHS: <em><strong>pass&nbsp;your English language test</strong></em>!</p>\r\n<p class="yiv6350766936MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;">The Nursing and Midwifery Council&nbsp;requires any nurse coming from a non-English speaking country to complete either The International English Language Testing System (IELTS) or the recently established Occupational English Test (OET).</p>\r\n<p class="yiv6350766936MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;">You may be more familiar with IELTS so let us introduce you to OET. We think this newcomer is a great alternative you do not want to miss out.</p>\r\n<p class="yiv6350766936MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;"><strong>What will you be tested by OET?</strong></p>\r\n<p class="yiv6350766936MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;">This exam tests your Listening, Reading, Speaking and Writing in a professional medical context. If you have practised as a doctor and want to opt for an exam that is intent on emulating your workplace, then this is the exam for you.</p>\r\n<p class="yiv6350766936MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;">OET result will be in letter grade and the passing grade is B-B-B-B across one sitting.</p>\r\n<p class="yiv6350766936MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;">Not only that you will be confident in your English after the test, you will also come across medical jargon and real-world nursing scenarios that are practical for your job. This way, your effort for the test is certainly not wasted.</p>\r\n<p class="yiv6350766936MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;"><strong>How to prepare for OET?</strong></p>\r\n<p class="yiv6350766936MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;">The best place to start is understanding the structure and criteria of the test. For grade B, the band descriptor states that a candidate meeting this level &lsquo;can communicate effectively with patients and health professionals using appropriate register, tone and lexis, with only occasional inaccuracies and hesitations as well as shows good understanding in a range of clinical contexts. Next is as the saying go, practice makes perfect.</p>\r\n<p class="yiv6350766936MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;"><strong>Need guidance?</strong></p>\r\n<p class="yiv6350766936MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;">OET for&nbsp;nursing material may not be easy to find and having expert advice can make preparation less painful. At IELTS Medical, we provide professional training courses in&nbsp;central London. We cover all four skills so you will have plenty of opportunities to listen, speak, read and write. Our text books are packed with practice questions and OET writing sample.</p>\r\n<p class="yiv6350766936MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;">We offer OET courses both in person (see <a title="www.oetnurses.co.uk" href="http://www.oetnurses.co.uk" target="_blank" rel="noopener noreferrer">www.oetnurses.co.uk</a>) and online (see:&nbsp;<a style="color: purple;" href="http://www.oetonline.net/" target="_blank" rel="nofollow noopener noreferrer" shape="rect">www.oetonline.net</a>).</p>\r\n<p class="yiv6350766936MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;">&nbsp;</p>\r\n<p class="yiv6350766936MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;">Pass your OET for&nbsp;nurses with us&hellip; Call 02036376722!</p>\r\n<p class="yiv6350766936MsoNormal" style="color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;">&nbsp;</p>', 'First step for international nurses moving to UK', '191023011911.jpg', 1, '2019-10-23 13:19:11'),
(111, 4, 'Christina meets Manong George', 'Filipino-nurse-Youtube-Vlogger-Manong-George', '<p class="MsoNormal" style="text-align: justify;">Yesterday Christina sat down to have a chat with <a href="https://www.youtube.com/channel/UCoHcRUQiJaeUve1136k1XDg" target="_blank" rel="noopener noreferrer">Youtube vlogger Manong George</a> to discuss Filipino nurses in the UK and their path from arrival in UK to NMC Registration.</p>\r\n<p class="MsoNormal" style="text-align: justify;">A nurse himself, Manong George has been practicing as a nurse in the UK for the last 10 years and in his videos he talks about different topics, like tips on passing IELTS, tips on passing the OET and tips on how to get a job in the UK. On your &ldquo;big brother&rsquo;s&rdquo; channel, you&rsquo;ll find videos about NMC updates and interviews of Filipino nurses who went through the same process of NMC Registration and who want to share their experience and their stories with you.</p>\r\n<p class="MsoNormal" style="text-align: justify;">The NHS workforce includes 12,744 Filipino healthcare workers &ndash; the third largest demographic within the NHS second only to Indian and British healthcare staff.</p>\r\n<p class="MsoNormal" style="text-align: justify;">In their chat, Christina and George touched on the necessary steps that a Filipino nurse must take as well as the exams they need to pass to ensure NMC Registration &ndash; the same exams that Manong George himself passed all those years ago. Topics they discussed included: the differences between IELTS and OET and some tips on how to pass successfully the chosen exam; how to pass the NMC CBT and NMC OSCE exams and how to navigate life in the UK post registration.</p>\r\n<p class="MsoNormal" style="text-align: justify;">We&rsquo;re super excited for you to watch the videos, which will be appearing on the <a href="https://www.youtube.com/c/ieltsmedicalltd" target="_blank" rel="noopener noreferrer">IELTS Medical Youtube Channel</a> and the <a href="https://www.youtube.com/channel/UCoHcRUQiJaeUve1136k1XDg" target="_blank" rel="noopener noreferrer">Manong George</a> Youtube channels soon.</p>\r\n<p class="MsoNormal" style="text-align: justify;">Subscribe today so that you&rsquo;re the first to receive it!</p>\r\n<p class="MsoNormal" style="text-align: justify;">Link:&nbsp;<a href="https://www.youtube.com/watch?v=fp3OjLIi-rE">https://www.youtube.com/watch?v=fp3OjLIi-rE</a></p>\r\n<p class="MsoNormal" style="text-align: justify;">Say kamusta with us&hellip; call today 02036376722!</p>', 'Yesterday Christina sat down to have a chat with Youtube vlogger Manong George to discuss Filipino nurses in the UK and their path from arrival in UK to NMC Registration.', '191028052148.jpg', 1, '2019-10-28 17:21:48');
INSERT INTO `blog` (`id`, `author_user_id`, `title`, `slug`, `description`, `meta_description`, `photo_image`, `user_status`, `created_date`) VALUES
(112, 1, 'Occupational English Test Courses in London - Evening Edition', 'Occupational-English-Test-Courses-in-London-Evening-Edition', '<p class="MsoNormal" style="text-align: justify;"><span lang="EN-US" style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">This Winter, we&rsquo;ve relaunched our Occupational English Test Courses in the Evening with OET Medicine preparation starting the season. Training from 5:30pm to 8:30pm for four days a week, our medics join experienced OET Tutors to prepare for the examination. The OET 4x4 Evening Course includes instruction and practice for all four skills (OET Listening, OET Reading, OET Speaking and OET Writing). The OET Speaking and Writing courses, in particular, include (but is not limited to) a focus on the English grammar skills that you will require in order to do well on these aspects of the examination. </span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span lang="EN-US" style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">As you may already know, the Occupational English Test is a language examination that is accepted by the General Medical Council (GMC) in order for overseas qualified medical doctors to demonstrate their English language proficiency. For the same purpose, OET exam results are also accepted by the Nursing and Midwifery Council (NMC) from overseas qualified nurses and midwives. It is a high stakes assessment that is recognized by the regulators and a requirement in order for the nurse or doctor to progress in the UK. There are various OET examination dates worldwide, either once or twice each month, providing various opportunities for our medics to take the first step in their relocation plans. </span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span lang="EN-US" style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Here at IELTS Medical, we provide OET courses for doctors and nurses in order to support your plans to move to the United Kingdom and start or restart your medical career here. </span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span lang="EN-US" style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Our OET courses begin after an OET assessment to ensure that the OET exam is the right choice for you. We then prepare for three weeks &ndash; usually towards the next upcoming OET examination. Previous attendees to our OET evening course let us know that they appreciated the out of hours support that includes exclusive OET materials, an OET preparation book, access to our OET app and effective OET instruction that will support you towards achieving the OET B-B-B-B grades required for GMC registration. </span></p>', 'Occupational English Test Courses in London in the Evening So That You Can Learn Whilst You Earn. Flexible Courses That Flex With You.', '191114122445.jpg', 1, '2019-11-14 12:24:45'),
(113, 1, 'NMC OSCE Preparation Results October', 'NMC-OSCE-Preparation', '<p><span style="font-size: 12pt;">The OSCE October results are through and we are <strong>incredibly proud</strong> of the 16 nurses who have all now sat their exams and are UK registered band 5 nurses in London, Greater London, Bedford and Glasgow. Of the 16 nurses, the learning needs of 13 of them were met by our 3-Day OSCE course that consists of APIE, OSCE Skills and an OSCE Mock Examination. The other 3 felt that they needed more support and opted for the 5-Day course which provided them with additional, more personalised 1 to 1 tuition with our Clinical Educators.&nbsp;</span></p>\r\n<p><span style="font-size: 12pt;">Nurses, regardless of your learning needs as an overseas qualified nurse, we have you covered. </span></p>\r\n<p><span style="font-size: 12pt;">For an optimal OSCE experience, we recommend that you register at least 4 weeks before your examination. We also strongly recommend that you attend the course <strong><span style="text-decoration: underline;"><em>at least</em> one week before your examination</span></strong>. This is to allow you time to deal with any issues that may be highlighted by the mock examination. It also gives you ample time to liaise with our Nursing Education Team if you have any doubts that need clarification.&nbsp;</span></p>\r\n<p><span style="font-size: 12pt;"><span style="text-decoration: underline;">What to expect here</span></span></p>\r\n<p><span style="font-size: 12pt;">We will send you a pre-course&nbsp;book when you register, giving you ample time to read and digest the information that you need to learn (that we guide you through on the online platform that we also give you access to).&nbsp;</span></p>\r\n<p><span style="font-size: 12pt;">We will give you access to our online quizzes and videos so that you can check as you go along. You can also chat to the course attendees that you will meet during the course in London.&nbsp;</span></p>\r\n<p><span style="font-size: 12pt;">Post course, we provide you with homework and support via Whatsapp and email. Should you wish to, you can also drop into our centre in the city for additional skills practice.&nbsp;&nbsp;</span></p>\r\n<p><span style="font-size: 12pt;">We have NMC OSCE courses for the following NMC OSCE Examinations:</span></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style="font-size: 12pt;">NMC OSCE Adult</span></li>\r\n<li><span style="font-size: 12pt;">NMC OSCE Mental Health</span></li>\r\n<li><span style="font-size: 12pt;">NMC OSCE Paediatrics</span></li>\r\n<li><span style="font-size: 12pt;">NMC OSCE Midwifery</span></li>\r\n</ul>\r\n<p><span style="font-size: 12pt;">For more information or to book your next OSCE Course, visit <a href="http://www.oscenurses.com" target="_blank" rel="noopener noreferrer">www.oscenurses.com</a> or call 02036376722 to speak with our Registration Executives.&nbsp;</span></p>\r\n<p><span style="font-size: 12pt;">Get NMC OSCE Prepared with us... Call 02036376722.</span></p>\r\n<p>&nbsp;</p>', 'NMC OSCE Preparation ', '191120042745.jpg', 1, '2019-11-20 16:07:43'),
(114, 1, 'It''s official, the NMC is now accepting C+ for Writing', 'NMC-lowers-writing-requirements-for-overseas-nurses', '<p style="text-align: justify;">It''s official - after a year&nbsp;of research and extensive reviews of the test, today&nbsp;the Nursing and Midwifery Council (NMC) has agreed to relax the English writing standards for international nurses wishing to work in the UK. Instead of a requirement of 350+ in the OET Writing subtest, from <strong>28 January 2020</strong>, the NMC will now accept a score of C+ or OET 300+ as satisfactory for the first (international nurses) or final (European nurses) stage of NMC registration.&nbsp;</p>\r\n<p style="text-align: justify;">The change will come into effect from 28 January 2020. Furthermore,&nbsp;<strong>OET results achieved&nbsp;after February 2018&nbsp;that meet the new requirements will also be accepted</strong>.</p>\r\n<p style="text-align: justify;">The NMC had received calls to make this decision in order to match its acceptance of the IELTS 6.5 for Writing (post November 2018), after&nbsp;its investigations into the subject revealed&nbsp;that the IELTS 6.5 is equivalent to the OET C+ grade.<br /><br />This decision is a positive step toward lowering&nbsp;a hurdle that has prevented countless numbers of international nurses from being able to accept posts within the UK healthcare system.&nbsp;</p>\r\n<p style="text-align: justify;"><a href="https://www.youtube.com/watch?v=tIeGsiSrRbk" target="_blank" rel="noopener noreferrer">Here, Christina briefly explores the decision</a>.</p>\r\n<p style="text-align: justify;">With the OET requirements now mirroring the IELTS requirements more closely, the decision as to which test suits you will require even more thought. For help making an informed decision, call the IELTS Medical team today.&nbsp;</p>\r\n<p style="text-align: justify;"><em><strong>Climb the hurdle with us... Call 02036376722!</strong></em></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">&nbsp;</p>', '', '191127040533.jpg', 1, '2019-11-27 16:05:33'),
(115, 1, 'The Mock Exam Highlighted My Weakness in OET Reading - I Knew I Had 10 Days To Turn It Around', 'oet-mock-exam-helped-me-see-my-weakness', '<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #777777; font-family: Poppins, sans-serif;" align="justify">Our first interaction with Doctor P was&nbsp;when she''d ordered a copy of our <a href="../../shop/oet-coursebook-for-doctors-the-occupational-english-test-for-gmc" target="_blank" rel="noopener noreferrer">OET Coursebook for Doctors</a> and decided that our OET for Doctors in-person course in London was the one for her. She immediately enrolled on the 3-Week Intensive In-Person London Course and started her preparation.</p>\r\n<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #777777; font-family: Poppins, sans-serif;" align="justify"><span style="text-decoration: underline;"><strong>IELTS to OET</strong></span></p>\r\n<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #777777; font-family: Poppins, sans-serif;" align="justify">Doctor P had taken the IELTS exam multiple times without success. However, as an experienced Obstetrician and Gynaecologist who is used to counselling and treating patients, Doctor P''s bedside manner was already well developed. The concepts that she came across in the Occupational English Test were familiar to her, she simply needed to know what the OET expected of her. Our goal was to show her this and help her to achieve the B-B-B-B pass on her first attempt.</p>\r\n<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #777777; font-family: Poppins, sans-serif;" align="justify"><span style="text-decoration: underline;"><strong>3-week OET Course</strong></span></p>\r\n<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #777777; font-family: Poppins, sans-serif;" align="justify">Our three week course helped Doctor P to develop her exam technique and preparedness for the OET test. The course includes OET Listening; OET Reading; OET Speaking and OET Writing and it is designed for overseas qualified doctors who have a strong command of the language. Training intensively in a small group of 4 medical professionals, Doctor P proved that she was an outstanding learner by completing all homework assignments and using any free time to learn more about the examination.&nbsp;</p>\r\n<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #777777; font-family: Poppins, sans-serif;" align="justify"><span style="text-decoration: underline;"><strong>Our OET Mock Exam</strong></span></p>\r\n<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #777777; font-family: Poppins, sans-serif;" align="justify">Each 3-week course entitles learners to automatic entry into the OET Mock exams we hold each month and Doctor P entered an examination that was just 10 days to her exam. Our OET Mock Exam results are provided within 24 hours and by simulating the conditions of the OET examination as closely as possible, we find that the mock examination has become a useful tool for highlighting any areas of concern that our medics should focus on in the real thing<span style="box-sizing: border-box; color: #808080;">.</span></p>\r\n<p class="yiv8835864294MsoNormal" style="box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px;"><span style="box-sizing: border-box; font-weight: bolder;"><em style="box-sizing: border-box;"><span style="box-sizing: border-box; font-family: arial, helvetica, sans-serif;">"<span style="box-sizing: border-box; font-size: 13.3333px; color: #000000;">I scored 3Bs and 1C in the OET mock exam - I knew that I had just 10 days to turn it around.</span>"&nbsp;</span></em></span></p>\r\n<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #777777; font-family: Poppins, sans-serif;" align="justify"><span style="box-sizing: border-box; color: #808080;">And she did: 350 in Listening (B); 380 in Reading (B); 390 in Speaking (B) and 360 in Writing (B).</span></p>\r\n<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #777777; font-family: Poppins, sans-serif;" align="justify"><span style="box-sizing: border-box; color: #808080;">We think you''re absolutely lovely Doctor&nbsp;P and look forward to seeing you again for Plab preparation here in London, UK.&nbsp;</span></p>\r\n<p class="yiv8835864294MsoNormal" style="box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; color: #1d2228; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px;"><span style="box-sizing: border-box; font-size: 10pt;"><em style="box-sizing: border-box;"><span style="box-sizing: border-box; font-weight: bolder;"><span style="box-sizing: border-box; font-family: arial, helvetica, sans-serif;">Conquer your weaknesses with us... Call 02036376722!&nbsp;</span></span></em></span></p>', 'She had tried the IELTS exam multiple times without success, but passed the OET on her first attempt. ', '191130115104.jpg', 1, '2019-11-30 11:51:04'),
(116, 4, 'Calling All Nurses - The NHS Visa Is A Top Priority', 'calling-all-nurses-nhs-visa-a-top-priority', '<p style="text-align: justify; background: #F4F4F4; margin: 0cm 0cm 14.4pt 0cm;"><span lang="EN-US" style="font-size: 11.0pt; font-family: ''Lato'',sans-serif; color: #3b3b3b; mso-ansi-language: EN-US;">Following last night&rsquo;s general election, Prime Minister Boris Johnson has reaffirmed that the NHS is a top priority for the Conservative government. </span></p>\r\n<p style="text-align: justify; background: #F4F4F4; margin: 0cm 0cm 14.4pt 0cm;"><span lang="EN-US" style="font-size: 11.0pt; font-family: ''Lato'',sans-serif; color: #3b3b3b; mso-ansi-language: EN-US;">The intention is to increase governmental investment in the NHS with a plan to recruit 50,000 more nurses over the next five years and to boost the number of GP appointments available nationwide. </span></p>\r\n<p style="text-align: justify; background: #F4F4F4; margin: 0cm 0cm 14.4pt 0cm;"><span lang="EN-US" style="font-size: 11.0pt; font-family: ''Lato'',sans-serif; color: #3b3b3b; mso-ansi-language: EN-US;">International nurses and doctors will be a large part of this goal, and a new NHS visa will be introduced in order to fast-track the process. The government has also been asked to reduce visa fees. chief executive and general secretary of the Royal College of Nursing (RCN) Dame Donna Kinnair has urged the Conservatives to axe the &lsquo;cruel&rsquo; immigration surcharge for overseas nurses as well as to ensure that workforce planning takes a more central role in the party&rsquo;s plans. </span></p>\r\n<p style="text-align: justify; background: #F4F4F4; margin: 0cm 0cm 14.4pt 0cm;"><span lang="EN-US" style="font-size: 11.0pt; font-family: ''Lato'',sans-serif; color: #3b3b3b; mso-ansi-language: EN-US;">For international nurses, our training centre offers a clear pathway to UK registration. With courses to assist with your IELTS/OET, NMC CBT and NMC OSCE, now is a wonderful time for you to consider the United Kingdom as an integral part of your professional nursing career. </span></p>\r\n<p style="text-align: justify; background: #F4F4F4; margin: 0cm 0cm 14.4pt 0cm;"><span lang="EN-US" style="font-size: 11.0pt; font-family: ''Lato'',sans-serif; color: #3b3b3b; mso-ansi-language: EN-US;">Whichever stage you are at at the moment, contact us today. </span></p>\r\n<p style="text-align: justify; background: #F4F4F4; margin: 0cm 0cm 14.4pt 0cm;"><span lang="EN-US" style="font-size: 11.0pt; font-family: ''Lato'',sans-serif; color: #3b3b3b; mso-ansi-language: EN-US;">Ana<br /> Account Executive (Nursing)</span></p>\r\n<p style="text-align: justify; background: #F4F4F4; margin: 0cm 0cm 14.4pt 0cm;"><strong><em><span lang="EN-US" style="font-size: 11.0pt; font-family: ''Lato'',sans-serif; color: #3b3b3b; mso-ansi-language: EN-US;">Make the UK your 2020 destination&hellip; Call 02036376722!</span></em></strong></p>', 'calling-all-nurses-nhs-visa-a-top-priority', '191213115529.jpg', 1, '2019-12-13 11:55:29'),
(117, 1, 'NMC OSCE Practice Rooms - After Course Care', 'free-nmc-osce-practice-rooms', '<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">After the NMC OSCE 3-Day Course, we recommend that you give yourself at least one week to rehearse what you have learned during the course. This is because there are a lot of steps that you need to master before you take your OSCE examination. But wait... This presumes that you''ve started your preparation at least three weeks before the course and that you''re familiar with the pre-course material and the documentation beforehand. The course includes consolidation of OSCE APIE and OSCE Skills on day 1 and day 2. On the third day, we provide you with an OSCE Mock Examination so that you know where you are in time for the big day. So what can you do between the Mock Examination and the real thing? Well, if you live in or near London, then we''ve got something extra for you.&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="text-decoration: underline; font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>Our Practice Room&nbsp;</strong></span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">With stations set up for use for nurses on our courses. You can book access to our Practice Rooms within 24 hours'' notice. The room includes the stations and equipment that you need for your rehearsal, meaning that you can enhance and make the best use of your practice time. No more creating dummies out of pillows or injecting oranges and other citrus fruits... Use state of the art equipment to enhance your learning.&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><em><strong>Get practicing in a room with us... Call 02036376722.</strong></em></span></p>', 'free-nmc-osce-practice-rooms', '191222090100.jfif', 1, '2019-12-22 21:01:00'),
(118, 1, 'Merry Christmas and a Happy New Year', 'Merry-Christmas-and-a-Happy-New-Year', '', 'Merry Christmas and a Happy New Year', '191224091326.png', 1, '2019-12-24 09:13:26'),
(119, 1, 'Time for NMC OSCE ', 'time-for-nmc-osce', '<p><a title="NMC OSCE Time" href="https://youtu.be/WsbMs7eXzvw" target="_blank" rel="noopener noreferrer">NMC OSCE Time</a><br /><br />Are you ready to pass your NMC OSCE the first time? Here at IELTS Medical, our 3-Day and 5-Day Courses ensure that you do.&nbsp;<br /><br /><em><strong>Get ready for&nbsp;OSCE Time With Us... Call 02036276722!</strong></em></p>', '>Are you ready to pass your NMC OSCE the first time? Here at IELTS Medical, our 3-Day and 5-Day Courses ensure that you do.', '200105065137.png', 1, '2020-01-05 18:51:37'),
(120, 1, 'Why Would A Nurse Choose The IELTS Exam?', 'Why-Would-A-Nurse-Choose-The-IELTS-Exam', '<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Since October 2019, international healthcare professionals have only needed one test for their regulators (<a title="GMC for&nbsp;Doctors" href="https://www.gmc-uk.org/concerns/information-for-doctors-under-investigation/english-language-assessments" target="_blank" rel="noopener noreferrer">GMC for&nbsp;Doctors</a>&nbsp;and&nbsp;<a title="NMC for Nurses and Midwives" href="https://www.nmc.org.uk/registration/joining-the-register/english-language-requirements/accepted-tests/" target="_blank" rel="noopener noreferrer">NMC for Nurses and Midwives</a>) and to satisfy the English language requirements for their Tier 2 visa application for the UK. This test can either be the IELTS or the OET. On our&nbsp;<a title="YouTube Channel" href="https://www.youtube.com/c/ieltsmedicalltd" target="_blank" rel="noopener noreferrer">YouTube Channel</a>, we''ve discussed the differences between the two at length and in this update, we''d like to explore why the IELTS&nbsp;route is still a great choice for nurses. You see the IELTS is a widely used and highly regarded Cambridge English exam and it is highly academic. Like most academic exams, it requires you to demonstrate a breadth of knowledge and some familiarity with politics, economics, history and anthropology. This ability to access this range of subject matter would be undoubtedly helpful in an English-speaking country, especially because it makes it easier for you to be able to connect with your patients on topics outside of their diagnosis and care.&nbsp;This ideal is reinforced in your requirements. For example, the text for IELTS Reading come from a wide range of sources like books, journals, magazines and (usually centre-left or left wing) newspapers. The topics are all non-specialist and the texts may be descriptive or discursive. When engaging with these texts or responding to a question that requires you to elaborate on your opinion or point of view in English, you are &ndash; by necessity &ndash; building your skills in the language and learning to express yourself. These are skills that will undoubtedly serve you well as you interact with your patients, colleagues and friends as you build your nursing career here in the UK. As you specialise in healthcare, your depth of healthcare knowledge and Medical English will continue to grow. This needn&rsquo;t, however, come at the expense of the neglect of your knowledge outside of your specialist field of interest. The IELTS is a vehicle for pursuit of a plethora of information across a variety of subjects that will likely assist in helping you become a more well-rounded person and practitioner.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;"><strong><em>Expand your horizons with us... Call 02036376722!</em></strong></span></p>', 'Why Would A Nurse Choose The IELTS Exam? Now that the Government has accepted the IELTS Academic, OET and IELTS UKVI as proof of English language proficiency for immigration - is IELTS still the right choice?', '200119023601.png', 1, '2020-01-19 14:36:01'),
(121, 1, 'Our OET Apps Are Being Updated', 'oet-for-doctors-app', '<p style="text-align: justify;"><img src="../../img/blog/oet-app-introduce-yourselves.PNG" alt="OET App Feature Group Exams" width="300" height="535" align="left" /><span style="font-family: arial, helvetica, sans-serif;"><strong>Our OET for Nurses and OET for Doctors Apps</strong>&nbsp;are being downloaded at a fantastic speed and we''re glad to hear that you''re&nbsp;finding it easier to access the services that you require using them. Two new features have launched onto the Andriod version, with the iOS version''s update not far behind. Those features are Introduce Yourself and Group Exam Bookings.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">As you know, we work with NHS Trusts and Private Healthcare Organisations that would be happy to meet you. Our OET Apps now allow you to meet them. Using the Introduce Yourself feature, you can provide video answers to questions our Trusts commonly ask during interviews. You can now send your answers to our Trust and Private Healthcare partners helping us to help you make a connection.&nbsp;</span></p>\r\n<p style="text-align: justify;"><span style="font-family: arial, helvetica, sans-serif;">Take a look for yourself using the Introduce Yourself feature.</span>&nbsp;</p>\r\n<p style="text-align: justify;"><a href="https://apps.apple.com/us/app/oet-medicine-app-for-doctors/id1467042015?ls=1" target="_blank" rel="noopener noreferrer">OET for Doctors iOS</a>.</p>\r\n<p style="text-align: justify;"><a href="https://play.google.com/store/apps/details?id=com.oetdoctor" target="_blank" rel="noopener noreferrer">OET for Doctors Android</a>.</p>\r\n<p style="text-align: justify;"><a href="https://apps.apple.com/us/app/oet-nursing-app-for-nurses/id1465290168?ls=1" target="_blank" rel="noopener noreferrer">OET for Nurses iOS</a>.</p>\r\n<p style="text-align: justify;"><a href="https://play.google.com/store/apps/details?id=com.oetnurses" target="_blank" rel="noopener noreferrer">OET for Nurses Andriod</a>.</p>\r\n<p style="text-align: justify;"><em><strong>Get mobile with us... Call 02036376722!</strong></em></p>', 'Our OET for Nurses and OET for Doctors app allows you to connect to NHS Trust employers and Private Healthcare employers who would like to meet you. Download today.', '200125010600.jpg', 1, '2020-01-25 13:06:00');
