(1, 'CBT for Midwives – the Complete Guide – Book and Mock Test License', '190905115427.png', '', 'cbt-nurses-complete-guide-book-mock-test-license-midwifery-edition', '<p align="justify">CBT for Midwives &ndash; for NMC Registration</p>\r\n<p align="justify">Includes Tips | Model Answers |&nbsp;Mock Exam Questions</p>\r\n<p align="justify"><strong><span style="color: #808080;">ISBN:&nbsp;978-1-97819162105-0-9</span></strong></p>\r\n<p align="justify">In order to succeed in the NMC&rsquo;s CBT; the theory test of competence, overseas qualified midwives need to know exactly what the NMC expects from the first stage of their Test of Competence.</p>\r\n<p align="justify">This second stage of NMC registration for overseas qualified midwives, is a computer-based multiple choice test. The test measures applicants against current pre-registration education standards and consists of 120 multiple-choice questions. The questions are scored as either correct or incorrect and no partial credit is provided. The test assesses the essential professional knowledge, skills and attitudes required for safe and effective nursing practice in the UK. This book is a guide specifically to the Midwifery CBT. The guide consolidates the four parts of the CBT for a Midwifery applicant.</p>\r\n<p align="justify"><strong>Our guide features:</strong></p>\r\n<p align="justify">&middot; Key revision material of the essential facts and best practice.</p>\r\n<p align="justify">&middot; Advice on how to tackle NMC&rsquo;s CBT exam.</p>\r\n<p align="justify">&middot;&nbsp;360&nbsp;practice questions.</p>\r\n<p align="justify">&middot;&nbsp;Advice from CBT passers.</p>\r\n<p align="justify">&middot; Common errors to avoid and top tips for exam success.</p>', '44.97', '', '', '', 'Book', '', '', '', '', '', '', '', '', '', '', '', '2019-09-05 10:58:08'),
(2, 'CBT for Nurses - the Complete Guide - Book and Mock Test Licence - Adult Edition', '190905115435.jpg', '', 'cbt-for-nurses-adult-edition', '<p align="justify">CBT for Nurses&nbsp;&ndash; for NMC Registration &ndash; Adult Edition</p>\r\n<p align="justify">Includes Tips | Model Answers |&nbsp;Mock Exam Questions</p>\r\n<p align="justify"><strong><span style="color: #808080;">ISBN:&nbsp;978-1-9164827-2-2</span></strong></p>\r\n<p align="justify">In order to succeed in the NMC&rsquo;s CBT; the theory test of competence, overseas qualified nurses need to know exactly what the NMC expect from the first stage of their Test of Competence.</p>\r\n<p align="justify">This second stage of NMC registration for overseas qualified nurses, is a computer-based multiple choice test. The test measures applicants against current pre-registration education standards and consists of 120 multiple-choice questions. The questions are scored as either correct or incorrect and no partial credit is provided. The test assesses the essential professional knowledge, skills and attitudes required for safe and effective nursing practice in the UK. This book is a guide specifically to the Adult Nursing CBT. The guide consolidates the four parts of the CBT for an Adult Nursing applicant.</p>\r\n<p align="justify"><strong>Our guide features:</strong></p>\r\n<p align="justify">&middot; Key revision material of the essential facts and best practice.</p>\r\n<p align="justify">&middot; Advice on how to tackle NMC&rsquo;s CBT exam.</p>\r\n<p align="justify">&middot; 120&nbsp;practice questions.</p>\r\n<p align="justify">&middot;&nbsp;Advice from CBT passers.</p>\r\n<p align="justify">&middot; Common errors to avoid and top tips for exam success.</p>', '44.97', '', '', '', 'Book', '', '', '', '', '', '', '', '', '', '', '', '2019-09-05 10:59:05'),
(3, 'Full OET Medicine Set includes Complete Guide + Guides for Each Individual Skill – Books and DVDs', '190905115441.png', '', 'full-oet-medicine-materials-set', '<p><strong>Full OET Medicine Set includes Complete Guide + Guides for Each Individual Skill &ndash; Books and DVDs</strong></p>\r\n<p>Set includes:</p>\r\n<p><span style="text-decoration: underline;"><strong>OET Complete Coursebook for Doctors&nbsp; &ndash; Book &amp; DVD</strong> (</span><strong>ISBN: 978-1-9164827-6-0</strong>)</p>\r\n<p align="justify"><strong><span style="text-decoration: underline;">OET (Medicine)&nbsp;Writing Guide</span>&nbsp;</strong>(<strong>ISBN: </strong>)</p>\r\n<p align="justify"><strong><span style="text-decoration: underline;">OET (Medicine) Speaking Guide &ndash; Book &amp; DVD</span> (ISBN: )</strong></p>\r\n<p align="justify"><strong><span style="text-decoration: underline;">OET (All Professions) Listening Guide volume II &ndash; Book &amp; DVD</span> (ISBN: )</strong></p>\r\n<p align="justify"><strong><span style="text-decoration: underline;">OET (All Professions) Reading Guide v2 (ISBN: )</span></strong></p>\r\n<p align="justify"><strong>Over 72&nbsp;hours of exclusive OET content.</strong></p>\r\n<p align="justify">Save 10% off the RRP &pound;174.85</p>', '157.37', '', '', '', 'Book', '', '', '', '', '', '', '', '', '', '', '', '2019-09-05 11:00:09'),
(4, 'Full OET Nursing Set 2 includes Complete Guide + Guides for Each Individual Skill – Books and DVDs', '190905115448.png', '', 'full-oet-nursing-set-includes-complete-guide-guides-for-each-individual-skill-books-and-dvds', '<p><strong>Full OET Nursing Set 2 includes Complete Guide + Guides for Each Individual Skill &ndash; Books and DVDs</strong></p>\r\n<p>Set includes:</p>\r\n<p><span style="text-decoration: underline;"><strong>OET Complete Coursebook for Nurses &ndash; Book &amp; DVD</strong> (</span><strong>ISBN: 978-1-9164827-7-7</strong>)</p>\r\n<p align="justify"><strong><span style="text-decoration: underline;">OET (Nursing) Writing Guide v 2</span>&nbsp;</strong>(<strong>ISBN: </strong>)</p>\r\n<p align="justify"><strong><span style="text-decoration: underline;">OET (Medicine) Speaking Guide 2 &ndash; Book &amp; DVD</span> (ISBN: )</strong></p>\r\n<p align="justify"><strong><span style="text-decoration: underline;">OET (All Professions) Listening Guide V2 &ndash; Book &amp; DVD</span> (ISBN: )</strong></p>\r\n<p align="justify"><strong><span style="text-decoration: underline;">OET (All Professions) Reading Guide v2 (ISBN: )</span></strong></p>\r\n<p align="justify"><strong>Over 72&nbsp;hours of OET content.</strong></p>\r\n<p align="justify">Save 10% off the RRP &pound;174.85</p>', '157.37', '', '', '', 'Book', '', '', '', '', '', '', '', '', '', '', '', '2019-09-05 11:01:03'),
(5, 'OET (All Professions) Listening Guide Refresh 2.0 Volume II – Book and Audio CD', '190905115455.jpg', '', 'oet-professions-listening-guide-refresh-2-0-volume-ii-book-dvd', '<p align="justify">OET (All Professions) Listening Guide Refresh 2.0 &ndash; The Occupational English Test for GMC and NMC Registration</p>\r\n<p align="justify">Includes Tips | Model Answers |&nbsp;Test Questions</p>\r\n<p align="justify"><span style="color: #808080;"><strong>ISBN:&nbsp;978-1-9995930-9-4<br /> </strong></span></p>\r\n<p align="justify">In order to succeed in the Listening section of the new version of the OET 2.0 exam, overseas qualified healthcare professionals need to be able to quickly understand what they hear and complete various tasks in time with the fast paced audio.</p>\r\n<p align="justify">This requires knowing how to master the skill of listening, reading and writing English as quickly as possible. This book is&nbsp;the second in our series of guides&nbsp;to Listening section of the Occupational English Test version 2.0. It contains clear instructions, practice questions and&nbsp;5 brand new model tests designed to help you pass your OET. The OET Listening Guide &ndash; all professions volume II is for&nbsp;professionals from any of the twelve OET professions. The guide is produced by IELTS Medical, a training centre for healthcare professionals. Our writers and editors are NHS medical and healthcare&nbsp;staff experienced in preparing overseas qualified&nbsp;healthcare professionals for the Occupational English Test (OET). Together we have produced a&nbsp;second, up-to-date guide on the listening section of OET version 2.0 to assist&nbsp;all OET candidates at the start of their OET preparation.</p>\r\n<p align="justify"><strong>Our guide features:</strong></p>\r\n<p align="justify">&middot; Key revision material of the essential facts and best practice.</p>\r\n<p align="justify">&middot; Advice on how to tackle the OET&nbsp;Listening section.</p>\r\n<p align="justify">&middot;&nbsp;5 x brand new OET 2.0 Listening tests.</p>\r\n<p align="justify">&middot;&nbsp;Audio CD.</p>\r\n<p align="justify">&middot;&nbsp;Marking&nbsp;criteria.</p>\r\n<p align="justify">&middot; Common errors to avoid and top tips for exam success.</p>', '34.97', '', '', '', 'Book', '', '', '', '', '', '', '', '', '', '', '', '2019-09-05 11:02:21'),
(6, 'OET (All Professions) Reading Guide Refresh 2.0 – Book', '190905115504.jpg', '', 'oet-medicine-reading-guide-refresh-2-0-book', '<p align="justify">OET (All Professions) Reading Guide Refresh 2.0 &ndash; The Occupational English Test for GMC</p>\r\n<p align="justify">Includes Tips | Model Answers |&nbsp;Test Questions</p>\r\n<p align="justify"><span style="color: #808080;"><strong>ISBN: 978-1-9164827-0-8<br /> </strong></span></p>\r\n<p align="justify">In order to succeed in the&nbsp;Reading section of the new version of the OET&nbsp;Medicine&nbsp;exam, overseas qualified&nbsp;healthcare professionals need to be able to&nbsp;use a variety of reading skills to answer a variety of question types.</p>\r\n<p align="justify">This requires knowing how to demonstrate speed reading, reading for gist, reading for details and reading comprehension to your assessors. This book is a complete guide to the&nbsp;reading section of the Occupational English Test version 2.0. It contains clear instructions,&nbsp;practice questions and&nbsp;10 model&nbsp;tests to help you pass your OET. The OET (All Professions)&nbsp;Reading Guide is for any member of the 12 OET professions and is produced by IELTS Medical, a training centre for healthcare professionals. Our writers and editors are NHS medical and healthcare professionals experienced in preparing overseas qualified&nbsp;healthcare professionals&nbsp;for the Occupational English Test (OET). Together we have produced an up-to-date guide on the&nbsp;reading section of OET version 2.0 to assist&nbsp;healthcare professionals at the start of their OET preparation.</p>\r\n<p align="justify"><strong>Our guide features:</strong></p>\r\n<p align="justify">&middot; Key revision material of the essential facts and best practice.</p>\r\n<p align="justify">&middot; Advice on how to tackle the OET Reading&nbsp;section.</p>\r\n<p align="justify">&middot; 10 OET&nbsp;Reading tests.</p>\r\n<p align="justify">&middot; Model&nbsp;reading techniques.</p>\r\n<p align="justify">&middot;&nbsp;Marking&nbsp;criteria.</p>\r\n<p align="justify">&middot; Common errors to avoid and top tips for exam success.</p>', '29.97', '', '', '', 'Book', '', '', '', '', '', '', '', '', '', '', '', '2019-09-05 11:03:22'),
(7, 'OET Coursebook for Doctors – The Occupational English Test for GMC', '190905115511.png', '', 'oet-coursebook-for-doctors-the-occupational-english-test-for-gmc', '<p align="justify"><strong>OET Coursebook for Doctors &ndash; The Occupational English Test for GMC</strong></p>\r\n<p align="justify">Includes Skill Building Activities | Model Answers | Grammar Boosters | Practice Questions</p>\r\n<p align="justify"><span style="color: #808080;"><strong>ISBN: 978-1-9164827-6-0</strong></span></p>\r\n<p align="justify">Whilst preparing for the Occupational English test (OET), international doctors need to know the best strategies for improving their language skills in order to pass this exam. Based on the strategies that have seen many international doctors gain the grades they required for registration, this book takes a fresh approach to the OET examination and has been produced in order to <em><strong>remedy</strong></em> much of the misinformation surrounding this practical examination.</p>\r\n<p align="justify"><span style="text-decoration: underline;"><strong>Our guide includes</strong></span></p>\r\n<p align="justify">&middot; Skill building activities</p>\r\n<p align="justify">&middot; Practice questions</p>\r\n<p align="justify">&middot; Explanations and answer deconstructions</p>\r\n<p align="justify">&middot; Model answers for Speaking and Writing</p>\r\n<p align="justify">&middot; Marking criteria mapping</p>\r\n<p align="justify">&middot; Common errors to avoid and top tips for exam success.</p>\r\n<p align="justify">&middot; Additional&nbsp; material including videos of mock Speaking interviews.</p>\r\n<p align="justify">&middot; Suggested reading</p>\r\n<p align="justify">with everything collated to help you reach grade B and beyond in OET (Medicine).</p>', '39.97', '', '', '', 'Book', '', '', '', '', '', '', '', '', '', '', '', '2019-09-05 11:05:55'),
(8, 'OET Coursebook for Nurses – The Occupational English Test for NMC', '190905115517.png', '', 'oet-coursebook-for-nurses-the-occupational-english-test-for-nmc', '<p align="justify"><strong>OET Coursebook for Nurses &ndash; The Occupational English Test for NMC</strong></p>\r\n<p align="justify">Includes Skill Building Activities | Model Answers | Grammar Boosters | Practice Questions</p>\r\n<p align="justify"><span style="color: #808080;"><strong>ISBN: 978-1-19164827-7-7</strong></span></p>\r\n<p align="justify">Whilst preparing for the Occupational English test (OET), international nurses need to know the best strategies for improving their language skills in order to pass this exam. Based on the strategies that have seen many international nurses gain the grades they required for registration, this book takes a fresh approach to the OET examination and has been produced in order to <em><strong>remedy</strong></em> much of the misinformation surrounding this practical examination.</p>\r\n<p align="justify"><span style="text-decoration: underline;"><strong>Our guide includes</strong></span></p>\r\n<p align="justify">&middot; Skill building activities</p>\r\n<p align="justify">&middot; Practice questions</p>\r\n<p align="justify">&middot; Explanations and answer deconstructions</p>\r\n<p align="justify">&middot; Model answers for Speaking and Writing</p>\r\n<p align="justify">&middot; Marking criteria mapping</p>\r\n<p align="justify">&middot; Common errors to avoid and top tips for exam success.</p>\r\n<p align="justify">&middot; Additional&nbsp; material including videos of mock Speaking interviews.</p>\r\n<p align="justify">&middot; Suggested reading</p>\r\n<p align="justify">with everything collated to help you reach grade B and beyond in OET (Nursing).</p>', '39.97', '', '', '', 'Book', '', '', '', '', '', '', '', '', '', '', '', '2019-09-05 11:07:14'),
(10, 'OET (Nursing) Speaking Guide for Nurses 2 - Remedy 2.0', '190921111917.png', '', 'oet-nursing-speaking-guide-for-nurses-2-remedy', '<p align="justify"><strong>OET (Nursing) Speaking Guide for Nurses 2</strong></p>\r\n<p align="justify">Includes explanations of the marking criteria | practice roleplay cards&nbsp;| model video responses with transcripts</p>\r\n<p align="justify"><span style="color: #808080;"><strong>ISBN: 978-1-9162105-5-4 </strong></span></p>\r\n<p align="justify">Whilst preparing for the Occupational English test (OET), international nurses need to be able to understand what is expected of you in terms of OET communication. Nurses'' "bedside manner" is very important in practice, and the OET assesses your English speaking ability, competency and efficacy. This guide - therefore - assists you with improving all three.</p>\r\n<p align="justify"><span style="text-decoration: underline;"><strong>Our guide includes</strong></span></p>\r\n<p align="justify">&middot; Skill building activities</p>\r\n<p align="justify">&middot; Speaking videos</p>\r\n<p align="justify">&middot; Critique of each performance</p>\r\n<p align="justify">&middot; 10 x practice roleplays for you to try</p>\r\n<p align="justify">&middot; Marking criteria mapping</p>\r\n<p align="justify">&middot; Common errors to avoid and top tips for exam success</p>\r\n<p align="justify">&middot; Suggested viewing</p>\r\n<p align="justify">with everything collated to help you reach grade B and beyond in the speaking section of OET (Nursing).</p>', '34.97', '', '', '', 'Book', 'False', 'False', '9781916210554', 'Whilst preparing for the Occupational English test (OET), international nurses need to be able to understand what is expected of you in terms of OET communication. Nurses'' "bedside manner" is very important in practice, and the OET assesses your English speaking ability, competency and efficacy. This guide - therefore - assists you with improving all three.', 'Yes', 'Books', 'IELTS Medical London', '', '', 'Yes', 'New', '2019-09-21 11:15:35'),
(11, 'OET (Medicine) Speaking Guide for Doctors 2 - Remedy 2.0', '190921113940.png', '', 'oet-medicine-speaking-guide-for-doctors-2-remedy', '<p align="justify"><strong>OET (Medicine) Speaking Guide for&nbsp;Doctors 2</strong></p>\r\n<p align="justify">Includes Explanations of the marking criteria | Practice&nbsp;Roleplay Cards&nbsp;| Model Video Responses with Transcripts</p>\r\n<p align="justify"><span style="color: #808080;"><strong>ISBN: 978-1-9162105-6-1</strong></span></p>\r\n<p align="justify">Whilst preparing for the Occupational English test (OET), international&nbsp;doctors need to be able to understand what is expected of you in terms of OET communication. Doctors'' "bedside manner" is very important in practice, and the OET assesses your English speaking ability, competency and efficacy. This guide - therefore - assists you with improving all three.</p>\r\n<p align="justify"><span style="text-decoration: underline;"><strong>Our guide includes</strong></span></p>\r\n<p align="justify">&middot; Skill building activities</p>\r\n<p align="justify">&middot; Speaking videos</p>\r\n<p align="justify">&middot; Critique of each performance</p>\r\n<p align="justify">&middot; 10 x practice roleplays for you to try</p>\r\n<p align="justify">&middot; Marking criteria mapping</p>\r\n<p align="justify">&middot; Common errors to avoid and top tips for exam success</p>\r\n<p align="justify">&middot; Suggested viewing</p>\r\n<p align="justify">with everything collated to help you reach grade B and beyond in the speaking section of OET (Medicine).</p>', '34.97', '', '', '', 'Book', 'False', 'False', '9781916210561', 'Whilst preparing for the Occupational English test (OET), international doctors need to be able to understand what is expected of you in terms of OET communication. Doctors'' "bedside manner" is very important in practice, and the OET assesses your English speaking ability, competency and efficacy. This guide - therefore - assists you with improving all three.', 'Yes', 'Books', 'IELTS Medical London', '', '', 'Yes', 'New', '2019-09-21 11:36:53'),
(12, 'OET (Medicine) Writing Guide for Doctors 2', '190924024322.png', '', 'oet-medicine-writing-guide-for-doctors-2-remedy', '<p align="justify"><strong>OET (Medicine)&nbsp;Writing&nbsp;Guide for Doctors 2</strong></p>\r\n<p align="justify">Includes explanations of the marking criteria | practice case notes |&nbsp;model answers</p>\r\n<p align="justify"><span style="color: #808080;"><strong>ISBN: 978-1-9162105-4-7</strong></span></p>\r\n<p align="justify">Whilst preparing for the Occupational English test (OET), international doctors need to be able to understand what is expected of you in terms of writing a referral, transfer or discharge letter to a colleague or other medical professional. Your ability to select case notes will be tested, as well as your language competence when producing the letter. Written communication very important in practice, and the OET assesses your English writing ability, competency and efficacy. This guide - therefore - assists you with improving all three.</p>\r\n<p align="justify"><span style="text-decoration: underline;"><strong>Our guide includes</strong></span></p>\r\n<p align="justify">&middot; Skill building activities</p>\r\n<p align="justify">&middot; 20 x case notes for OET Medicine for you to try</p>\r\n<p align="justify">&middot;&nbsp;Model letters</p>\r\n<p align="justify">&middot; Marking criteria mapping</p>\r\n<p align="justify">&middot; Common errors to avoid and top tips for exam success</p>\r\n<p align="justify">with everything collated to help you reach grade B and beyond in the&nbsp;writing section of OET&nbsp;(Medicine).</p>', '29.97', '', '', '', 'Book', 'False', 'False', '9781916210547', '', 'Yes', 'Books', 'IELTS Medical London', '', '', 'Yes', 'New', '2019-09-21 12:51:59'),
(13, 'OET (Nursing) Writing Guide for Nurses 2', '190922065912.png', '', 'oet-nursing-writing-guide-for-nurses-2-remedy', '<p>&nbsp;<strong>OET (Nursing)&nbsp;Writing&nbsp;Guide for Nurses 2</strong></p>\r\n<p align="justify">Includes explanations of the marking criteria | practice case notes |&nbsp;model answers</p>\r\n<p align="justify"><span style="color: #808080;"><strong>ISBN: 978-1-9162105-3-0</strong></span></p>\r\n<p align="justify">Whilst preparing for the Occupational English test (OET), international nurses&nbsp;need to be able to understand what is expected of you in terms of writing a referral, transfer or discharge letter to a colleague or other&nbsp;healthcare professional. Your ability to select case notes will be tested, as well as your language competence when producing the letter.&nbsp;Written communication&nbsp;very important in practice, and the OET assesses your English&nbsp;writing&nbsp;ability, competency and efficacy. This guide - therefore - assists you with improving all three.</p>\r\n<p align="justify"><span style="text-decoration: underline;"><strong>Our guide includes</strong></span></p>\r\n<p align="justify">&middot; Skill building activities</p>\r\n<p align="justify">&middot; 20 x case notes for OET&nbsp;Nursing for you to try</p>\r\n<p align="justify">&middot;&nbsp;Model letters</p>\r\n<p align="justify">&middot; Marking criteria mapping</p>\r\n<p align="justify">&middot; Common errors to avoid and top tips for exam success</p>\r\n<p align="justify">with everything collated to help you reach grade B and beyond in the&nbsp;writing&nbsp;section of OET&nbsp;(Nursing).</p>', '29.97', '', '', '', 'Book', 'False', 'False', '9781916210530', '', 'Yes', 'Books', 'IELTS Medical London', '', '', 'Yes', 'New', '2019-09-21 12:55:54'),
(15, 'OET (All Professions) Reading Guide Volume 2 ', '191030025547.png', '123456', 'OET-All Professions-Reading-Guide-Volume-2', '<p>In order to succeed in the reading section of the OET, overseas qualified healthcare professionals need to know what the OET involves and how to improve their skills to the level required by the test. This book is a complete guide to the new version of the reading section of the OET examination. It contains clear instructions, practice questions and is tips on recommended reading resources.&nbsp;</p>\r\n<p>OET Reading Guide for all professions volume II&nbsp; is produced by IELTS Medical, a training centre for healthcare professionals based in London, United Kingdom. Our editorial team includes NHS medical and healthcare professionals experienced in preparing overseas qualifed healthcare professionals for the Occupational English Test (OET) version 2.0. Together, we have produced an up-to-date guide on the OET Reading subtest version 2.0 to assist you at the start of your OET preparation. The guide includes:</p>\r\n<p>&nbsp;</p>\r\n<p>&bull; Key revision material of the essential facts and best practice.</p>\r\n<p>&bull; Advice on how to tackle the current version of OET Reading.</p>\r\n<p>&bull; Tips for navigating your revision.&nbsp;&nbsp;</p>\r\n<p>&bull; Advice on how to handle the time pressured OET Reading part A.&nbsp;</p>\r\n<p>&bull; Common errors to avoid and top tips for exam success.</p>\r\n<p>&bull; Suggested reading.&nbsp;</p>\r\n<p>Everything in this book has been collated&nbsp; to help you reach grade B and beyond in the OET Reading subtest.</p>', '29.97', '', '', '9781916210523', 'Book', '', '', '', 'In order to succeed in the reading section of the OET, overseas qualified healthcare professionals need to know what the OET involves and how to improve their skills to the level required by the test. This book is a complete guide to the new version of the reading section of the OET examination. It contains clear instructions, practice questions and is tips on recommended reading resources. ', 'Yes', 'Books', 'IELTS Medical London', '', '', '', 'New', '2019-10-30 14:54:54'),
