(146, 'NMC OSCE London hospital review and training - 3 day course (Jan 2)', 0, 'Our outstanding Senior-Nurse Led OSCE Course includes access to an informative pre-course book, access to an Online Portal featuring an ever-expanding library full of theory, videos, quizzes, hints & tips, links to our iOS and Android mobile applications and an in person, in-hospital OSCE course. A combination that is sure to see you through to a 1st time NMC OSCE pass.', '2020-01-22', '2020-01-24', '0000-00-00', '09:00 - 17:00', 'Guys Hospital, SE1 9RT', '485', 'OSCE', 'Course', '', '2019-12-02 16:41:16'),
(147, 'IELTS Academic for Healthcare Professionals (3-weeks)', 0, 'Our IELTS Training has helped many doctors and nurses through to the grades they require to prove their English language competency to the GMC and NMC. Led by IELTS Academic trained Native English Speaking Teachers who have seen many IELTS test takers through to high band scores, each course begins with an realistic assessment of your prospects with this examination. You will also receive access to an Online Portal featuring an ever-expanding library full of theory, videos, quizzes, hints & tips, links to our iOS and Android mobile applications and, of course, the in-person course.', '2020-01-13', '2020-01-30', '0000-00-00', '10:00 - 15:00', 'Centre', '692', 'OET', 'Course', '', '2019-12-16 20:32:28'),
