(170, 'NMC CBT UK Review and Training includes CBT Materials - 4 day course (Feb)', 0, 'Includes a full theory and refresher of the key areas of study of the NMC CBT examination, advice from previous test takers and a full mock examination during the morning of day 4, with a review of the results in the afternoon. All candidates will receive a copy of all materials and a copy of the book and complete guide that contains an additional mock examination.', '2020-02-06', '2020-02-09', '0000-00-00', '09:00 - 17:00', 'Centre, W1H 6BS', '349.97', 'NMC CBT', 'Course', '', '2019-12-23 19:55:03'),
(171, 'OET Training and Review in Person Course (Dec)', 0, 'Our OET Training is led in-person in London by OET trained Native English Speaking Teachers who have seen many OET test takers through to a first time pass. Each course includes a copy of the OET Complete Coursebook for your profession as well as access to an Online Portal featuring an ever-expanding library full of theory, videos, quizzes, hints & tips, links to our iOS and Android mobile applications and, of course, the in person course.', '2020-12-07', '2020-12-24', '0000-00-00', '10:00 - 15:00', 'Centre, W1H 6BS', '692.00', 'OET', 'Course', '', '2019-12-23 20:11:03'),
