(17, 'Brodie ', 'Claxton', 'brodieclaxton@hotmail.com', 'Feedback for Children''s OSCE NMC course:\r\n(Overall I just felt the amount of self directed learning I was required to do, the amount of paperwork I needed to supply and amount I needed to adapt that this wasn’t a children nursing specific course as promised for NMC OSCE preparation.)\r\nPlease find an email about my experience in the Children’s OSCE course.\r\n- I was in a course with the rest of nurses being adult nurses\r\n- Adult course was taught with add ins about how children are different\r\n- While I had a children’s book - all other paperwork handed out was in regards to adults - I had no practice scenarios pre-made for me for the APIE stations\r\n- While the Children’s nurse from IELTS was very knowledgable it was evident she had not prepared someone for the Children’s NMC OSCE before - she tried to help me writing me three scenarios to practice which were helpful - however they were not on the NMC paperwork or the OSCE framework that the adult nurse were provided with.\r\n- No equipment for paediatrics (no paediatric bag valve masks) - no scenarios for paediatric patients for any skill stations\r\n- On last day I had to email the scenario from Oxford Brookes to IELTS to print so I could practice a scenario in the format from the OSCE\r\n- No Children’s Nurse on last day - therefore adult nurses marking OSCE\r\n- I was taught that my OSCE would be the same as adult format - I realised on day two that my format was different (through looking through NMC paperwork). My OSCE consisted of different paperwork for Assessment section and no observations required. I realised that the four skill stations were physiological observations, subcutaneous injection, catheter removal and paediatric BSL. Therefore I had learnt skills that I did not need for the OSCE (ANTT, IM etc.) when I could have focussed on what I would be assessed on. I also had not practiced skills I would be assessed on with the correct paperwork. I’ll\r\n- I did a large amount of self directed learning, supplying my own materials and having to adapt the adults material to children based that should not have occurred.\r\n- During learning about Assessment there were no children’s observation charts provided - I had to provide my own\r\n- Overall the course was for adult nurses trying to add a paediatric spin which doesn’t work - children’s nursing is different to adult nursing which is why the NMC seperate the two.\r\n- The ladies who ran the training course were lovely - it just wasn’t designed to deliver what it promised which was a paediatric OSCE preparation course and there was not as much support as for the adult nurses.\r\n- Brodie Claxton\r\n', '2019-09-17 12:50:31'),
(18, 'Ashlie', 'Lopez', 'ashlielopez93@gmail.com', 'Hi,\r\n\r\nI’m a long time reader.\r\n\r\nI’m writing to you because I’d love to contribute a guest post to your website.\r\n\r\nI’ve been brainstorming some topics and I think your readers would get a ton of value from them.\r\nI’ll make sure the piece is filled with information that can’t be found anywhere else. In exchange, all i expect is a backlink from within the main body of the article.\r\n\r\nDo let me know if you like this proposal and if I can begin sending you some topic ideas.\r\n\r\nSincerely,\r\n\r\nAshlie Lopez', '2019-09-18 15:37:43'),
(19, 'Rebecca', 'Sharp', 'rebeccasharp2193@gmail.com', 'Hi There\r\nIm trying to book the 3 day OSCE training day on the 7/10-9/10 however when it says pick a location there is no drop down menu to choose from. Im wanting to do it in London at Guy''s/St Thomas''s \r\nAre you able to help as I would like to book ASAP\r\n\r\nThanks Rebecca Sharp', '2019-09-18 17:09:21'),
