(21, 'Dane Carmela', 'Malacad', 'danemalacad@gmail.com', 'Hello. Regarding the app, I''ve already purchased the book. How can I get it? It says that the URL is not available. If I can''t get the book, I rather request For refund instead. Please respond to this email as soon as possible. Thank you.', '2019-09-20 16:01:33'),
(22, 'Juan Danilo', 'Armenteros Giraldez', 'daniloarmenteros@gmail.com', 'I bought the book, but I just received an email confirming the payment of the book but nothing else. I bought the CBT for Nurses. I would like to know when I''m receiving the book. Thanks in advance, Danilo.', '2019-09-22 11:49:55'),
(23, 'Paraskevi', 'Chatzikokkinou', 'vi80vi@hotmail.com', 'Hi Noni,\r\nFollowing our conversation last week could you please send me the package of the 30sessions+ the 20% off to pay.\r\nThe dates as told you last week are Wednesdays and Fridays. I was thinking 1.30hour x day.\r\nCan you do 11.00am on Wednesdays and 12.00 on Fridays?\r\nMoreover, I would like to ask if a day I cannot come is it possible to cover it another time, for example in the half term of my son (october)I will be out of the UK. Can we stop the lessons and start again as soon as I am back?\r\nMany thanks \r\nVivi Chatzikokkinou, doctor\r\nTel 07490280920\r\n', '2019-09-24 11:25:57'),
(24, 'Emma ', 'Morton', 'emmamorton@hotmail.co.nz', 'Hi, I am wanting to attend the NMC OSCE London hospital review and training - 3 day course (October) but when I go to register for this through my account I am unable to select this course, only the 2020 courses come up. Could you please advise me on how to do this and register ASAP.\r\nThank you in advance\r\nEmma Morton', '2019-09-24 15:29:21'),
