(29, 'Helen', 'Clare', 'helensclare@gmail.com', 'Good afternoon,\r\nI''m an experienced teacher and IELTS examiner and have been teaching students from medical backgrounds for the last 5 years.\r\nI am interested to know if you currently have any teaching vacancies.\r\nWith best wishes\r\nHelen Clare', '2019-10-02 13:05:07'),
(30, 'Surbhi', 'Augustine', 'surbhiaugustine@gmail.com', 'I am planning to enroll for NMC CBT course.  I have completed my IELTS with the required score for the NMC and has also done with my NMC Application. Could you please let me know the details of the course such as duration, fees, schedule. i am from India and would prefer the ONLINE mode.', '2019-10-03 04:11:46'),
(31, 'Ana Carolina', 'Barreto', 'carolpbarreto@hotmail.com', 'Hello, good morning.\r\nI would like to know more about Ielts online courses. Could you please give me a call?\r\nThank you!\r\nKind regards,\r\nAna Carolina', '2019-10-04 09:09:49'),
(32, 'Tessa', 'Klein', 'tessaklein5@gmail.com', 'Hello,\r\nI booked and paid for the NMC OSCE course (7 Oct - 9 Oct) on Thursday the 3rd but have not received any confirmation or further information about the course. I''ve also tried calling today but the line disconnects each time. Can you please contact me as soon as possible as the course is on Monday and I want to ensure I have the appropriate information. My phone number is 07305623259. Thank you kindly!\r\nBest wishes,\r\nTessa Klein', '2019-10-04 09:55:40'),
