(34, 'Alexandra', 'Kaenel ', 'kaenelale@gmail.com', 'I wish to inquire about relevant books & courses/exams on behalf of a friend. He is a registered ophthalmologist yet requires linguistic support in consulting patients in English . Thank you in advance for your assistance. Best wishes. Alexandra Kaenel ', '2019-10-09 05:52:32'),
(35, 'Milana', 'Bergamino Sirvén', 'milanabsirven@gmail.com', 'Hi, I am Milana, a donctor from Spain. I am trying to pass the IELTS with an overallband 7.5 and 7 in each part as the GMC requires but I have done it 3 times and I only obtain a 6 in the writing. THe other parts are fine (7.5-8 in each one). I would like to do an intensive course to improve my writing skills to achieve the 7 and maybe the other parts too, but mainly the writing. I should do a 2 or 3 weeks course. Thanks', '2019-10-11 08:01:42'),
(36, 'Milana', 'Bergamino Sirvén', 'milanabsirven@gmail.com', 'Hi, I am Milana, a doctor from Spain. I am trying to pass the IELTS with an overallband 7.5 and 7 in each part as the GMC requires but I have done it 3 times and I only obtain a 6 in the writing. THe other parts are fine (7.5-8 in each one). I would like to do an intensive course to improve my writing skills to achieve the 7 and maybe the other parts too, but mainly the writing. I should do a 2 or 3 weeks course. Thanks', '2019-10-11 10:56:43'),
