(42, 'Priscilla', 'Muswibe', 'pmuswibe@gmail.com', 'Hi good people\r\nI failed OSCE as per details below. Please let me know if you have a course available in February that I can enrol in. \r\nCheers\r\nPriscilla \r\nAPIE\r\n\r\nAssessment: Candidate failed to measure and document observations accurately. Candidate failed to take and record the patient’s pulse rate and respiratory rate for one full minute each. With 7 seconds remaining the candidate placed her fingers on the radial pulse. The candidate documented a pulse rate for the patient despite not taking the pulse rate for one full minute. The candidate failed to document a respiratory rate for the patient on the Neurological Observation Chart. Therefore the candidate has not undertaken a full assessment of the patient. \r\n\r\nPlanning: Candidate failed to ensure that the nursing interventions for both problems one and two were evidenced based or best practice. There were also limited information regarding self-care opportunities. Therefore it would be difficult for another nurse to follow the care planned for the patient. \r\n\r\nSkills\r\n\r\nIntramuscular Injection: Candidate failed to stretch the skin around the injection site when administering an intramuscular injection or verbalise they would stretch the skin when administering the injection. The skin must be stretched prior to administering an intramuscular injection to displace the underlying subcutaneous tissue, facilitate the insertion and reduce the sensitivity of nerve endings.  ', '2019-10-27 22:14:49'),
(43, 'Bernadette', 'Beltran', 'bvbeltran14@gmail.com', 'Hi! I just want to inquire if you also have a training review for NMC CBT and OSCE for Nurse associates. Thank you so much for your assistance.', '2019-10-29 17:41:31'),
