(47, 'Kar', 'Cheung', 'kar.cheung@hotmail.com', 'To whom it may concern, \r\nMy name is Kar Cheung, I attended the OSCE prep course November 4-6th and was highly dissatisfied with the course. I would like a full refund. \r\nA few of the concerns include:\r\n- the instructor was late\r\n- the course was unorganized (ie. insufficient quantity of materials were brought to the course such as the Presentation Book & Scoring Sheet) \r\n- the instructor was unfamiliar with the contents of the PowerPoint presentation (very clearly did not prepare herself to teach with a new company). \r\n- the instructor was unfamiliar with the daily agenda for Day 1 & 2, did not allow herself sufficient time to review the daily contents (ie. reviewed Assessment from 0930-1300hrs therefore rushing through the remainder of the content, and did not have equipment for the Implementation station to practice)\r\n- the instructor contradicted herself multiple times during the course when questions were asked (i.e. for in hospital resuscitation she informed us that there will be an assistant who will bag for you and that you would only have to provide compressions - which is incorrect) \r\n- the instructor was not familiar with which skills are being tested in the OSCE \r\n- the instructor provided incorrect information multiples times during the course (ie. repeating peak flow readings if measurements greater than 50 between readings - which is incorrect)\r\n- the instructor asked students to break up in to groups of 2 to practice skills, but did not demonstrate how to execute the skill. I had to request that she demonstrate the skills\r\n- the instructor poorly managed the time, I had to suggest how to utilize the time (i.e. when students were practicing BLS I suggested that other students practice the other skills instead of standing around)\r\n- the instructor had to rush through MUST and fluid balance at the end of Day 2 as she again was unfamiliar with the daily agenda and poorly managed the time \r\n- while practicing skills it was unsure if the proper technique was being used as the instructor to student ratio did not allow for the instructor to observe and critique our skills; we had to rely on one another to correct each other based on what we assumed was correct (the blind leading the blind). \r\n- for the Mock Exam the day was again unorganized with insufficient materials  (ie. only one copy of the ADL sheet was available which meant that the sheet had to be passed between the Assessment, Planning, and Evaluation station while students were sitting the exam. The instructors asked us to provided a blank copy of the Evaluation Scenario for the exam because they did not have it). \r\n- the instructors did not provide materials for the mock exam (i.e. students were asked to write on the NEWS sheets in their course book which was already written in). This made the mock exam feel unrealistic as it was not set up as how the OSCE exam would be. \r\n- the Mock Exam was incomplete as it only provided students a mock of only the Assessment, Planning, Implementation and Evaluation station. We did not have the opportunity to be tested on the skills as there were insufficient amount of instructors. \r\n- we were guaranteed an in person or Skype follow up before our exam which did not occur \r\nAfter the prep course I felt inadequately prepared for the OSCE because of the above concerns. Any doubts I had were not addressed as I could not trust the answer provided from the instructor to be accurate, I had no confidence in her. ', '2019-11-11 13:35:41'),
