(50, 'martha', 'fan', 'mfan@care.com', 'I''m interested in your OSCE prep courses for nursing.  I''m actually looking for a backup plan for my nurses who will be prepped in Manila just in case they don''t pass the osce test here.  would you have a "refresher" type course?  Or would you only recommend attending your 3 day course?', '2019-11-12 13:11:34'),
