(58, 'Shayan', 'Zaidi', 'shayanh.zad@gmail.com', 'Hello!\r\nI spoke with Nony earlier today as she was looking for my tutor for OET classes with her client. I couldn''t get the email sent to her due to an incorrect address. I am posting my content here, please send this to her and do let me know if you have received my message please, as my teacher will be ready for the session tomorrow. Thanks!\r\n"Hello Nony!\r\n\r\nNice talking to you today. The timings tomorrow till Friday will be 10 am to 12 pm UK time.\r\n\r\nAlso, we will have Tuesday and Thursday with Sabrina; her Zoom ID is braceng.sabrina@gmail.com.\r\n\r\nFor Wednesday and Friday, the sessions will be with Shaila; her Zoom ID is shailaaktersathee@yahoo.com.\r\n\r\nI will send the invoice over tomorrow.\r\n\r\nThanks!"', '2019-12-02 23:28:05'),
(59, 'Suzanne', 'Oberholzer', 'suzanne.oberholzer@yahoo.co.za', 'I booked a 5 day OSCE training course for 5th Feb 2020 on 29th November 2019. I have still not received any confirmation of my booking or next steps (order code 2862909693032865). I need to know if this booking was successful so I know whether I need to book elsewhere.', '2019-12-04 11:35:53'),
