(65, 'Francesca', 'De Zan', 'francescadezan@gmail.com', 'Hi!\r\nI''m a doctor and I need to take OET exam for the GMC registration. I would like to do a course before taking the exam and I''m currently evaluating the OET Training and Review in Person Course (Jan) and Online LIVE Intensive OET (40 hours - 4-weeks). The online course would be better because more flexible but I need to practice mostly in speaking and writing, so I’m wondering if is there a teacher to speak with during the course and if he/she will correct writing assay, giving advice on mistakes. Which one is the best based on my purpose? Thank you very much. Francesca ', '2020-01-01 17:34:56'),
