(68, 'Isabella', 'Osborn', 'isabello@bigpond.net.au', 'Hi, \r\nI registered for the OSCE nursing preparation course from the 8/1/19 but i can''t seem to find any information on where it''s held and the times. Is there somewhere that i can access this information? \r\n\r\nThank you ', '2020-01-06 10:33:07'),
