(70, 'Ghazal', 'Qureshi', 'info@prudentinstitution.com', 'To whom it may concern,\r\n\r\nWe are a newly established institution based in Islamabad Pakistan, looking to hire Nursing Consultants or other healthcare professionals to help prepare our students for the CBT and OSCE exams, and provide expertise to help our students successfully register with the Nursing & Midwifery Council in the UK.  We also noticed your book selection. We might even be interested in purchasing such books from you in bulk to give to our students as textbooks for their studies. \r\n\r\nWe have contacts with government officials in Pakistan who are in correspondence with UK immigration officials, who are looking for us to prepare a number of experienced nurses for the NMC registration process and we believe that your organization could provide assistance with that process.  \r\n\r\nWe are very interested in potentially working with you and your team, and would like to speak with you further about this opportunity.\r\n\r\nPlease contact us so that we can arrange a meeting with you .', '2020-01-08 20:17:53'),
