(78, 'Jisoo', 'Yoo', '13oonabi@gmail.com', 'Hello :) \r\n\r\nMy name is Jisoo Yoo. I''ve booked OET group discount (for 07.Mar) with Mock exam. After booking went through, I''ve got a confirmation email and it says my mock text will be on 2nd of February. I replied that I''d love to change the date but haven''t got any answer yet. Could you check if I can take mock test on the end of February please? \r\n\r\nAlso I''d like to ask to you about my actual exam booking is done. When I check my OET account and I can''t see any upcoming exams. I booked it for 7th of March. I guess that it''s group booking and you will register everyone at once later but I just want to be sure if it is right. Otherwise, if anything went wrong and I need to fix it.\r\nI''ll look forward to hear from you via email.\r\n\r\nThank you.', '2020-01-28 18:15:44'),
