(80, 'Elise', 'Bernard', 'elisebernard@hotmail.fr', 'Good morning,\r\n\r\nI sit a nursing mock test yesterday. \r\nUnfortunately, du to a fault on your part I did not have a the full mock test. \r\nActually, I did not receive the joining information email as it should have been the case. So arrive at 10:40 at the address of the center but the test was at another venue. I started my test at 11:35 only without being offered any chance to do the first part of the listening test.\r\nSo, on the top of not having the full test I was not in the condition someone should be to sit for a test.\r\nFor these reasons I kindly ask you to refund me a part of the amount paid for this test.\r\n\r\nKind regards,\r\n\r\nÉlise Bernard ', '2020-02-03 08:07:54'),
(81, 'Elise', 'Bernard', 'elisebernard@hotmail.fr', 'Good morning,\r\nI sent you a request yesterday regarding an issue with my OET mock test booking and I asked for a refund. On the top of that I did not receive the results of my MOCK test and it was supposed to be 24H. \r\nCan you update please ?', '2020-02-04 12:57:55'),
(82, 'erdem', 'ozerden', 'erdemozerden81@icloud.com', 'I''ve just booked an OET exam with group discount for IELTS MEDICAL(if you check it out may you may see it) but I don''t understand details'' normally I chose the date of 4th April 2020 but I couldn''t see it. (also I want to ask Shall I see it on my OET official account)\r\nI''d  be very happy if you inform me\r\n.Kind regards\r\n', '2020-02-06 00:02:49'),
(83, 'First Name', 'Last Name', 'vipuldayani55@gmail.com', 're', '2020-04-23 12:28:46'),
(84, 'First Name', 'Last Name', 'vipuldayani55@gmail.com', 'w', '2020-04-23 12:28:57');
