INSERT INTO `course_main` (`id`, `type`, `course_main`, `photo_image`, `main_title`, `url`, `sub_title`, `sub_title_description`, `testimonials`, `work`, `created_date`) VALUES
(1, 'IELTS', 'IELTS', '190910075546.jpg', 'IELTS', 'Wtc9-yaorPw', 'IELTS for Healthcare Professionals', ' <p style="text-align: justify;">Our core course reinforces the reason IELTS Medical exists, by providing you with instructions that address the high standards required by UK healthcare regulators (GDC; GMC; and NMC). Providing instruction in a course written by ex-IELTS examiners and delivered by EFL experts, we''ve seen many dentists, doctors, nurses, pharmacists and vets to IELTS 7.0 - 7.5+. Let us do the same for you.</p>', ' <p>"Through out my IELTS journey IELTS Medical Ltd. was always with me and always helpful. Finally I obtained sufficient score: Listening: 8 Reading: 8.5 Speaking:7.5 Writing: 7.5 Overall:8. Speacially i had problem with writing and with the help from well trained tutors in IELTS Medical my score has increased. My lessons were mostly one to one and it helped me a lot. All my essays were checked very quickly and i had the chance to discuss my mistakes with the tutors. I want to thank to Nonny for all her support. I definitely recommend this course for IELTS"</p>\r\n\r\n    <b>- Doctor G, qualified in Turkey</b>\r\n    <br /><br />\r\n\r\n<p>"Hi Noni. Sorry for not getting back to you. I''ve managed to pass the IELTS exam. I''ve started to work as a nurse in the place where I used to work as a carer. I''m still in induction. I will stay here a while to gain some experience and then maybe I will try NHS. Thank you for all the support you''ve offered me while studying at IELTS Medical." </p>\r\n\r\n    <b>- Nurse O, qualified in Romania</b>', ' We have an extensive network of alumni practising in London and Greater London and can assist you with securing your first post-registration job. We also supply several NHS hospitals and private healthcare providers that would like to meet you.', '2019-09-09 09:56:56'),
(2, 'OET', 'OET for Nurses', '', 'OET for Nurses', 'TJnebs5mkfI', 'OET for Nurses', '<p style="text-align: justify;">Our most popular course is the 6-week course OET Nursing for nurses who have an upper intermediate command of English. It''s an intensive course that includes OET Grammar for Nurses, that runs 4 days a week and prepares you to pass the exam on your first attempt. The course helps you to learn Medical English and to adapt to communication soft skills that you will need. This includes interacting with patients, writing letters, reading healthcare texts effectively, understanding the type of audio that you would come across at work. This course will help you to strengthen the skills that will see you through the examination and into your career as a nurse in the UK. \r\n</p>', ' <p>"Highly recommend. Expert, supportive and approachable tutors. Am referring all my friends who are looking to pass IELTS and OET in order to work in NHS"</p>\r\n\r\n    <b>- Nurse Kesha, Qualified in India - new to the OET, OET 12 week (General English for OET + Grammar for OET + OET Test Prep) Course - 1st time OET pass\r\n</b>\r\n    <br /><br />\r\n\r\n<p>"Amazing experience with IELTS Medical! I started my classes for IELTS and finally changed it for OET. Thanks to all their support and English classes, I finally pass my exam. They are really professional and they really care about you."\r\n </p>\r\n\r\n    <b>- Nurse Marie, Qualified in France - Switched from IELTS to OET, OET Flex course - 1st time OET pass</b>\r\n', '<p>We have an extensive network of alumni practising in London and Greater London and can assist you with securing your first post-registration job. We also supply several NHS hospitals and private healthcare providers that would like to meet you.</p>', '2019-09-09 09:57:02'),
(3, 'OET', 'OET for Doctors', '', 'OET for Doctors', 'TJnebs5mkfI', 'OET for Doctors', '<p style="text-align: justify;">Our most popular course is the 3-week OET Medicine course for medics who have a strong command of English. It''s an intensive course that runs 4 days a week and prepares you to pass the exam on your first attempt. The course requires you to immerse yourself in Medical English and to adapt to the communication skills you will need. This includes interacting with patients, writing letters, reading healthcare texts effectively, understanding the type of audio that you would come across at work. This course will help you to strengthen the skills that will see you through the examination and into your career as a doctor in the UK. </p>', ' <p>Hello Nonny <br />\r\n"I passed. I got 430, 390, 370 and 390.\r\nThank you so much Nonny for your help. I had a great time during the courses.\r\nThanks again:)\r\n"</p>\r\n\r\n    <b>- Mahesh, Doctor, Qualified in Nepal - new to the OET, 6 week course - 1st time OET pass</b>\r\n    <br /><br />\r\n\r\n<p>"I want to thank you, here is my OET result. Thank you for your efforts. Scores: L= (B-430), R =(B-400), W=(B=400), S= (A=460). I highly recommend this institude. Highly trained teachers guide students towards their goals."</p>\r\n\r\n    <b>- Girish, Doctor, Qualified in India - Switched from IELTS to OET, 4 week course - 1st time OET pass</b>\r\n', '<p>We have an extensive network of alumni practising in London and Greater London and can assist you with securing your first post-registration job. We also supply several NHS hospitals and private healthcare providers that would like to meet you.</p>', '2019-09-09 09:57:08'),
(4, 'NMC OSCE', 'NMC OSCE for Nurses', '', 'NMC OSCE for Nurses', 'Xni86Tm5Q_s', 'NMC OSCE for Nurses', ' <p style="text-align: justify;">The Core 3-Day Course Features:</p>\r\n <p style="text-align: justify;">Day 1 is classroom based and features: basic anatomy physiology and background; APIE (Assessments, Care Planning, Implementation and Evaluation); Documentation; NEWS charts and Observation Charts; Common NMC practice Scenarios.</p>\r\n <p style="text-align: justify;">Day 2 is either classroom or hospital based and works on; Skills including but not limited to: ANTT; Basic life support; Peak flow; Removal of Foley Catheter; CSU Sample and IM Injections.</p>\r\n <p style="text-align: justify;">Day 3 is usually London hospital based and includes: A full mock NMC OSCE Exam. Individual feedback.</p>', '  <p>"Thank God for this OSCE course. I did the 3 day intensive OSCE course and I passed my OSCE on my first attempt. A huge thank you to Claire and Nonny! They were very supportive and helpful during this OSCE preparation. I would definitely recommend this to other international nurses looking to prepare for the OSCE"</p>\r\n\r\n    <b>- Nurse Alysha, Qualified in the USA.</b>\r\n    <br /><br />\r\n\r\n\r\n <p>"Choosing the IELTS Medical was no doubt one of the best decisions I made in my life!\r\n                        I passed my Osce on my first attempt!!\r\n                        This 3-day intensive course I did with them was just brilliant!! All thanks to Nonny and Claire!!\r\n                        I couldn’t have asked for any better trainer than the amazing, Claire..She was always upto date with her knowledge..ever so respectful and calm and patient with us all. Great study and practice materials too!! I would definitely recommend this institute to the overseas nurses looking for osce training. You won’t regret it guys!!"</p>\r\n    <b>- Nurse Pramkila, Qualified in India</b>\r\n', '<p>We have an extensive network of alumni practising in London and Greater London and can assist you with securing your first post-registration job. We also supply several NHS hospitals and private healthcare providers that would like to meet you.</p>', '2019-09-09 09:57:50'),
(5, 'NMC OSCE', 'NMC OSCE for Midwives', '', 'NMC OSCE for Midwives', 'Xni86Tm5Q_s', 'NMC OSCE for Midwives', '<p style="text-align: justify;">The Core 3-Day Course Features:.</p>\r\n<p style="text-align: justify;">Day 1 is classroom based and features: basic maternity care background; APIE (Assessments, Care Planning, Implementation and Evaluation); Documentation; Observation Charts; Common NMC practice Scenarios.\r\n</p>\r\n<p style="text-align: justify;">Day 2 is either classroom or hospital based and works on NMC OSCE Midwifery skills.</p>\r\n<p style="text-align: justify;">Day 3 is usually London hospital based and includes: A full mock NMC OSCE Midwifery Exam. Individual feedback.</p>', '  <p>"Thank God for this OSCE course. I did the 3 day intensive OSCE course and I passed my OSCE on my first attempt. A huge thank you to Claire and Nonny! They were very supportive and helpful during this OSCE preparation. I would definitely recommend this to other international nurses looking to prepare for the OSCE"</p>\r\n\r\n    <b>- Nurse Alysha, Qualified in the USA.</b>\r\n    <br /><br />\r\n\r\n\r\n <p>"Choosing the IELTS Medical was no doubt one of the best decisions I made in my life!\r\n                        I passed my Osce on my first attempt!!\r\n                        This 3-day intensive course I did with them was just brilliant!! All thanks to Nonny and Claire!!\r\n                        I couldn’t have asked for any better trainer than the amazing, Claire..She was always upto date with her knowledge..ever so respectful and calm and patient with us all. Great study and practice materials too!! I would definitely recommend this institute to the overseas nurses looking for osce training. You won’t regret it guys!!"</p>\r\n    <b>- Nurse Pramkila, Qualified in India</b>\r\n', '<p>We have an extensive network of alumni practising in London and Greater London and can assist you with securing your first post-registration job. We also supply several NHS hospitals and private healthcare providers that would like to meet you.</p>', '2019-09-10 07:18:43'),
(6, 'NMC OSCE', 'NMC OSCE (Paediatrics)', '', 'NMC OSCE (Paediatrics)', 'Xni86Tm5Q_s', 'NMC OSCE (Paediatrics)', '<p style="text-align: justify;">Day 1 is classroom based and features: basic Anatomy physiology and background; APIE (Assessments, Care Planning, Implementation and Evaluation); Documentation; PEWS charts and Observation Charts; Common NMC practice Scenarios.</p>\r\n<p style="text-align: justify;">Day 2 is either classroom or hospital based works on Skills including: Paediatric Basic Life Support.</p>\r\n<p style="text-align: justify;">Day 3 is always London hospital based and includes: A full mock NMC OSCE Exam with individual feedback.</p>', '  <p>"Thank God for this OSCE course. I did the 3 day intensive OSCE course and I passed my OSCE on my first attempt. A huge thank you to Claire and Nonny! They were very supportive and helpful during this OSCE preparation. I would definitely recommend this to other international nurses looking to prepare for the OSCE"</p>\r\n\r\n    <b>- Nurse Alysha, Qualified in the USA.</b>\r\n    <br /><br />\r\n\r\n\r\n <p>"Choosing the IELTS Medical was no doubt one of the best decisions I made in my life!\r\n                        I passed my Osce on my first attempt!!\r\n                        This 3-day intensive course I did with them was just brilliant!! All thanks to Nonny and Claire!!\r\n                        I couldn’t have asked for any better trainer than the amazing, Claire..She was always upto date with her knowledge..ever so respectful and calm and patient with us all. Great study and practice materials too!! I would definitely recommend this institute to the overseas nurses looking for osce training. You won’t regret it guys!!"</p>\r\n    <b>- Nurse Pramkila, Qualified in India</b>\r\n', ' <p>We have an extensive network of alumni practising in London and Greater London and can assist you with securing your first post-registration job. We also supply several NHS hospitals and private healthcare providers that would like to meet you.</p>', '2019-09-10 07:18:50'),
(7, 'NMC OSCE', 'NMC OSCE (Mental Health)', '', 'NMC OSCE (Mental Health)', 'Xni86Tm5Q_s', 'NMC OSCE (Mental Health)', ' <p style="text-align: justify;">Day 1 is classroom based and features: basic Anatomy physiology and background; APIE (Assessments, Care Planning, Implementation and Evaluation); Documentation; BATOMI, Common NMC practice Scenarios.</p>\r\n <p style="text-align: justify;">Day 2 is either classroom or hospital based works on Skills including: ANTT; Basic Life Support; Peak flow; Removal of Foley Catheter; CSU Sample and IM Injections.</p>\r\n <p style="text-align: justify;">Day 3 is always London hospital based and includes: A full mock NMC OSCE Exam with individual feedback.</p>\r\n <p style="text-align: justify;">Day 4 & 5: A chance for 1 : 1 or 1 : 2 Supervisor-led practice on any areas of improvement identified in the Day 3 NMC OSCE Mock Examination</p>\r\n\r\n\r\n', '  <p>"Thank God for this OSCE course. I did the 3 day intensive OSCE course and I passed my OSCE on my first attempt. A huge thank you to Claire and Nonny! They were very supportive and helpful during this OSCE preparation. I would definitely recommend this to other international nurses looking to prepare for the OSCE"</p>\r\n\r\n    <b>- Nurse Alysha, Qualified in the USA.</b>\r\n    <br /><br />\r\n\r\n\r\n <p>"Choosing the IELTS Medical was no doubt one of the best decisions I made in my life!\r\n                        I passed my Osce on my first attempt!!\r\n                        This 3-day intensive course I did with them was just brilliant!! All thanks to Nonny and Claire!!\r\n                        I couldn’t have asked for any better trainer than the amazing, Claire..She was always upto date with her knowledge..ever so respectful and calm and patient with us all. Great study and practice materials too!! I would definitely recommend this institute to the overseas nurses looking for osce training. You won’t regret it guys!!"</p>\r\n    <b>- Nurse Pramkila, Qualified in India</b>\r\n', ' <p>We have an extensive network of alumni practising in London and Greater London and can assist you with securing your first post-registration job. We also supply several NHS hospitals and private healthcare providers that would like to meet you.</p>', '2019-09-10 07:18:56'),
(8, 'NMC CBT', 'NMC CBT for Nurses', '', 'NMC CBT for Nurses', 'j5DlhnQHJIU', 'NMC CBT for Nurses', ' <p style="text-align: justify;">\r\nOur core CBT offering has each session centred around a particular aspect of the CBT exam. This includes - but is not limited to: blood transfusions; infection control; nutrition; interpretation of diagnostic tests; law and ethics; safeguarding children and the elderly; medicines management and drug calculations. Class sizes are maximum 10 nurses. Courses take place in person or online. \r\n<br />\r\n- Includes mock CBT examination.<br />\r\n- Individual feedback.\r\n</p>', '  <p>"IELTS Medical is an amazing institute. Very focused on providing the students what they need to get qualified / pass the various exams. Truly a caring environment. I was fortunate to be taught by Kristen - she was wonderful and the reason I passed my exam the first time."</p>\r\n\r\n    <b>- Nurse Rawinkal </b>\r\n    <br /><br />\r\n\r\n<p>"I passed my CBT and I''m now a step closer to registration." </p>\r\n <b>- Nurse Sonja, Qualified in South Africa</b>', ' <p>We have an extensive network of alumni practising in London and Greater London and can assist you with securing your first post-registration job. We also supply several NHS hospitals and private healthcare providers that would like to meet you.</p>', '2019-09-10 07:59:01'),
(9, 'Plab', 'Plab Courses', '', 'Plab Courses', 'Wtc9-yaorPw', 'Plab Courses', ' <p style="text-align: justify;">Our core package includes Plab 1 and Plab 2 coaching and is led by UK medical doctors. Our 4-day Plab 1 booster will cover all of the general topics that you will require in order to pass this computer based, theory examination. You will then be given a mock examination to test your knowledge and understanding with a debriefing session afterwards that highlights any areas that you need to work on in order to ensure success on the big day. There''s a maximum 6 doctors on the course, ensuring that you receive the individualised attention from your instructors. </p>\r\n\r\n <p style="text-align: justify;">After this, our 3 week Plab 2 course will provide you with the tools that you need to pass this Objective, Structured, Clinical Examination. Plab 2 is made up of 20 x 8-minute stations. The course includes simulated OSCE stations, using Plab 2 scenarios and highly experienced practicing GMC medical roleplay actors and actresses who provide medical roleplays for OSCE examinations. Our training is fully aligned with the GMC PLAB 2 Blueprint and adheres to the GMC Good Medical Practice guidelines.</p>', '', ' <p>We have an extensive network of alumni practising in London and Greater London and can assist you with securing your first post-registration job. We also supply several NHS hospitals and private healthcare providers that would like to meet you.</p>', '2019-09-10 07:59:01'),
(10, 'NMC CBT', 'NMC CBT for Midwives', '', 'NMC CBT for Midwives', 'j5DlhnQHJIU', 'NMC CBT for Midwives', ' <p style="text-align: justify;">\r\nOur core CBT offering has each session centred around a particular aspect of the CBT exam. This includes - but is not limited to: blood transfusions; infection control; nutrition; interpretation of diagnostic tests; law and ethics; safeguarding children and the elderly; medicines management and drug calculations. Class sizes are maximum 10 nurses. Courses take place in person or online. \r\n<br />\r\n- Includes mock CBT examination.<br />\r\n- Individual feedback.\r\n</p>', '  <p>"IELTS Medical is an amazing institute. Very focused on providing the students what they need to get qualified / pass the various exams. Truly a caring environment. I was fortunate to be taught by Kristen - she was wonderful and the reason I passed my exam the first time."</p>\r\n\r\n    <b>- Nurse Rawinkal </b>\r\n    <br /><br />\r\n\r\n<p>"I passed my CBT and I''m now a step closer to registration." </p>\r\n <b>- Nurse Sonja, Qualified in South Africa</b>', ' <p>We have an extensive network of alumni practising in London and Greater London and can assist you with securing your first post-registration job. We also supply several NHS hospitals and private healthcare providers that would like to meet you.</p>', '2019-09-10 07:59:01');
