(2, 4, 1433, 'Mylene Pasia', '', 'fymmyles@gmail.com', '', '', '', '', 0, 0, 0, 2, 2, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2019-12-02 10:54:02'),
(3, 4, 1434, 'Krista English', '', 'k.english75@yahoo.com', '', '', '', '', 0, 0, 0, 2, 2, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '2019-12-02 15:42:12'),
(4, 4, 1458, 'KOJO DAUDA ', 'His', 'kojodauda@yahoo.com', '', '', '', '', 2, 5, 86, 2, 2, 'Senior Nursing Officer', 'Tamale Teaching Hospital', '15-12-2015', '19-12-2019', '<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: 150%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 150%; font-family: ''Times New Roman'',serif;">Registered General Nurse with a specialty training in Adult nursing.</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: 150%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 150%; font-family: ''Times New Roman'',serif;">Good understanding and delivery of evidence-based, holistic, client and family focused</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: 150%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 150%; font-family: ''Times New Roman'',serif;">Nursing care through application of the nursing process in the care of clients and their significant others.</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: 150%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 150%; font-family: ''Times New Roman'',serif;">Deep knowledge of nursing principles, techniques and procedures.</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: 150%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 150%; font-family: ''Times New Roman'',serif;">Good communication and observational skills.</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: 150%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 150%; font-family: ''Times New Roman'',serif;">Sound understanding of medical terminology, anatomy, physiology and concept of disease.</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: 150%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 150%; font-family: ''Times New Roman'',serif;">Outstanding, knowledge and practice of first aid and cardiopulmonary resuscitation.</span></p>', 'Nursing Officer', 'Tamale Teaching Hospital', '09-12-2012', '30-11-2015', '', 'Nursing and Midwifery council Examiner', 'Ghana Nurses and Midwives Council', '18-01-2010', '19-12-2019', '', '2019-12-19 10:39:31'),
(5, 4, 1459, 'FOSUA SUSANA ', 'Her', 'Susan.brooks2912@gmail.com', '', '', '', '', 2, 5, 86, 2, 2, 'Registered General Nurse ', '37 Military Hospital', '01-04-2019', '19-12-2019', '<p>&bull; Providing evidenced-based nursing care to clients.</p>\r\n<p>&bull; Performing various nursing procedures</p>\r\n<p>&bull; Writing Reports on Daily Ward Activities</p>\r\n<p>&bull; Conducting Patient/Family Care Study</p>\r\n<p>&bull; Advocating for Vulnerable Clients</p>\r\n<p>&bull; Liaising with various healthcare professionals to promote the health of Patients</p>\r\n<p>&bull; Writing Reports on Critical Incidences&nbsp;</p>\r\n<p>&nbsp;</p>', 'Internship', ' University of Cape-Coast Hospital (Emergency and Surgical Department', '12-02-2018', '16-04-2018', '<p>Performing evidenced -based emergency care</p>\r\n<p>&bull; Performing pre and post-operative care</p>\r\n<p>&bull; Triaging &bull; Report Writing</p>\r\n<p>&bull; Data Collection&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Internship', ' Holy Family Hospital (ENT Department) ', '12-12-2017', '24-01-2018', '<p>Performing evidenced -based emergency care</p>\r\n<p>&bull; Performing pre and post-operative care</p>\r\n<p>&bull; Triaging &bull; Report Writing</p>\r\n<p>&bull; Data Collection&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2019-12-19 11:08:26'),
(7, 4, 1463, 'EHIWOBU EWERE FRANKLIN', 'His', 'KLIN2063@GMAIL.COM', '', '', '', '', 2, 5, 161, 2, 2, 'Pre-registered nurse (worked as a Nursing Assistant)', 'Cardiff and Vale University Teaching hospital', '10-06-2019', '20-12-2019', '<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif; mso-bidi-font-weight: bold;">Assisted patient with personal care and activities of daily living.</span></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif; mso-bidi-font-weight: bold;">Assessment and monitoring of patient&rsquo;s vital signs and blood sugar level.</span></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif; mso-bidi-font-weight: bold;">Assisting patients with mobility with the aid of assistive mobility devices</span></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif; mso-bidi-font-weight: bold;">Attended ward meeting</span><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif;">.</span></strong></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif; mso-bidi-font-weight: bold;">Assisted qualified nurses in carrying out some procedures such as removal of catheter and dressing</span><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif;">.</span></strong></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif; mso-bidi-font-weight: bold;">Identifying critically unwell patients and reporting according to the hospital policy.</span></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif; mso-bidi-font-weight: bold;">Sample collection such as urine and stool and MRSA.</span></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif; mso-bidi-font-weight: bold;">Bed making and cleaning following a patient&rsquo;s discharge.</span></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif; mso-bidi-font-weight: bold;">Providing feeding assistance to patients.</span></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif; mso-bidi-font-weight: bold;">Care of pressure areas.</span></p>', 'Part time Healthcare Assistant/support worker ', 'Careresolve Agency', '06-09-2016', '20-12-2019', '<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif;">Efficiently carried out duties as trained.</span></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif;">Provided personal care and assisted with activities of daily living to adults with dementia and children with learning disabilities.</span></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif;">Worked under pressure and challenging environment.</span></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif;">Effectively and accurately completed all required documentation.</span></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif;">Chaperoned during medications in care and residential homes.</span></p>', 'Staff Nurse ', 'Island Clinic and Maternity Warri, Delta State Nigeria', '12-03-2014', '19-07-2016', '<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif;">Efficiently carried out duties as trained.</span></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif;">Provided personal care and assisted with activities of daily living to adults with dementia and children with learning disabilities.</span></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif;">Worked under pressure and challenging environment.</span></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif;">Effectively and accurately completed all required documentation.</span></p>\r\n<p class="MsoNormal" style="line-height: 115%;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif;">Chaperoned during medications in care and residential homes.</span></p>', '2019-12-20 13:48:12'),
(8, 4, 1464, 'GLADYS KAKRABA', 'Her', 'gladyskakraba@yahoo.com', '', '', '', '', 2, 5, 86, 2, 2, 'Midwifery/Nursing Officer                         ', 'S.D.A. Hospital, Asamang', '01-03-2019', '20-12-2019', '<p class="MsoListParagraphCxSpFirst" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Supervision of nurses and midwives in the mother and baby unit, </span></p>\r\n<p class="MsoListParagraphCxSpMiddle"><span lang="EN-US">Antenatal clinic, labour and postnatal units.</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Supervision of the antenatal ward and the geriatric ward.</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Conduct of annual performance review</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Home visitation including individualized health education</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Advocacy for patients, their families and carers</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">As a liaison between social services, opinion leaders in the communities and the district</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-align: justify;"><span lang="EN-US">Health administration </span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Preparation of monthly midwifery returns </span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Organization of yearly and half yearly performance review</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">All other nursing and Midwifery duties</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-align: right;" align="right"><span lang="EN-US">&nbsp;</span></p>\r\n<p class="MsoListParagraphCxSpLast"><span lang="EN-US">Currently the nurse in charge of the mother and baby unit and the midwife in charge of the maternity unit of the S.D.A. Hospital, Asamang &ndash;Ghana<span style="mso-spacerun: yes;">&nbsp;&nbsp;&nbsp; </span></span></p>', 'Senior Staff Nurse-Midwife        ', 'S.D.A. Hospital, Asamang                   ', '01-03-2016', '31-12-2018', '<p class="MsoListParagraphCxSpFirst" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Preparation of the patients physically, psychologically and spiritually for elective and emergency surgical interventions.</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Managing the post- operative patients</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Counselling of patients for investigative procedures like pap smears and cervical biopsies </span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Taking of pap smears and fixing of smears for investigations</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Co-ordination of lab results including filling results and making of follow-up calls to patients</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Giving health talks on health associated risk like smoking, sedentary life style, alcoholism and referrals to appropriate social services</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Management of labour and delivery including obstetric emergencies like post-partum haemorrhage</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Organization of postnatal clinics including child welfare clinics</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Analysis of realistic clients&rsquo; requirement in terms of time, effort and cost</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Ensuring adequate health and safety is provided for patients and for all staff</span></p>\r\n<p class="MsoListParagraphCxSpLast" style="text-align: justify; text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Liaising with staff to ensure budgets and deadlines are met.</span></p>', 'Staff Nurse/ Midwife', 'S.D.A. Hospital, Asamang                         ', '01-01-2013', '31-03-2016', '<p class="MsoListParagraphCxSpFirst" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Preparation of the patients physically, psychologically and spiritually for elective and emergency surgical interventions.</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-family: Symbol; mso