f !supportLists]--><span lang="EN-US" style="mso-bidi-font-size: 14.0pt; line-height: 105%; font-family: ''Arial'',sans-serif; mso-fareast-font-family: Arial; border: none windowtext 1.0pt; mso-border-alt: none windowtext 0cm; padding: 0cm;"><span style="mso-list: Ignore;">&bull;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US">Evaluating and overseeing the care of infants in the NICU </span></p>', '2019-12-20 14:05:22'),
(10, 4, 1482, 'Elise F Hobbs', 'Her', 'eafriede@hotmail.com', '', '', '', '', 2, 5, 223, 3, 2, 'Emergency Department Clinical Nurse Supervisor', 'Mercy Hospital, St. Louis, MO ', '08-08-2016', '08-08-2019', '<p>Assisted in planning, coordinating, and evaluating the operations and patient care of the Adult Emergency Department, Paediatric Emergency Department, and Clinical Decision Unit, managed staffing, throughput, patient satisfaction, conflict resolution, and problem solving. Reported directly to the manager and director of the Emergency Department. Provided patient care as staff nurse, as needed, to manage high patient census.</p>\r\n<p>? Maintained open and positive communication within the Emergency Department and ancillary departments in order to effectively and safely care for patients.</p>\r\n<p>? Collaborated with the leadership team to ensure accuracy of attendance records and effective resource utilisation.</p>\r\n<p>? Served as the direct supervisor for up to 45 clinical team members during any given shift.&nbsp;</p>\r\n<p>? Maintained nursing staff accountability by coaching, praising, evaluating, counselling, and disciplining employees.&nbsp;</p>\r\n<p>? Assisted in evaluating and hiring new team members.</p>\r\n<p>? Represented the Emergency Department on the Stroke Performance Improvement Committee: helped prepare for surveys, gained certifications, provided feedback to staff on charting, and offered continuing clinical education pertaining to our stroke patient population.&nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>', 'Emergency Department Staff Nurse/Relief Charge Nurse', 'Mercy Hospital, St. Louis, MO ', '01-08-2016', '20-03-2018', '<p>Served in relief charge position, accountable for management of daily staffing, up to 45 clinical team members a shift, maintained positive intradepartmental communication and external relationships, resolved conflicts, and served as a resource for staff. Reported directly to the manager and director of the Emergency Department.&nbsp;</p>\r\n<p>? Assessed, prioritised, and provided nursing care to adult and paediatric patients in a Level 1 trauma centre.</p>\r\n<p>? Triaged patients, assessed current symptoms and obtained medical history in order to assign acuity.&nbsp;</p>\r\n<p>? Monitored health conditions, administered medicine, and assisted with intubation, chest tube placement and defibrillations; inserted NG tubes and Foley catheters and managed IV therapy.</p>\r\n<p>? Communicated with family and patients about procedures, medications, and in-patient expectations. Provided discharge instructions.</p>\r\n<p>? Collaborated with doctors and other hospital staff to plan, implement, and evaluate patient care.&nbsp;</p>', 'Emergency Department Travel Nurse', ' Aya Healthcare & American Mobile, Various ', '10-12-2014', '27-07-2016', '<p>Served in relief charge position, accountable for management of daily staffing, up to 45 clinical team members a shift, maintained positive intradepartmental communication and external relationships, resolved conflicts, and served as a resource for staff. Reported directly to the manager and director of the Emergency Department.&nbsp;</p>\r\n<p>? Assessed, prioritised, and provided nursing care to adult and paediatric patients in a Level 1 trauma centre.</p>\r\n<p>? Triaged patients, assessed current symptoms and obtained medical history in order to assign acuity.&nbsp;</p>\r\n<p>? Monitored health conditions, administered medicine, and assisted with intubation, chest tube placement and defibrillations; inserted NG tubes and Foley catheters and managed IV therapy.</p>\r\n<p>? Communicated with family and patients about procedures, medications, and in-patient expectations. Provided discharge instructions.</p>\r\n<p>? Collaborated with doctors and other hospital staff to plan, implement, and evaluate patient care.&nbsp;</p>', '2020-01-10 09:56:05');
