<span lang="EN-US" style="font-size: 12.0pt; font-family: ''Times New Roman'',serif;">Provision of immunization services and administration of vaccines.</span></p>\r\n<p class="MsoListParagraphCxSpLast" style="margin-left: 72.0pt; mso-add-space: auto; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-size: 12.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;">&middot;<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang="EN-US" style="font-size: 12.0pt; font-family: ''Times New Roman'',serif;">Assisting in the conservative management of infertility cases, IUI procedures and IVF procedures.</span></p>\r\n<p style="padding-left: 90px;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 106%; font-family: ''Times New Roman'',serif; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;">Patient health education and counseling</span></p>', 'Staff Nurse/Midwife', 'Vecad Clinic Limited', '05-07-2016', '28-02-2017', '<p class="MsoListParagraphCxSpFirst" style="margin-left: 72.0pt; mso-add-space: auto; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-size: 12.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US" style="font-size: 12.0pt; font-family: ''Times New Roman'',serif;">Admission and discharge of patients.</span></p>\r\n<p class="MsoListParagraphCxSpMi