list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-size: 14.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US" style="font-size: 14.0pt; line-height: 115%; font-family: ''Times New Roman'',serif;">Solid administrative skills, admission, assessment, serving medication and early referral with prompt follow up.</span></p>\r\n<p class="MsoListParagraphCxSpLast" style="text-indent: -18.0pt; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span lang="EN-US" style="font-size: 14.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;"><span style="mso-list: Ignore;">&middot;<span style="font: 7.0pt ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang="EN-US" style="font-size: 14.0pt; line-height: 115%; font-family: ''Times New Roman'',serif;">Management of STDs and HIV patients.</span></p>', '2020-01-14 10:20:03'),
(13, 4, 1498, 'EJOKPAGHU PHILOMENA ONOME ', 'Her', 'ephilomena42@gmail.com', '', '', '', '', 2, 5, 161, 2, 2, 'Nursing Officer I', 'Delta State University Teaching Hospital', '22-10-2018', '14-01-2020', '<p>Admission and discharge of patients with either gynecologic or obstetrics problems, history taking, writing of admission and in-patients summary notes. Measuring of vital signs, provision of antenatal care services to both new and already booked pregnant women, giving health enlightenment lectures at the antenatal clinic, serving as a chaperone and assistant to the doctor and conducting/taking deliveries. Giving patients and their relatives psychological and emotional support. Active participation in the management of gynecologic and obstetric emergencies such as ectopic gestation, torsioned ovarian cysts, fetal distress, pre-eclampsia, eclampsia and post-partum hemorrhages etc., as well as provision of pre-operative and post-operative nursing care to patients. Assisting mothers to initiate breast-feeding, practice umbilical cord care, detect and monitor newborns for jaundice. Furthermore, give and monitor patients on blood transfusion, administer medications to patients via enteral and parenteral routes and do wound dressing. Equipment handled:&nbsp; Analogue and digital thermometers, adult and pediatric weighing scale (analogue and digital), sphygmomanometer, stethoscope, fetoscope, sonic aid, suction machine, mucus extractor, nebulizer, oxygen cylinder and delivery unit/system, ambu bag, wound dressing and suturing set, sterilizer and delivery pack.&nbsp;</p>', 'Nursing Officer I', 'Delta State University Teaching Hospital', '16-01-2017', '27-09-2018', '<p>Admission and discharge of patients into the ward, history taking and writing of in-patients admission notes, summary notes and discharge notes. Measurement of vital signs such as temperature, blood pressure, respiratory rate and pulse rate and measurement of patients&rsquo; weight and height. Administration of medications to patients via enteral and parenteral routes. Monitoring of intravenous fluid, blood transfusion, monitoring of fluid input and output, administration of supplemental oxygen, passage and removal of urinary catheters and nasogastric tubes, dressing of wounds, assisting in bedside surgical procedures such as incision and drainage, chest tube insertion, provision of pre-operative and post-operative nursing care to patients, health educating and counselling patients and their relatives, provision of emotional and psychological support to patients (especially those that are critically and terminally ill) and their bereaved relatives, conducting last office duties and ensuring a safe and hygienic work environment.</p>\r\n<p>Equipment handled: Analogue and digital thermometer, analogue and digital sphygmomanometer, stethoscope, pulse oximeter, glucometer, stadiometer, weighing scale, nebulizer, oxygen cylinder and oxygen delivery unit, ambu bag, sterilizer, wound dressing set, automated suctioning machine.&nbsp;</p>', ' Nursing Officer II', 'Delta State University Teaching Hospital', '10-03-2015', '21-12-2016', '<p>Admission and discharge of patients into the ward, history taking and writing of in-patients admission notes, summary notes and discharge notes. Measurement of vital signs such as temperature, blood pressure, respiratory rate and pulse rate and measurement of patients&rsquo; weight and height. Administration of medications to patients via enteral and parenteral routes. Monitoring of intravenous fluid, blood transfusion, monitoring of fluid input and output, administration of supplemental oxygen, passage and removal of urinary catheters and nasogastric tubes, dressing of wounds, assisting in bedside surgical procedures such as incision and drainage, chest tube insertion, provision of pre-operative and post-operative nursing care to patients, health educating and counselling patients and their relatives, provision of emotional and psychological support to patients (especially those that are critically and terminally ill) and their bereaved relatives, conducting last office duties and ensuring a safe and hygienic work environment.</p>\r\n<p>Equipment handled: Analogue and digital thermometer, analogue and digital sphygmomanometer, stethoscope, pulse oximeter, glucometer, stadiometer, weighing scale, nebulizer, oxygen cylinder and oxygen delivery unit, ambu bag, sterilizer, wound dressing set, automated suctioning machine.&nbsp;</p>', '2020-01-14 10:34:00');
